        (1074152, 'Claudia Lennear', NULL, 'Originaire de Providence, dans l''Etat de Rhode Island, Claudia Lennear déménage en Californie au tournant des années 1960, où elle devient l''une des choristes les plus en vue de l''industrie musicale. Elle chante derrière Joe Cocker, Leon Russell, George Harrison, Ike &amp; Tina Turner ou Taj Mahal, et publie un remarquable album solo en 1973, intitulé Phew. L''année suivante, elle pose pour Playboy et joue le rôle d''une secrétaire dans Le Carnardeur de Michael Cimino, avant de prendre sesdistances avec le show business. Elle est aujourd''hui professeure d''espagnol, d''anglais et de français dans un lycée californien. Elle a accueilli, nous confie-t-elle par téléphone, comme « une divine surprise » la proposition de Morgan Neville detémoigner dans son documentaire Twenty Feet From Stardam.', NULL, 1, '/w0oxuPiLiv2NmsRhfBSEaa2Toa7.jpg'),
