        (1074378, 'Vedat Erincin', '1957-01-01', 'Vedat Erincin (1957 in Istanbul) ist ein in Deutschland wirkender Schauspieler türkischer Herkunft. Der Mitbegründer des Wuppertaler Wupper-Theaters und ehemalige Leiter des Arkadaş Theaters widmet sich der interkulturellen Theaterarbeit. Erincin kam 1978 nach Deutschland und begann hier ein Textilstudium. Daneben inszenierte er in türkischen Vereinen bereits Theaterstücke. 1986 stieß er als Berufsschauspieler zum Ensemble des Arkadaş Theaters. 1991 war er Mitbegründer des Wupper-Theaters in Wuppertal, wo er bis 2003 tätig war. Danach als Schauspieler, Regisseur undKindertheaterautor wieder am Arkadaş übernahm er dort bis 2006 die Leitung des Theaters. Auch Hörspielarbeit als Sprecher, u.a. in den WDR-Produktionen Fremde Heimat (1992) von Ismail Dogan und Nursel Köses Der Schlangenbrunnen (2000). Erincin gehörte auch zum Ensemble der Uraufführung von Sema Merays Wegen der Ehre (2008). Zu seinen ersten Film- und Fernsehauftritten gehört die Rolle des Kadir in Evet, ich will! (2008). In der deutsch-türkischen Kinokomödie Almanya – Willkommen in Deutschland, die ins Wettbewerbsprogramm der Berlinale 2011eingeladen wurde, übernahm er die Hauptrolle des alten Hüseyin. Im selben Jahr wurde er für seine Nebenrolle eines aufgeklärten islamischen Geistlichen in Shahada für den Deutschen Filmpreis nominiert.', 'İstanbul, Türkiye', 1, '/mSfMOseGjFA7uSdysq841xwl2No.jpg'),
