        (1076332, 'Bernardo Sassetti', '1970-06-24', 'Started studying classic piano at age 9. Studied jazz with Horace Parlan and Sir Roland Hanna. Started playing jazz professionally in 1988 in Portugal, and has since given concerts all over the world. Has recorded many CDs, in solo or as part of different ensembles, including a participation in Guy Barker''s 3rd CD, alongside the London Philarmonic Orchestra and Sting.

He has scored original soundtracks for some classic Portuguese movies, such as Os Crimes de Diogo Alves (1911) (João Tavares) and Maria do Mar (1930) (J. Leitão de Barros) as well as for more recent films: Facas e Anjos (2000) (Eduardo Guedes) and "Aniversário" (Mário Barroso, 2000).

With his trio he represented Portugal in the 1st European Jazz Festival in Athens, 2001.

- IMDb Mini Biography By: Miguel Tecedeiro', 'Lisbon - Portugal', 1, '/lT83vz9E8TSShqgDEJiLBPee0Cu.jpg'),
