        (1076675, 'Mike Monty', '1936-10-23', 'An expatriate American actor (born Michael O''Donahue in Chattanooga, Tennessee), Monty settled in Italy in the mid-sixties and had a low-key career as a supporting player in many B-movies, including spaghetti westerns and horror movies. His appearances were often uncredited. During the 1970s, he appeared in several soft-porn exploitation movies. In the early eighties, he fell in love with the Philippines and relocated there, where he significantly boosted his career by appearing in many movies shot in the Archipel. Most of his film were B or Z-grade actioners, sometimes locally produced for export.', 'Chattanooga, Tennessee, USA', 1, '/pJbfaZGDthcszjv8jYswO6MMjGU.jpg'),
        (1076694, 'Jeff Jarrett', '1967-07-14', 'Jeffrey Leonard "Jeff" Jarrett is an American professional wrestler and wrestling promoter signed with Total Nonstop Action Wrestling (TNA)[citation needed], which he co-founded along with his father, Jerry. He is well-known from his multiple runs in World Championship Wrestling (WCW) and World Wrestling Federation (WWF) during the 1990s. A third-generation wrestler, Jarrett has held seventy championships in various promotions throughout his career. Within TNA, he is a former six-time NWA World Heavyweight Champion and is also a former four-time WCW World Heavyweight Champion, and one-time AAA World Heavyweight Champion. He has also accumulated five additional world title reigns, being a three-time USWA Unified World Heavyweight Champion and two-time WWA World Heavyweight Champion. He achieved notable championship success in the World Wrestling Federation (WWF), becoming a six-time Intercontinental Champion (a record from 1999–2004), and one of four men to hold both the Intercontinental and European Championshipssimultaneously. He is the first wrestler to be a two-time King of the Mountain, and also won Mexican promotion Asistencia Asesoría y Administración''s (AAA) Rey de Reyes tournament in 2004. Between the WWF, WCW, and TNA, Jarrett has held twenty-two total championships as well as other numerous regional titles.', 'Hendersonville, Tennessee, USA', 1, '/jmo6GK4KMpxhVQFYVd2hgwJdx4v.jpg'),
        (1076701, 'Dustin Runnels', '1969-04-11', 'Dustin Patrick Runnels is an American professional wrestler. Runnels is best known as Goldust in WWE. He is also known for performing in various companies such as World Championship Wrestling and Total Nonstop Action Wrestling as Dustin Rhodes. Among the other names Runnels has performed under are Black Reign and Seven. Runnels is the son of "The American Dream" Dusty Rhodes and the half brother of Cody Rhodes.  Between WWF/E and WCW, Rhodes won 17 total championships. In World Championship Wrestling, he was a two-time United States Champion, a one-time Six-Man Tag Team Champion, a two-time World Tag Team Champion, and aone-time NWA World Tag Team Champion. In World Wrestling Federation/Entertainment, he is a three-time Intercontinental Champion, a nine-time Hardcore Champion, and a one-time World Tag Team Champion.', 'Austin, Texas, USA', 1, '/3ML5E41WDv8lDSrB4ST348UYTsG.jpg'),
