        (1079506, 'Luis Ortega', '1980-07-12', 'Luis Ortega was born in Buenos Aires in 1980. In 1999, at the age of nineteen, he directed his first feature film, Caja Negra, which received multiple international awards and launched him as one of the most promising and innovative filmmakers in Argentina. Since then, he developed a filmography with a strong signature, becoming one of the most daring and attractive voices in the independent Latin American scene, including Monobloc, Dromómanos and Lulú. In 2015, he wrote and directed Historia De Un Clan, a widely popular and critically acclaimed eleven-episode series. In 2016, he also directed the first two episodes of the successful series El Marginal.', 'Buenos Aires, Argentina.', 1, '/qBccrsXmCbUGmauUuae7TkgylPb.jpg'),
