        (1086110, 'Leandro Hassum', '1973-09-26', 'Leandro Hassum é um ator, dublador e humorista brasileiro. É conhecido, principalmente, por seus papéis na televisão. Nasceu em 26 de setembro de 1973 em Niterói, Rio de Janeiro. Começou a fazer teatro aos 16 anos e atuou em diversos espetáculos. Também é reconhecido como um dos melhores expoentes do "stand up comedy" brasileiro. Atualmente divide-se entre os palcos, televisão e cinema. Entre seus filmes de maior sucesso estão os longas Até que a sorte nos separe (2012) e Até que a sorte nos separe 2 (2013). Neste último trabalhou ao lado de Jerry Lewis.', 'Niterói, Rio de Janeiro, Brazil', 1, '/obb2KbnguJjboL41BDBXIAPEW05.jpg'),
