        (1091772, 'Stacey Turner', NULL, 'Stacey Turner was born in Atlanta, GA to Peggy, a real estate broker and Jerry Turner, a government employee with the U.S. Department of Education. Stacey attended Georgia State University and after college moved around the U.S. for six years while pursuing a television news career. Atlanta was the final stop on the news circuit, where she worked as the morning reporter for CBS46''s Good Morning Atlanta. While in the news biz Stacey earned an Emmy nomination, two Society of Professional Journalists Green Eyeshade Awards, and was selected as a favorite television personality by a local Texas magazine.

Her first acting role was in a church play at the age of 6. For Stacey, being from a small town on the outskirts of Atlanta was about as far from Hollywood as a girl could be. It wouldn''t be until many years later, doing a play while working as a reporter in Savannah, that the interest would be re-sparked. Stacey decided to leave a career in the news industry to pursue acting full time. It wasn''t long before she landed a small role in the film The Blind Side (2009) starring Sandra Bullock. While in Atlanta she also booked roles on The Army Wives and Drop Dead Diva. Shortly after that Stacey moved to Los Angeles to continue her career. Since her move she has had the opportunity to work on several films with directors such as Sophia Coppola, The Bling Ring (2013), Phil Joanou, The Veil (2015) and Jonathan Liebesman, Battle: Los Angeles (2011). She has also worked on top rated television shows including Bones, Scandal, Graceland and Legends.

- IMDb Mini Biography', 'Atlanta - Georgia - USA', 1, '/hUUrf8wRvAKIlLcjwqCrTBk5QQl.jpg'),
