        (1091908, 'Édith Piaf', '1915-12-19', 'Édith Piaf, de son vrai nom Édith Giovanna Gassion, née le 19 décembre 1915 à Paris et morte le 10 octobre 1963 à Grasse, est une chanteuse française de music-hall et de variétés. Considérée comme l''archétype de la chanteuse française, elle reste cinquante ans après sa mort la plus célèbre chanteuse francophone, tant en France qu''à l''étranger.

Surnommée à ses débuts « la Môme Piaf », elle est à l''origine de nombreux succès devenus des classiques du répertoire, comme La Vie en rose ; Non, je ne regrette rien ; Hymne à l''amour ; Mon légionnaire ; La Foule ; Milord ; Mon Dieu ou encore L''Accordéoniste.

Chanteuse à voix, elle a inspiré de nombreux compositeurs, fut le mentor de nombreux jeunes artistes et a connu une renommée internationale, malgré une fin de carrière rendue difficile par de graves problèmes de santé et la mort à l''âge de 47 ans.

Édith Piaf fut aussi comédienne tant au théâtre qu''au cinéma.', 'Paris,France', 1, '/q7D2JmdE9BwdJZNcy68OUjF8j3H.jpg'),
        (1091997, 'Edwin August', NULL, 'Edwin August (b. 20 November 1883, Saint Louis, Missouri; d. 4 March 1964, Hollywood, California) was an American actor, director and screenwriter of the silent era. He appeared in 152 films between 1909 and 1947. He also directed 52 films between 1912 and 1919. ', NULL, 1, '/u9f9esvbAuwPnyVqRJlMtOks34Y.jpg'),
