        (1092019, 'La Fouine', '1981-12-25', 'Laouni Mouhid, dit La Fouine, né le 25 décembre 1981 à Trappes (Yvelines), est un rappeur français d''origine marocaine. Il quitte l''école à 14 ans pour se consacrer à la musique. Plus tard, La Fouine a créé Banlieue Sale Music, son propre label. La Fouine a été élu le meilleur artiste français au MTV Europe Music Awards en 2011 et meilleur artiste masculin au Trace Urban Music Awards en 2013. En avril 2014, La Fouine a créé un autre label, Dynastie Music avec comme première signature Sindy. Après Drôle de parcours en 2013, il sort Team BS en 2014 et devient disque d''or', 'Trappes, Yvelines, Ile-de France, France', 1, '/nnBauiQQcr01s8OFZoFP7fMrTME.jpg'),
