        (1093967, 'Tara Cardinal', '1978-03-10', 'Tara Cardinal is the daughter of a psychic and a musician. Tara grew up on a small farm in Indiana. Cardinal moved out on her own at age 16 and worked three jobs in order to initially support herself. She was discovered in a shopping mall and acted in her first movie in 2006. Tara frequently appears in horror and fantasy films and likes to perform her own stunts. Moreover, Cardinal has not only acted on stage, but also has modeled for various comic book characters, performed at Renaissance Festivals, and even done live shows as a professional wrestler. A dedicated humanitarian and staunch advocate for children''s rights, Tara co-founded the non-profit peer counseling organization C.L.U.B. (Children Living Under Blindness) at age 12 and has toured middle schools in both America and Canada educating children on their rights and resources since the age of 15. Cardinal has a Bachelor''s Degree in Psychology. In addition, Cardinal writes poetry as well as writes for the websites the IndependentCritic.com and NerdRemix.com. She lives in Los Angeles, California.', NULL, 1, '/piAvMhqfni3hXY0khar8aNHCg9n.jpg'),
