        (1095778, 'Campbell Grant', '1909-11-07', 'Disney as an animator and story director for 12 years. He was also an expert on the rock paintings of the Chumash Indians of California.  His work for Disney included animation on Snow White and the Seven Dwarfs, character designs for Pinocchio, the story development for the "Night on Bald Mountain/Ave Maria" segment of Fantasia, writer for the Goofy cartoon They''re Off and the voice of Angus MacBadger in the "Wind in the Willows" segment of The Adventures of Ichabod and Mr. Toad.-http://disney.wikia.com/wiki/Campbell_Grant', 'Berkeley - California - USA', 1, NULL),
        (1095786, 'Benito Mussolini', '1883-07-29', 'Benito Amilcare Andrea Mussolini (né le 29 juillet 1883 à Dovia di Predappio dans la province de Forlì-Cesena dans la région Émilie-Romagne en Italie, mort le 28 avril 1945 à Giulino di Mezzegra), est un journaliste et homme d''État italien.  Fondateur du fascisme, il est président du Conseil du Royaume d''Italie, du 31 octobre 1922 au 25 juillet 1943, premier maréchal d''Empire du 30 mars 1938 au 25 juillet 1943, et président de laRépublique sociale italienne (RSI) de septembre 1943 à avril 1945. Il est couramment désigné du titre de Duce, mot italien dérivé du latin Dux et signifiant « Chef » ou « Guide ».  Il est d''abord membre du Parti socialiste italien (PSI) et directeur du quotidien socialiste Avanti! à partir de 1912. Anti-interventionniste convaincu avant la Première Guerre mondiale, il change d''opinion en 1914, se déclarant favorable à l''entrée en guerre de l''Italie. Expulsé du PSI en novembre 1914, il crée son propre journal, Il Popolo d''Italia (Le peuple d''Italie) qui prend des positions nationalistes proches de celles de la petite bourgeoisie. Dans l''immédiat après-guerre, profitant du mécontentement de la « victoire mutilée », il crée le Parti national fasciste (PNF) en 1921 et se présente au pays avec un programme politique nationaliste, autoritaire, antisocialiste et antisyndical, ce qui lui vaut l''appui de la petite bourgeoisie et d''une partie des classes moyennes industrielles et agraires.  Dans le contexte de forte instabilité politique et sociale qui suit la Grande Guerre, il vise la prise du pouvoir, en forçant la main aux institutions avec l''aide des actions de squadristi et l''intimidation qui culminent le 28 octobre 1922 avec la Marche sur Rome. Mussolini obtient la charge de constituer le gouvernement le 30 octobre 1922. En 1924, après la victoire contestée des élections et l''assassinat du député socialiste Giacomo Matteotti, Mussolini assume l''entière responsabilité de la situation. La série des « Lois fascistissimes » lui attribue des pouvoirs dictatoriaux et fait de l''Italie un régime à parti unique.  Après 1935, il se rapproche du régime nazi d''Adolf Hitler avec qui il établit le Pacte d''Acier (1939). Convaincu d''un conflit à l''issue rapide, il entre dans la Seconde Guerre mondiale au côté de l''Allemagne nazie. Les défaites militaires de l''Italie et le débarquement des Alliés sur le sol italien entraînent sa mise en minorité par le Grand Conseil du fascisme le 24 juillet 1943 : il est alors destitué et arrêté par ordre du roi. Libéré par les Allemands, il instaure en Italie septentrionale la République sociale italienne. Le 25 avril 1945, alors qu''il tente de fuir pour la Valteline déguisé en soldat allemand, il est capturé par un groupe de partisans, qui le fusille avec sa maîtresse Clara Petacci.', 'Dovia di Predappio', 1, '/iA66sgVz1kmckDCUwtXNOykaM79.jpg'),
