        (1104687, 'Michael Coulthard', '1968-12-08', 'Michael Sean Coulthard, better known by his stage name, Michael Cole, is an American professional wrestling commentator, wrestling show host, seldom wrestler, and former news journalist. He is signed to WWE where he served as commentator for SmackDown starting in 1999, before being shifted to the company''s flagship program, Raw, where he''s been since 2008 to the present.  In gimmick, as a catty, antagonistic commentator, Cole is prone to insinuations, harassment, and especially giving guest commentators a hard time. In addition, he''s noted for his locutions, such as "Vintage," references to his fans as "Cole Miners," and while speaking on behalf of the anonymous RAW general manager, "Can I have your attention please. And I quote..." When he first started out as a regular WWE commentor in 1999, he was a face. In 2010, however, he transformed into a heel for the first time. By September 2012, he became a face once more.  Beyond doing commentary for Raw, Cole performs in several other positions for the WWE: As of October 2012, he has done commentary for WWE Main Event; since December 7, 2012, Cole and former wrestler JBL, both notorious for their mouthy and aggressively opinionated gimmicks, have hosted their very own WWE YouTubeweb series, The JBL and Cole Show.', NULL, 1, '/80BqC8iaAwcbylyFwe7lgha0rip.jpg'),
