        (1106269, 'Kelly O''Neal', NULL, 'Kelly O''Neal is an actor, singer, writer, director, producer, and illustrator. Her acting credits include classical theater, musical theater, performance art, film, television, commercials, and stand-up comedy. She is the creator of The Gilda Sue Rosenstern Computer Internet Show, a web series, a live show, and a feature film now in production.

