        (1107197, 'Priyamani', '1984-06-04', 'Priyamani is an Indian multilingual film actress who works in Malayalam, Kannada, Tamil, Telugu and Hindi. She started her film career with her debut film in Kollywood called Kangalal Kaithu Sei alongside actor Vaseegaran. The film was a flop at the box-office and she moved on to Malayalam and Telugu films owing to a lack of offers in Tamil films. Priyamani has made her Tamil comeback with the internationally acclaimed Tamil film Paruthiveera and gained widespread recognition for her role as village girl Muththazhagu, receiving National Film Award for Best Actress and Tamil Nadu State Film Award for Best Actress for her performance.', 'Bangalore, Karnataka, India', 1, '/i1sZtQcphZWJij3LoR9M6QY9i4z.jpg'),
        (1107296, 'Ben Platt', '1993-09-24', 'Ben Platt is an American actor and singer known for originating the role of the title character in the Broadway musical Dear Evan Hansen, a performance for which he has won numerous awards, including the 2017 Tony Award for Best Actor in a Musical. Platt''s credits also include the role of Benji Applebaum in the musical films Pitch Perfect (2012) and Pitch Perfect 2 (2015).', 'Los Angeles, California, USA', 1, '/lYna8m9fUC5jSurHJTq5W0ysRT7.jpg'),
