        (1107724, 'Patricio Valladares', '1982-07-17', 'Patricio Valladares (Chillán, 17 July 1982) is an Chilean film director and screenwriter, best known for his work in horror films. An chilean film-maker who mixes elements of both arthouse and grindhouse, with an emphasis on modern extreme violence, action and some gore. Also involved in comics and short movies, and frequently injects black humor or homages to grindhouse movies, along with artistic cinematography, somewhat intellectual dialogue and the occasional surrealism. His serial-killers tend to make repeat appearances in his movies.', 'Chile', 1, '/6r0ZW5nb3gEtN8EMkJdqIoTDn3S.jpg'),
