        (1108117, 'Sidharth Malhotra', '1985-01-16', 'Sidharth Malhotra is an Indian actor and former model who appears in Hindi films. Malhotra began a career as a model at the age of 18. Dissatisfied by the profession, he went on to work as an assistant director to Karan Johar in the 2010 film My Name Is Khan. He made his acting debut with a leading role in Johar''s comedy-drama Student of the Year (2012), for which he received a Filmfare Award for Best Male Debut nomination.

Malhotra played an aspiring businessman in the critically praised comedy-drama Hasee Toh Phasee in 2014, following which he starred as a hardened criminal in the romantic thriller Ek Villain (2014) and an aspiring author in the family drama Kapoor & Sons (2016). The latter two rank among Malhotra''s highest-grossing films, with a worldwide gross of over ₹1 billion (US$15 million) each.', 'Delhi, India', 2, '/ms0za8rU7SwBOboUc0G9jRLC1VW.jpg'),
        (1108119, 'Varun Dhawan', '1987-04-24', 'Varun Dhawan is an Indian actor working in Bollywood films. The son of film director David Dhawan, he studied Business Management in England, after which he worked as an assistant director to Karan Johar on the 2010 drama My Name Is Khan. Dhawan made his acting debut with Johar''s 2012 romantic comedy Student of the Year, a box office success, for which he received a Filmfare nomination for Best Male Debut. In 2014, he starred as the protagonist of two commercially successful comedies— Main Tera Hero and Humpty Sharma Ki Dulhania.', 'Mumbai, Maharashtra, India', 2, '/oBhlzVq6mq0dEt1kgYurrmiaWNw.jpg'),
        (1108120, 'Alia Bhatt', '1993-03-15', 'Alia Bhatt is an Indian actress who appears in Bollywood films.

Alia is the daughter of director, producer, and screenwriter Mahesh Bhatt and Soni Razdan, a film actress and director. She has one sister Shaheen Bhatt, a half sister Pooja Bhatt, and a half brother Rahul Bhatt. Actor Emraan Hashmi and director Mohit Suri are her cousins and producer Mukesh Bhatt is her uncle. Alia has completed high-school from Jamnabai Narsee School IB in May 2011.', 'Mumbai, Maharashtra, India', 1, '/gu1Sf68cuMgSxSXIsVqG00aCmSy.jpg'),
