        (1108832, 'Betty Farrington', '1898-05-14', 'From Wikipedia, the free encyclopedia

Betty Farrington (May 14, 1898 – February 3, 1989) was an American character actress active from the 1920s through 1960.

Born in Missouri''s largest city, Kansas City, Betty Farrington would play mostly supporting and minor roles during her career, although she would occasionally be given a featured or leading part, appearing in almost 100 films during her career. Some of the more notable films she appeared in include: Preston Sturges'' The Lady Eve (1941), starring Barbara Stanwyck and Henry Fonda; 1942''s My Favorite Blonde and 1947''s My Favorite Brunette, both starring Bob Hope; the classic film noir Double Indemnity (1944), starring Fred MacMurray, Stanwyck, and Edward G. Robinson; 1944''s The Uninvited, starring Ray Milland and Ruth Hussey; Cecil B. Demille''s Unconquered (1948), starring Gary Cooper and Paulette Goddard; the epic Samson and Delilah (1950), with Victor Mature and Hedy Lamarr in the title roles; Father of the Bride (1950), directed by Vincente Minnelli, and starring Spencer Tracy, Joan Bennett, and Elizabeth Taylor; and Minnelli''s 1953 The Band Wagon, starring Fred Astaire and Cyd Charisse.  Her final big screen appearance would be in 1956''s The Fastest Gun Alive, starring Glenn Ford. Farrington would make guest appearances on several television shows in the late 1950s, including Sergeant Preston of the Yukon and Perry Mason. She died in San Diego three-and-a-half months before her 91st birthday.', 'Kansas City, Missouri, USA', 1, NULL),
        (1108851, 'Brian A. White', NULL, '', NULL, 1, NULL),
        (1108859, 'Steve Borden', '1959-03-20', 'From Wikipedia, the free encyclopedia

Steve Borden (born March 20, 1959), better known by his ring name Sting, is an American retired professional wrestler, signed with World Wrestling Entertainment (WWE) in an ambassador role. He is best known for his time spent with World Championship Wrestling (WCW) and Total Nonstop Action Wrestling (TNA).

Sting is a 15-time world heavyweight champion, having held the NWA World Heavyweight Championship twice, the WCW World Heavyweight Championship seven times, the WCW International World Heavyweight Championship twice, the TNA World Heavyweight Championship four times and the WWA World Heavyweight Championship once. He is a WCW Triple Crown winner, has held 21 total championships between WCW and TNA, and is the only man to hold the NWA, WCW, and TNA World Titles in his career. In 2002, after over a year and a half of hiatus, Borden toured Europe with the World Wrestling All-Stars (WWA) promotion throughout November and December. His first match in the WWA took place on November 28, 2002, in Dublin, Ireland, where he reunited with Lex Luger to defeat Buff Bagwell and Malice. At The Retribution on December 6, 2002 in Glasgow, Scotland, United Kingdom, Sting lost to Luger in a bout for the vacant WWA World Heavyweight Championship. Sting defeated Luger to claim the WWA World Heavyweight Championship in Zurich, Switzerland, on December 13

Despite negotiations, Borden until the end of his career never signed a contract with WWE. His only live appearance on a television program owned by the organization until 2014 occurred on the final edition of WCW Monday Nitro in March 2001; he subsequently appeared in WWE media only through archive materials acquired by the promotion upon its purchase of WCW. Owing to his loyalty to the now-defunct promotion, Sting came to be known as "The Franchise of WCW" during the 1990s. WWE has named Sting the greatest superstar in WCW history, and described him as "one of the most popular and respected competitors of all time." After WCW''s closing Sting signed with TNA where he was announced as the inaugural inductee into the TNA Hall of Fame in June 2012. Pro Wrestling Illustrated readers voted Borden "Most Popular Wrestler of the Year" a record four times. Borden made his debut in WWE at Survivor Series 2014, and was inducted into WWE''s Hall of Fame in 2016.  Borden was an admitted anabolic steroid user in the 1980s. He became a born-again Christian in August 1998, after confessing his adultery, and substance and alcohol abuse to his then-wife. Borden has two sons, Garrett Lee and Steve, Jr. and a daughter named Gracie, who was born in 2000. His elder son Garrett attends Azusa Pacific University, where he plays college football as a running back. Steven attended Kilgore College, where he played tight end; on December 19, 2012, he committed to attend the University of Kentucky.  After the 2015 NFL Draft, Steven was invited by the Kansas City Chiefs to try out for the team at their rookie mini-camp.  Borden married his second wife Sabine in 2015, shortly after WrestleMania 31.', 'Omaha, Nebraska, U.S.', 1, '/6CAEsFah0QghdSIz1mZVT9lczBE.jpg'),
