        (1115333, 'Bruce LaBruce', '1964-01-03', 'Bruce LaBruce is an internationally acclaimed Canadian filmmaker, photographer, writer, and artist based in Toronto. Along with a number of short films, he has written and directed nine feature films, including Gerontophilia, which won the Grand Prix at the Festival du Nouveau Cinema in Montreal in 2013, and Pierrot Lunaire, which won the Teddy Award Special Jury Prize at the Berlinale in 2014. Most recently, LaBruce has been honoured with film retrospectives at both TIFF/Bell Lightbox 2014, and at the Museum of Modern Art in New York, 2015. The MoMA retrospective featured all nine of LaBruce’s features as well as a program of short films. All of the films have now become part of MoMA’s permanent film collection. His films explore themes of sexual and interpersonal transgression against cultural norms, frequently blending the artistic and production techniques of independent film with gay pornography.', 'Tiverton, Ontario, Canada', 1, '/vtVlBQw9OaletV3EfYWwzMDFFQM.jpg'),
