        (1119768, 'Marguerite Marsh', '1888-04-18', 'From Wikipedia

Marguerite Marsh (April 18, 1888 – December 8, 1925) was an

American actress of the silent era. She appeared in 73 films between 1911 and

1923.

Marsh was the eldest child of S. Charles Marsh and May T.

Warne born in Lawrence, Kansas, and she died in New York City from

complications of bronchial pneumonia. She was the sister of actress Mae Marsh

and cinematographer Oliver T. Marsh.

According to the 1910 Census for Los Angeles, California,

Margeurite Marsh was living with her mother, May, and stepfather, William Hall,

and she was listed as being married to Donald Loveridge with a daughter Leslie

Loveridge. Her daughter appeared in one film called The Battle of Elderbush

