        (1126300, 'Nicolas Buchoux', '1977-11-16', 'Nicolas Buchoux est un acteur français.

 Après un DEUG d’Allemand, il suit la formation de l''Ecole des Enfants Terribles avant d’entrer, en 2001,  à  l''Ecole du Studio d’Asnières dirigée par Jean-Louis Martin-Barbaz. Il effectue aussi plusieurs stages, auprès de Jean-Claude Penchenat, Gildas Milin, David Lescot, Jacques Vincey ainsi qu’à l’Actor’s centre à Londres (programme européen intensif de 2 mois entre Londres, Paris et Berlin).  Au théâtre, il est dirigé entre autres, par Laurent Sauvage (Les Merveilles de C.Galéa), Frédéric Fachena (Le Cercle de Craie Caucasien de B.Brecht), Joachim Serreau (L’homme de paille de Feydeau, co-mis en scène par Nicolas Buchoux, Vengeance et Cie d’après Jacques Rebotier et Fragments d’une lettre d’Adieu… de N.Chaurette), Alexandre Zeff (Célébration de H.Pinter, récompensé par le prix mise en scène 2008 du Théâtre 13), Harry Burton (Party Time de H.Pinter; John Gielgud Theatre de Londres), et aussi Marina Glorian, Maxime Leroux, Valérie Castel-Jordy, Anouch Paré, Nathalie Krebs et Benjamin Kauffmann.  Au cinéma, il tourne sous la direction de Noémie Lvovsky,  Emmanuelle Bercot,  Franck Phélizon, Patrice Leconte, Thomas N’Gijol et dernièrement Philippe de Chauveron dans « Qu’est ce qu’on a fait au bon dieu ? »  A la télévision, il tourne avec Raphaël Frydman, Raoul Peck, Philippe Triboit, Gilles Bannier, Jean-Marc Brondolo, Nicolas Cuche, Julia Cordonnier, Franck Apprédéris, Robert Kechichian, Laurent Heynemann, Gérard Jourd’hui et dernièrement, Olivier De Plas dans la 2ème saison de la série télé Q.I. , où il tient un rôle récurrent.', 'Courbevoie, Hauts-de-Seine, France', 1, '/jqRQEtvTOaTs0gCZRb86wXLwkRB.jpg'),
