        (1129567, 'Patty Duffek', '1963-08-27', 'Lovely, busty and shapely brunette stunner Patty Duffek was born on August 27, 1963 in Woodland Hills, Los Angeles, California. Duffek graduated Magnu Cum Laude from college. She was working at a Pioneer Chicken outlet in Phoenix, Arizona when she was discovered by "Playboy" magazine through their Great 30th Anniversary Playmate Search. Patty was the Playmate of the Month in the May, 1984 issue of "Playboy." Duffek appeared in one "Playboy" video and posed for several "Playboy" newsstand special editions. Patty portrayed federal agent Pattycakes in three enjoyably lowbrow action exploitation movies for writer/director Andy Sidaris: "Hark Ticket to Hawaii," "Picasso Trigger," and "Savage Beach." Patty Duffek now works as a social worker in Phoenix, Arizona.', 'Woodland Hills, Los Angeles, California, USA', 1, '/bLqUv9Xy58T5qumwY2iJ0GA84M7.jpg'),
