        (1129883, 'Paul Campbell', NULL, 'Paul Campbell is heralded as Jamaica''s most popular contemporary actor of screen and stage. In Jamaica his distinctive voice can be heard, on the local radio as the voice of Fame-FM where he delivers the station''s many sound bites. He is recognized not only in Jamaica, but also throughout the Caribbean, the African American Communities in the United States, Canada, United Kingdom, Japan and throughout Africa, For his leading roles in Palm Picture''s _Lunatic, The (1991/I)_, the notorious and unforgettable villain priest, in Dancehall Queen (1997) and the highest grossing film out of Jamaica, Third World Cop (1999). In this film, Paul portrays a larger than life heroic cop Capone, who must wrestle with his personal and professional loyalties.  His screen credits include soon to be released Jamaica Beat with Sheryl Lee Ralph and Wide Sargasso Sea, shown on Showtime. His latest film is _Shottas (2001)_. Television credits include leading roles in Entry Denied, Final Verdict, Country of the one-Eyed God, and Salome for Television Jamaica Corporation.  His stage credits include leading roles in Intermission, Flame Heart, Checkers, The Mikado, and White Witch of Rose Hall, Foreign Mind, Masquerade and Mansong for various prestigious theaters companies. Paul Campbell has also worked in the United Kingdom and the United States, his credits include the lead role of Bogle in "Catch A Fire" for BBC TV, and the lead roles in the stage productions Nine Nights, Whiplash, Jumbie Jamboree and Shakespeare''s "The Merchant of Venice". His New York credits include the world premiere of the Stage Production, Christopher Columbus by Nikos Kazantzakis (Zorba the Greek and The Last Temptation of Christ) directed by Tony Award winner, Mr. Lloyd Richards.  Mr. Campbell, who attended the Jamaica School of Drama in Kingston, Jamaica is also an accomplished painter whose works have been exhibited in Kingston, Jamaica, London, England and Lugano, Switzerland. Mr. Campbell was honored at the Media-mix 25th Anniversary Award Ceremony were he won the Doctor Bird Award (The Jamaican Academy Award) for excellence of performance in film and Television. Mr. Campbell has also been awarded the best actor award at the Jamerican Film and Music Festival two years in succession.', NULL, 1, '/yuqpEMUTNsGp4XFZDg1xcfbwwgc.jpg'),
        (1129945, 'Beatrice Gray', '1911-03-03', 'From Wikipedia, the free encyclopedia

Beatrice Gray (March 3, 1911 – November 25, 2009) was an American actress and dancer best known for her appearances in a series of western films during the 1940s and 1950s.

Gray was born Bertrice Kimbrough on a farm near Carthage, Illinois. She began working in the entertainment industry in Broadway productions, as well as a performer in nightclubs. She earned her first acting role in the musical, New Faces of 1935. After moving to California in 1937, she appeared in the New Faces of 1937 by RKO Pictures. She worked as a dancer for Busby Berkeley.

Gray appeared in a number of westerns throughout the 1930s, 1940s and 1950s, many of which were produced by Monogram Pictures. Her other films were with Universal Pictures, including the 1958 movie, Wild Heritage. She ultimately appeared in three films starring Hoot Gibson and Bob Steele - The Utah Kid, Marked Trails and Trigger Law (all 1944).', 'Carthage, Illinois, U.S.', 1, '/awtFEyFnZvBOlVBPB5mV5H1n1bN.jpg'),
