        (1133857, 'Adrianna Bertola', '1999-02-09', 'Was born in Southend-on-Sea, England, on 9 February 1999. Currently lives in London.

  Has an older brother called James.

  Attended Alleyn Court School in Southend, England from the age of 3 to 7.

  Studied ballet, modern, jazz and tap with Miss Vanda Morgan at her Performing Arts Academy from the age of 4.

  Attends the ''Sylvia Young Theatre School'' full time in London and is one of the youngest students ever to do so.

  Loves Facebook and keeps in close contact with all her old school, theatre, TV &amp; film friends.

  Was not seen the first time for the open casting of the ''Sound of Music'' as thousands of people turned up but did not give up, had her first call four weeks on. Six recalls later she was given the part and then had the honour of the Opening and Press night of Andrew Lloyd Webber''s new West End show.

  Has been in Hello magazine for a feature and photo shoot.

  Got a Blue Peter badge in 2006.

  Most embarrassing moment, swallowing her tooth on stage in the ''Sound of Music'' while singing Edelweiss.

  Favourite theatre show is ''Wicked'' (with Kerry Ellis) but ''Phantom of the Opera'' is a close second. And of course the fantastic ''Les Miserables''.

  Best memorable moments: getting her first acting part and meeting Kerry Ellis, funniest person met: Graham Norton and the scariest moment: The Tower of Terror at Disney MGM.

  Heavily involved with and supports the Cosette Project Charity to help abused and trafficked children.

  Attends the Royal Academy of Dance for Ballet.

  Won The Sylvia Young Theatre School Junior Acting Award 2009 &amp; 2011.', 'Southend, Essex, England, UK', 1, '/d5PJoVWPWF6Uy72sboLzy41fyDS.jpg'),
