        (1136135, 'Will Brill', '1986-06-11', 'Will Brill is an American actor best known for his role as Scott Brown in The OA. Brill grew up in Menlo Park, California and graduated from Gunn High School in nearby Palo Alto. Brill is a graduate of the Carnegie Mellon School of Drama. Wikipedia', 'Menlo Park, California, USA', 2, '/dMnnVxAMVmvbprdz87u9WNCmjsS.jpg'),
        (1136406, 'Tom Holland', '1996-06-01', 'Thomas "Tom" Stanley Holland (1st June 1996) is an English actor and dancer. He is best known for playing the title role in Billy Elliot the Musical at the Victoria Palace Theatre, London, as well as for starring in the 2012 film The Impossible. In 2015, Holland was cast as Peter Parker / Spider-Man in the Marvel Cinematic Universe. ', 'Kingston upon Thames, Surrey, England, UK', 12, '/l6zPRmg8NI7Y65G5GUqwvjxFdsx.jpg'),
