        (1136517, 'Sia', '1975-12-18', 'Australian singer and songwriter. She started her career as a singer in the local Adelaide acid jazz band Crisp in the mid-1990s. In 1997, when Crisp disbanded, she released her debut studio album titled OnlySee on Flavoured Records in Australia. Following the event, she moved to London, England and provided lead vocals for British duo Zero 7.

In 2000, Sia signed to Sony Music''s sub-label Dance Pool and released her second studio album, Healing Is Difficult, the following year. Displeased with the promotion of the record, she signed to Go! Beat and released her third studio album, Colour the Small One, in 2004. Dissatisfied with the project''s struggling to connect with a mainstream audience, Sia relocated to New York City in 2005 and began touring across the United States. Sia released her fourth and fifth studio releases, Some People Have Real Problems and We Are Born, in 2008 and 2010, respectively. In 2014, Sia released her sixth studio album, 1000 Forms of Fear, which was preceded by the top-ten single "Chandelier". On 29 January 2016, she released her seventh studio album This Is Acting.

Sia''s music incorporates hip hop, funk and soul as a base for her vocal styling. In 2014, she was ranked the 97th richest Australian person under the age of 40 by BRW magazine, with a reported net worth of AU$20 million. Her music has received an array of accolades, including ARIA Awards and MTV Music Awards.', 'Adelaide, South Australia, Australia', 2, '/zA1g1yZpuYMpoeCic13ejb3Ac4S.jpg'),
        (1136675, 'Kamran Usluer', '1937-01-01', 'Born in 1937 in İzmir. 

Died from lung cancer in 2004 in İstanbul.', 'İzmir, Türkiye', 1, '/q17ivqlcp7IQhQjI9CrMtHrOIGL.jpg'),
        (1136687, 'Konrad Becker', '1959-01-09', 'From Wikipedia, the free encyclopedia  Konrad Becker (born January 9, 1959 in Vienna) is a hypermedia researcher and interdisciplinary content developer, director of the Institute for New Culture Technologies-t0 and initiator of Public Netbase and World-Information.Org

As an actor Konrad Becker is most famously know for his role as Böckstiegel in Wolfgang Petersen''s anti-war drama Das Boot (1981).

As a musician Konrad Becker created Monoton, the crucial Austrian electronic music act providing distinguished soundscapes. The Wire magazine singled out Monoton’s record "Monotonprodukt07" as one of the 100 most important records of the 20th century. Konrad Becker has recently focused on notebook live jamming with minimalist rigor.

At the borderline between sound art, psychoacoustics and contemporary dance practices, Konrad Becker''s project has crossed a variety of genres over the years and has gone through various mutations and side projects. Starting with meta-mathematical and performative multimedia installations, from industrial ambience noise to audio software art and a dance context in the early rave scene he also developed theatrical productions.', 'Wien, Austria', 1, '/zMVZpvR4ggk9UkQFoqtBy7LuzRj.jpg'),
