        (1142371, 'Maurice Costello', '1877-02-22', 'From Wikipedia

Maurice George Costello (February 22, 1877 – October 29,

1950)[1] was an American prominent vaudeville actor of the late 1890s and early

1900s, who later played a principal role in early American films, as both a

leading man, supporting player and a director.

Costello was born in Pittsburgh, Pennsylvania to Irish

immigrants Ellen and Thomas Costello. He appeared in his first motion picture

in 1905, in which he had the honour of appearing in the first serious film to

feature the character of Sherlock Holmes in the movie Adventures of Sherlock

Holmes, in which Costello played the title role. He continued to work for

Vitagraph, being a member of the first motion picture stock company ever

formed, playing opposite Florence Turner. Among some of his best known pictures

are A Tale of Two Cities, The Man Who Couldn''t Beat God and For the Honor of

the Family. After an absence of some years he returned to the screen. He was

married to actress Mae Costello (née Altschuk). His descendants include two

daughters, actresses Dolores Costello and Helene Costello, a grandson John Drew

Barrymore, and a great granddaughter Drew Barrymore. He was one of the world''s

first leading men in early American cinema, but like a lot of other silent

screen stars, he found the transition to "talkies" extremely

difficult, and his leading man status was over. However, Costello was a

trouper, and continued to appear in movies, often in small roles and bit parts,

right up until his death in 1950.', 'Pittsburgh, Pennsylvania, USA', 1, '/yMalNKqJyPiXtCY4hEkYYG5Y2AP.jpg'),
        (1142406, 'María Teresa Orsini', NULL, '', NULL, 1, '/ei5j5JK3xRsOtOzrr7REO5LBbbI.jpg'),
        (1142516, 'William Graeff Jr.', '1893-09-02', 'William Graeff Jr. was born on September 2, 1893 in Pennsylvania, USA. He is known for his work on Monte Walsh (1970), Aaron Loves Angela (1975) and Planet of the Apes (1968). He died on June 30, 1968 in Los Angeles, California, USA.', 'Pennsylvania, U.S.', 1, NULL),
        (1142629, 'Tavi Gevinson', '1996-04-21', 'Tavi Gevinson (born April 21, 1996) is an American writer, magazine editor, and actress. She came to public attention at the age of 12, due to her fashion blog Style Rookie. By the age of 15, she had shifted her focus to pop culture and feminist discussion. Gevinson is the founder and editor-in-chief of the online Rookie Magazine, aimed primarily at teenage girls. In both 2011 and 2012, she appeared on the Forbes 30 Under 30 in Media list. In 2014, she was named one of "The 25 Most Influential Teens of 2014" by Time magazine.', '	Chicago, Illinois', 1, '/eO7twuptzQJkz2O89slpD5q0ECP.jpg'),
        (1142673, 'Laurent Malaquais', NULL, '', NULL, 1, NULL),
        (1142686, 'Gabriel Rush', NULL, 'Gabriel made his feature film debut in Moonrise Kingdom as Skotak, one of the principal khaki scouts (remember the tree house scene). What a thrill to work with Bruce Willis , Bill Murray and Edward Norton on his very first film. Other films include A Little Game Evan Oppenheimer, The Immigrant James Gray, and The Grand Budapest Hotel, reuniting Gabriel with director Wes Anderson. Most recently he worked on No Letting Go Jonathan D. Bucari, a powerful and timely film about a teenager suffering from a debilitating mental illness. Gabriel comes from a dance and theater background, and started tap dancing when he was 4 years old. He was discovered by his agent John Shea when he performed his first solo as a competitive dancer. When he was 11, he joined the cast of Billy Elliot in the role of Michael, under acclaimed director Stephen Daldry, first on the National tour then on Broadway. His agility and dance training paid off when in an episode of _"Blue Bloods" (2014) (Above and Beyond (#4.21))_ he was asked to do some of his own stunts and he loved it. Gabriel was able to skip his junior year in High School and is looking forward to graduating in 2015.', NULL, 2, '/ywELQdoOhahLGszeKAiGWybjcy2.jpg'),
        (1142720, 'Thomas Mann', '1991-09-27', 'Thomas Mann was born on September 27, 1991 in Portland, Oregon, USA. He is an actor, known forProject X (2012), Me and Earl and the Dying Girl (2015) and Hansel &amp; Gretel: Witch Hunters (2013).', 'Portland, Oregon, USA', 3, '/9URrxF1AKqL8SxxOeAVHKBAlWEx.jpg'),
        (1142724, 'Stephanie Corneliussen', '1987-04-28', 'Corneliussen was born on April 28, 1987 in Copenhagen, Denmark. She attended Johannesskolen in Frederiksberg and studied ballet in Copenhagen.[1] She has a degree in graphic design.  She was discovered at age 13 and encouraged to enter the Supermodel of Scandinavia contest, which was orchestrated byJacqueline Friis Mikkelsen, the CEO of Unique Models, an international modeling agency based in Copenhagen. She won the contest and subsequently began her international modeling career. She is an actress, known for Mr. Robot (2015), Hansel &amp; Gretel: Witch Hunters (2013) and Legends of Tomorrow (2016).', 'Copenhagen, Denmark', 1, '/il2329Aw2S88Ek4bo0Y0GhnhV6V.jpg'),
