        (1144901, 'Xavier Marc', '1948-01-16', 'Xavier Marc (Guadalajara, Jalisco, México, 16 de enero de 1948) es un actor, director y docentemexicano. Sus padres fueron Jesús Rivera y María Marc. Sus hermanos son: Guadalupe, Sara, Eloísa, Blanca Esthela, José, Rodolfo, José Luis, Jorge y Hugo. Estudió actuación en la Escuela de Artes Teatrales del Instituto Nacional de Bellas Artes, en el Estudio de Dimitrio Sarrás, en la Academia de Uta Hagen y Bergboff en Nueva York.  Sus producciones mas resaltadas de su trayectoria son: Amor sin maquillaje, Barrera de amor,Barata de primavera, María Belén, El alma no tiene color y El niño que vino del mar. Está casado con Claudia Obregón, con quien tuvo un hijo llamado Julio Cesar.', 'Guadalajara, Jalisco, Mexico.', 1, '/uy4G2L2MnmLeRwFl3UPXrQ6bvnl.jpg'),
