        (1146141, 'Charles Robinson', '1932-04-13', 'Charles Robinson graduated Phi Beta Kappa and magna cum laude from  Princeton in 1958. His theatrical family opened his acting career at age  three on Broadway. After college his first film was "Splendor in the  Grass," to be followed by "The Singing Nun," "Shenandoah" and "Take Her,  She''s Mine." After "Tall Story," "The Pleasure of His Company" and "The  Good Soup" all on Broadway, plus an army hitch, he and Mrs. Robinson  set up house in Los Angeles--close to film work and his television  appearances on, for instance, "Laramie," "The Alfred Hitchcock Show" and  "Bachelor Father."

Date of Birth  13 April  1932, Orange, New Jersey

Date of Death  22 July  2006, Palm Springs, California   (complications from Parkinson''s disease)', 'Orange, New Jersey, USA', 1, '/uf8LNVXSawgHEQLoSRLgS9hNNHq.jpg'),
        (1146154, 'Marilyn Harris', '1924-07-17', 'From Wikipedia, the free encyclopedia

Marilyn Harris (July 17, 1924 – December 1, 1999) was an American child actress who appeared in several Hollywood productions in the 1930s and 1940s. She is best remembered for her role as "Little Maria" in the 1931 horror film Frankenstein.  Harris was born in San Fernando, California and placed in a Los Angeles orphanage shortly after her birth. She was adopted by an area couple when she was a month old. Shortly after her adoption, she appeared in a Rin Tin Tin film. In her later years, Harris revealed that her adoptive mother forced her to pursue a screen career because of her own failed attempts to become an actress. Harris also claimed that her mother was physically and emotionally abusive.

In 1931, Harris won the role of "Little Maria" in the horror film Frankenstein. In arguably the film''s most memorable scene, Maria meets the fugitive monster (played by Boris Karloff) beside a lakeside and charms the monster with her innocence, humanity and friendship, something which he had not experienced with previously hostile, mistrusting adults. A children''s game is however tragically misinterpreted by the monster, and he ends up throwing Little Maria into the lake, unintentionally drowning her and turning the surrounding village''s population into a lynch mob, baying for revenge after the child''s body is found. The shot of Maria being thrown into the water was cut from original prints and only restored in the 1980s.

After appearing in Frankenstein, Harris continued her career in small roles in films. She left acting at the age of 19 shortly after marrying Wally Watkins, a bouncer she met while working as a cashier at the Hollywood Palladium. The couple had a son the following year. After Harris'' husband died in 1981, she remarried. Harris'' second husband, Carl, died in 1988. In 1983, 52 years after the film, Harris resumed a friendship with Frankenstein actress Mae Clarke who resided at the Motion Picture & Television Country House and Hospital. Clarke had put out a televised effort to locate Marilyn Harris during an interview with LA movie host Tom Hatton.', 'San Fernando, California, USA', 1, NULL),
