        (1153503, 'Émilie Cazenave', '1981-12-13', 'Extrait de Wikipedia, l''Encyclopedie libre.

Émilie Cazenave a débuté le théâtre très jeune, à l''École nationale d''arts dramatiques de Castres. Intégrant rapidement la troupe d''enfants acteurs, elle participe à plusieurs pièces de théâtre contemporain. Suite à l''obtention de son bac L en 1999, elle monte à Paris poursuivre ses études et persévérer dans sa voie. Elle rentre à l''école du Théâtre national de Chaillot en 2000, puis au Studio-théâtre d''Asnières en 2002. Elle décroche plusieurs rôles, dont le rôle principal dans la pièce Occupe-toi d''Amélie, grâce auquel elle sera nommée dans la catégorie révélation théâtrale lors de la Nuit des Molières 2006, le prix revenant finalement à Marilou Berry.

Informations et photo extraites de l''article Émilie Cazenave de Wikipedia, licence CC-BY-SA, liste complète des contributeurs sur Wikipedia.', 'Castres, France', 1, NULL),
