        (1153569, 'Farah Zeynep Abdullah', '1989-08-17', 'Farah Zeynep Abdullah was born on 17 August 1989, in Beşiktaş, Istanbul, Turkey. Her mother, Gülay, is of Turkish and Bosnian descents and her father, Osman, is of Iraqi Turkmen origin. She also has two brothers. Her secondary education was spent at the Lycée Français Saint Michel in Istanbul until her family moved to London where her father worked. Her entire family lives in England while she currently lives in Istanbul, Turkey due to her work commitments.', 'Besiktas, Istanbul, Turkey', 1, '/vH7W5ltmvpoUfDtwZ3FpupIxUuM.jpg'),
