        (1154054, 'Corey Hawkins', '1988-10-22', 'Corey Hawkins (born October 22, 1988) is an American actor. He is perhaps best known for playing Dr. Dre in the 2015 biopic film, Straight Outta Compton.

Hawkins was born in Washington, D.C. where he attended the Duke Ellington School of the Arts. He graduated from the Juilliard School in New York City, a member of the Drama Division''s Group 40. While studying at Juilliard, Hawkins received the prestigious John Houseman Award for excellence in classical theatre. Upon graduation, he began a career starring Off-Broadway and guest starring on television. Hawkins garnered a brief role in Marvel Studios''s Iron Man 3 and went on to star opposite Liam Neeson andJulianne Moore in Universal Pictures'' action-thriller Non-Stop.

In 2013, Hawkins made his Broadway debut as Tybalt in the revival of Shakespeare''s Romeo and Juliet. And in 2015, The Hollywood Reporter announced that Hawkins would join the cast of AMC''s The Walking Dead as Heath, a key character from Robert Kirkman''s comic series. Hawkins played Dr. Dre in the biopic Straight Outta Compton, from Universal Pictures, which was theatrically released on August 14, 2015. He has been cast in Kong: Skull Island, alongside Brie Larson, Samuel L. Jackson and Tom Hiddleston.

Description above from the Wikipedia article Corey Hawkins, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 'Arlington, Texas, USA', 1, '/wo6wWlI5Iuhfne0PDoBqUxgnBjR.jpg'),
        (1154140, 'Lilli-Ella Kelleher', NULL, '', NULL, 1, NULL),
        (1154165, 'Bruce James', '1975-04-25', 'Born and raised in the Okanagan Valley, the Irish/English Bruce left Kelowna shortly after highschool graduation and crossed the mountains to attend Simon Fraser University in Vancouver. There, he studied a range of varied topics like film noir, world literature, greek mythology, art history, stage design/direction and even pop culture before receiving his Bachelor Of Arts Degree with Honors. Struggling to decide whether to pursue writing or acting after leaving SFU, Bruce eventually decided on, well, not deciding, and remains active in both having completed feature film scripts and pilots for television. A true lover of movies (his first job was as an usher at Kelowna''s Paramount Theatre) and television (his parents were cable advocates, thank god) Bruce is at home in front of the camera, behind it, and as a fan of the industry, watching it.  IMDb Mini Biography By: HLPublicity', 'Kelowna, British Columbia, Canada', 1, NULL),
