        (1157592, 'Atiqah Hasiholan', '1982-01-03', 'Atiqah Hasiholan adalah aktris yang dibesarkan panggung teater Teater Satu Merah Panggung. Sempat menuntut ilmu ke Monash University. Atiqah tampil sebagai Jamilah sang tokoh utama dalam pementasan Jamila dan Sang Presiden. Tampil dalam film Berbagi Suami sebagai Ima, istri termuda Pak Haji yang diperankan El Manik, serta muncul dalam beberapa judul film televisi. Gadis kelahiran 3 Januari 1982 menjadi pemeran utama film Suster N.

Pertama kali tampil di layar lebar, saat Atiqah ditawari peran oleh Nia Dinata di film Berbagi Suami pada tahun 2006. Dari debut perdananya, Atiqah mulai mendapat banyak tawaran bermain film layar lebar. Cinta Setaman, Pintu Terlarang dan Gila-Gilaan adalah beberapa film yang pernah ia bintangi.

Di tahun 2012, Atiqah Hasiholan[1] tergabung dalam film terbaru Nia Dinata - Arisan! 2[2]. Di dalam film Arisan! 2, Atiqah adalah salah satu karakter baru dalam film Arisan 2. Karakter Ara yang ia mainkan menggambarkan seorang sosialita muda yang sedang naik daun.

Atiqah sempat dua kali mendapat nominasi Piala Citra, yaitu Pemeran Utama Wanita Terbaik di Festival Film Indonesia 2009 lewat film Ruma Maida dan untuk Pemeran Pendukung Wanita Terbaik di Festival Film Indonesia 2011 lewat film The Mirror Never Lies.', 'Jakarta, Indonesia', 1, '/eXtcd0NktpcRPzvLawO0PsdzS6L.jpg'),
