        (1160181, 'Ser''Darius Blain', '1987-03-10', 'Since graduating from The New York Conservatory for Dramatic Arts in 2009, Ser’Darius hasn’t stopped working.  He’s guest starred on Meet the Browns, NCIS, The Vampire Diaries, Super Fun Night and was a regular on ABC Family’s “Jane By Design.” After booking a lead role in Paramount Pictures’ 2011 remake of “Footloose” directed by Craig Brewer (Hustle and Flow/Black Snake Moan), Ser’Darius also landed a supporting role in JJ Abrams’ highly anticipated Star Trek sequel; “Star Trek Into Darkness.”  2013 proved to be Ser’Darius’ best year yet when he landed lead roles in 3 feature films! The highly talked about “Camp X-Ray” starring Kristen Stewart made its debut to a sold out crowd at The Sundance Film Festival on 1/17/14. Sony Pictures’ “When the Game Stands tall” and Chain Reaction film’s “Maybe Someday” will be released later this year. A talented and rising star, Ser’Darius Blain continues to hone his craft and follow his passion for creativity and achievement.

