        (1163715, 'Brayden Patterson', '1992-02-09', 'Brayden Patterson is an Actor, American Film Director, and producer.

Brayden Patterson is the stage name for actor Brian Newman. He started his career very young as a background actor in a Christmas play put on by his church. Ever since then he had decided that acting was what he wanted to do with the rest of his life.

After acceptance into Cast Images Talent Agency as an actor he then was enrolled in professional basic acting classes. Brayden then was asked to attend iPOP which is the "International Presentation Of Performers" in Los Angeles, California, Brayden decided to pass on this first major career offer.

Brayden has since been cast in a independent feature film called "Hercules: The Brave and The Bold." The film is in production and Brayden is playing Zeus a lead role in the film. The film has also introduced Brayden with an opportunity to be on television. The Mayhem Network is starting a new TV show by CAW Productions called "ThriveTV," and Brayden along with some fellow cast members will be on one "ThriveTV" episode promoting the film.

Brayden''s next job was an extra in the short film called "Hero Man." "Hero Man" will be shown in different film festivals around the world. It premiered on July 11,2012 at the Tivoli Theatre under Cinema St Louis FIlmmaker''s showcase

Also in 2012 Brayden has been cast in roles for three short films one called "Resolve" and also a role as a drug trafficker gamer in a road rage film titled "To Inflict" going in as a first time film producer in late 2012.', 'Granite City, Illinois U.S.', 1, '/cJovT2FBrS2oorUgaIyEiNZS87G.jpg'),
