        (1170106, 'Anthony Chen', '1984-04-18', 'Born in 1984, Anthony Chen enrolled in the School of Film and Media Studies, Ngee Ann Polytechnic in 2001 to pursue his passion for film-making. His graduation film G-23, which he wrote and directed, screened at over 35 film festivals and won awards in Korea, France, Belgium, Malaysia and Singapore. His short film AH MA was awarded the Special Mention award at the prestigious 60th Cannes Film Festival, the first Singaporean film to garner an award at the festival. His debut feature, ILO ILO won the Camera D''or for the best debut feature at the 66th Cannes Film Festival.', 'Singapore', 1, '/nHNxzUf3pfyLLxg67Nm2kTuWBbl.jpg'),
