        (1172668, 'Leesa Rowland', NULL, 'Leesa, the daughter of an artist and a college professor, grew up in Austin, Texas. She studied broadcast journalism at Texas Tech and acting at the Stella Adler Studio in Los Angeles, CA . Leesa has a vast cult following for her role as Victoria in Troma Entertainment''s Class of Nuke ''Em High Parts 2 and 3 and also appeared in Return To Nuke ''Em High. She acted in Troma''s television series Troma''s Edge along with Lloyd Kaufman and Debbie Rochon. She co-starred in Travis Campbell''s Slaughter Daughter as Phyllis Adjani as an eccentric mother who drives her daughter to insanity. The movie won best feature film at Orlando''s 7th Annual Freak Show Film Festival. Leesa co-starred in a web series called Two City Girls with fellow Troma actress Lisa Gaye and also appeared on Oxygen''s Jersey Couture. Leesa''s biggest passion in life is animal advocacy and she has been a vegan most of her life. She has been active with national non-profit organization Last Chance for Animals since 1989 and is the founder and president of the New York non-profit group Animal Ashram.   Mini Biography By: Leesa Rowland', NULL, 1, '/iNXmTlJuijhqh68e4qVt09iCMWz.jpg'),
