        (1175944, 'Jaime Blanch', '1940-09-09', 'Jaime Blanch es hijo de los también actores José Blanch y Concha Montijano y sobrino de Montserrat y Modesto Blanch. Desde niño siguió la tradición familiar y apareció con apenas trece años en la gran pantalla en la película La guerra de Dios (1953), aunque tuvo su primer gran éxito con Jeromín, rodada el mismo año 1953. Aunque en más de medio siglo de carrera artística ha trabajado regularmente en el cine, la televisión y el teatro, ha sido este último medio el que ha consolidado su prestigio. Ha protagonizado, entre otras obras, Olvida los tambores (1970), Adiós, señorita Ruth (1972), Herminia (1979), Petra Regalada (1981),La dama duende (1990), Perdidos en Yonkers (1992), Amor, coraje y compasión (1995), Un marido ideal (1996), El botín (1997), Descalzos por el parque (2001) y La ratonera (2005). Está casado con la actriz Marta Puig. En el verano de 1980 se separó de María José Moreno, con la que tuvo dos hijos, nacidos en 1967 y 1971.', 'Madrid - Spain', 1, '/qLdzZgyjU0m8cuY7zufGoeURHtx.jpg'),
