        (1178738, 'Hamid Djavadan', '1953-11-11', 'Hamid Réza Javdan débute sa carrière aux Etats-Unis en 1976, au sein du Théâtre Iranien et du Living Théâtre. Il poursuit sa formation au Canada en étudiant la Comédia dell’Arte et d’autres formes théâtrales telles que le masque et l’art martial Bâlinais, la danse, le maquillage, le chant ; en France il travaille à la Cartoucherie de Vincennes ainsi qu’avec d’autres compagnies. Il met en scène de nombreuses pièces de théâtre et joue aussi en qualité d’acteur de cinéma.  Depuis 1983, il a interprété des auteurs tels que Ben Jonson, Marlowe, Shakespeare, Marivaux, Giraudoux, J.C Carrière, W.B Yeats, Lorca, Aziz néçin… ainsi que des auteurs Iraniens : Hedayat, Saedi, Yalfani, Maki … Il a aussi travaillé sur des textes anciens comme Kalila et Dimna et les épopées de Gilgamesch , Chahnameh et L’Iliade. 

 Citoyen du monde, inspiré par différentes écoles théâtrales, il poursuit toujours sa quête entre théâtre occidental et oriental.', 'Téhéran, Iran', 1, '/4SQCmcBDbJeBwHNcmtNWXMvxXta.jpg'),
