        (1181302, 'Brett Dalton', '1982-01-07', 'Brett Patrick Dalton (born January 7, 1983) is an American actor. He is best known for playing Grant Ward and Hive in ABC''s series Agents of S.H.I.E.L.D., as well as Michael Monroe in the 2015 video game Until Dawn.', 'San Jose, California', 1, '/e06IDv1Cp7JEBSqKGv0r409XV5Y.jpg'),
        (1181303, 'Chloe Bennet', '1992-04-18', 'Chloe Bennet (born Chloe Wang on April 18, 1992), is an American actress and singer. She is starring as Skye in the ABC series Marvel''s Agents of S.H.I.E.L.D..

Life and career

Bennet was born on April 18, 1992, in Chicago, Illinois, to a Chinese father and a Jewish American mother. She moved to Beijing, China to pursue a singing career. While she was there, she studied Mandarin, learned the demands of international pop stardom and released her debut single "Uh Oh" in both English and Mandarin, followed by "Every Day In Between" solely in English. She then moved to Los Angeles, California. She appeared in the 2011 music video for "Tonight", by Korean band Big Bang.

From 2012 to 2013 Bennet played a recurring supporting role in the ABC drama series Nashville as Hailey, and previously hosted the TeenNick show The Nightlife.  In December 2012, Bennet was cast as a series regular on the ABC series Agents of S.H.I.E.L.D. which premiered on September 24, 2013.  She plays Skye, a hacktivist member of the secret organization The Rising Tide, who has been brought into S.H.I.E.L.D..', 'Chicago, Illinois, USA', 3, '/oHSuFDnO1w8bc65f5eyforuI6GS.jpg'),
        (1181306, 'Marta Milans', '1982-04-19', 'Spanish actress born and raised in Madrid. Marta fulfilled her dream of living in New York and studying theater, when she graduated from NYU with a double major in Acting and Art History. Since then, she has been fighting to make room for herself in Hollywood, slowly but steadily. She started working Off-Broadway in New York City and eventually landed roles in TV shows like Law and Order SVU and films such as The Disappearance of Eleanor Rigby, Shame and most recently Shazam!', 'Madrid, Spain', 1, '/nTvErwx5jnw0UmXTXZdXWlwxmYP.jpg'),
