        (1182597, 'Denise Gough', NULL, 'Denise Gough is an Irish actress. She was born in Ennis, County Clare and is the elder sister of the actress Kelly Gough. She graduated from the Academy of Live and Recorded Arts in 2003. She is notable for her work in theatre and television, including the play The Painter and Messiah V: The Rapture.', 'Ennis - County Clare - Ireland', 1, '/u275yns3TrTQNa27WdUex3pwbWI.jpg'),
        (1182598, 'Hayley Squires', '1988-01-01', 'Hayley Squires is an actress and playwright. She trained at Rose Bruford College and graduated in 2010. Known for Call The Midwife (2012), Southcliffe (2013), Complicit (2013), Blood Cells (2014). Her first play, Vera Vera Vera, was produced by the Royal Court Theatre in 2012. Hayley is originally from South London.', 'Forest Hill, London, England', 1, '/pSp0Jrgbm2aymD6A3fDwqw5z5o3.jpg'),
        (1182657, 'John Emmet Tracy', '1969-07-02', 'In over thirty years as an actor, John has worked extensively in theatre, film, television and voiceovers. He has performed on stages throughout the world, including Shakespeare''s Globe Theatre in London, where he was selected as a company member of the Globe''s International Actors'' Fellowship, and in Japan, where he toured as the title role in Hamlet. He has appeared in over one hundred productions and is the recipient of the 2013 Jessie Richardson Theatre Award for Outstanding Performance by an Actor in a Lead Role for his work in Pi Theatre''s production of Mark O''Rowe''s Terminus. John is also the creator of The 24 Hour Shakespeare Project, for which he performed continuously for twenty-four straight hours in all thirty-eight of Shakespeare''s plays to raise money for British Columbia Children''s Hospital.

His film work includes appearances in Fifty Shades Freed, If I Stay, American Mary, Stagecoach: The Texas Jack Story and Steven Spielberg''s The BFG. He has performed lead, recurring and supporting roles in many television shows, including Altered Carbon, iZombie, The Man in the High Castle, Supernatural, Smallville, When Calls the Heart, The Killing, Continuum, Girlfriends'' Guide to Divorce and Sanctuary.

John received his education and training at Rose Bruford College, where he earned a Bachelor''s Degree in Theatre, as well as at the Royal Academy of Dramatic Art (RADA) in London and the National Shakespeare Conservatory in New York.

He has directed over thirty theatre productions and has been teaching for twenty years in colleges, conservatories and studios in Canada and the United States.', 'Chicago, Illinois, USA', 1, '/sNWOxrNJULCLV8qDjO1ttwZmiUl.jpg'),
