        (1190421, 'Leonid Gayday', '1923-01-30', 'Leonid I. Gaidai (30 January 1923 – 19 November 1993) was one of the most popular Soviet comedy directors, enjoying immense popularity and broad public recognition in the former USSR and modern Russia. His movies broke theatre attendance records and are still some of the top-selling DVDs in Russia.', 'Svobodny, Amur Governorate, Russian SFSR, USSR [now Amur Oblast, Russia]', 1, '/cpOU6ajiRFPfqiYjbEdpBUDjg5Q.jpg'),
