        (1190553, 'Asta Paredes', NULL, 'Asta Paredes is an actress and filmmaker based in New York City. She is most well known for her leading roles in Troma Entertainment''s ''Return to Nuke Em High Vol 1 & 2'' and eOne films release ''Sociopathia''.

Her feature debut, ''Return to Nuke Em High'' (a two part event film) was an acclaimed re-imagining of the subversive 1986 cult classic ''Class of Nuke Em High''. RTNH was honored as a 2013 Museum of Modern Art Contenders Series film and was even celebrated with a special Nuke Em High Day at the Museum of Moving Image. Asta''s performance as "Chrissy" in this film garnered her critical acclaim including a Best Actress award win from the Fright Night Theatre Film Festival and a Reaper Award nomination.

Her acting foundation was training at the prestigious University of Minnesota/ Guthrie BFA Actor Training Program as well as study in London at the Globe Theater, the London International School for Performing Arts, Upright Citizens Brigade Improv Training Center and various teaching artists. Notably she has appeared onstage in Jeffrey Baker''s experimental ''The Pretenders'', Elysium Theatre Collective''s folk musical ''Bob Meets Bob'' and Guthrie Theater''s dark comedy ''Tiny Disasters''.

Learning from her unique experience in independent art, Asta began working at Abandoned House Productions in 2014 along with frequent collaborator and husband Clay von Carlowitz. From the stage to the screen, they have been producing and starring in various projects including ''The Shadow Scarf'' & ''Eros Point''. Under this banner, she has also completed her writer/directorial debut, short film, ''The Slightest Touch''. Paredes continues to star in as well as develop work seeking to entertain, educate, & elevate.', 'Texas, USA', 1, '/eFQb9YuDjFX33Jwvu4uamU2tkES.jpg'),
        (1190554, 'Catherine Corcoran', '1992-05-30', 'She is best known for her staring role in Troma Entertainments, award-winning, ''Return to Nuke ''Em High'' (a revamped, reboot of the 1984 cult classic, ''The Class of Nuke ''Em High''). Her career also includes roles in Gossip Girl, The Good Wife, MTV Pranks, and working under the mentorship of Academy Award Winning directors Peter Jackson (The Lovely Bones) and Josh Fox (Gasland). She has been featured in various publications including The New York Times, Interview Magazine, TIME Magazine, The Hollywood Reporter and Le Figaro. Much in the vein of her mentors, Catherine is also known for spearheading Troma Entertainments, ''Occupy Cannes'' Campaign and its subsequent documentary.', 'Southampton, Pennsylvania, USA', 1, '/n9WWo6xbXB5K07SpmyWQSeDTpr.jpg'),
