        (1192902, 'Sushant Singh Rajput', '1986-01-21', 'Sushant Singh Rajput is an Indian film and television actor. He started his career with television serials, including an award-winning performance in the soap opera Pavitra Rishta (2009–2011) and as a participant in two dance reality shows. 

He then entered films with a role as one of the three male leads in the drama Kai Po Che! (2013), for which he received critical acclaim as well as three Best Male Debut awards. His other notable films since then have been as male lead of the romantic comedy Shuddh Desi Romance (2014) and as the titular detective in the thriller Detective Byomkesh Bakshy! (2015), both of which were produced by Yash Raj Films. 

In 2016, Rajput appeared in Neeraj Pandey''s biographical sports drama M.S. Dhoni: The Untold Story, in which he essayed the role of Indian cricketer Mahendra Singh Dhoni, the film was a commercial success and earned him a unanimous critical acclaim.', 'Patna, Bihar, India', 1, '/edfa1O57XP0S7fNZiEg3chelR91.jpg'),
        (1192903, 'Vaani Kapoor', '1988-08-23', 'Vaani Kapoor  is an Indian actress and model. Born in Delhi, Kapoor obtained a bachelor''s degree in Tourism studies from the Indira Gandhi National Open University, she took an internship with the Oberoi Hotels &amp; Resorts. After the end of the internship, she worked as a model under the Elite Model Management. During her modeling career, she successfully auditioned for the 2009 Sony TV television series Specials @ 10—where she played the protagonist in one of the series segment Rajuben. Later, she signed a three-film deal with the Yash Raj Films as an actress.

Kapoor made her film debut with a supporting role in the 2013 romantic comedy Shuddh Desi Romance, a critical and commercial success. She garnered wide appreciation for her performance and earned her several awards and nominations, including the Best Female Debut at the 59th Filmfare Awards. In 2014, she ventured into the South Indian film industry with the Tamil and Telugu language romantic comedy Aaha Kalyanam, that proved to be a moderate box-office success and her portrayal of the lead female character was praised.', 'Delhi, India', 1, '/pHnfhHhCCaagi7OIDRbszQqrbbq.jpg'),
