        (1193602, 'Gia Coppola', '1987-01-01', 'Gian-Carla "Gia" Coppola is an American film director, screenwriter, and actress. She is a granddaughter of Francis Ford Coppola, the daughter of Gian-Carlo Coppola and the niece of Roman Coppola and Sofia Coppola.', 'Los Angeles, California, USA', 1, '/uJaDmVIZgbXpGkZtQ1QH6XPHXYD.jpg'),
        (1193604, 'Jack Kilmer', '1995-06-06', 'Kilmer grew up in Los Angeles and attended primary school at The Center for Early Education, where he first met would-be filmmaker Gia Coppola when he was in the first grade and she was in the sixth grade. They stayed in contact and, twelve years later, Coppola asked him to review the script for Palo Alto, a film adaptation of James Franco''s book of the same name that she had written and planned to direct, and advise whether the dialog was an authentic reflection of "kids today". After he ran through a table read with her, she encouraged him to audition for one of the film''s main roles, Teddy. Coppola filmed him as he read through the lines and this became his audition tape; he eventually won the role.After he was cast as Teddy, his father Val Kilmer joined the cast as the father of another character. Before filming Palo Altowhen he was 18 years old, Kilmer had never acted before, and did not aspire to be an actor. The film was released in May 2014 to mostly positive reviews, and Kilmer''s performance was described as "formidable", "naturalistic and sincere".  Kilmer graduated from high school in 2013. He intended for his acting job on Palo Alto to be a brief project before applying to colleges, but after the film''s production he decided to enter acting full-time. In April 2014 he filmed Len and Companywith Juno Temple and Rhys Ifans, scheduled for release in 2015. In July 2014 he began filming Aaron Baby Superfecta, a coming-of-age film also set for release in 2015, with Elle Fanning.', 'Los Angeles - California - USA', 1, '/t3ufi6Zc3YCINV56Bp3AhJgWCBL.jpg'),
        (1193605, 'Keegan Allen', '1989-07-22', 'Keegan Phillip Allen (born July 22, 1989) is an American actor and musician. Allen is best known for his current role as Toby Cavanaugh on theABC Family hit series Pretty Little Liars.

 Keegan’s passion in his younger years tended towards photography, cinematography and other roles behind the camera. This coupled with his parents'' background led up to his job as an actor on the front stage.  At the age of thirteen Keegan landed his first paid job for a small, non-speaking role in a documentary for Animal Planet. He went on to star in a short film, Small Emergencies, as the Parakeet Owner’s Son in 2002. In 2010, after a long break from acting, Keegan starred in Nickelodeon’s TV show Big Time Rush. In the same year, he starred in a short film entitled As A Last Resort. Shortly after, Keegan secured his breakthrough role as Toby Cavanaugh, Spencer Hastings’ (played byTroian Bellisario) love interest on ABC’s Pretty Little Liars. He also made an appearance in CBS’ CSI: Crime Scene Investigation in 2011. This year, Allen played the role of Jake in an episode of Fox’s sitcom I Hate My Teenage Daughterand is currently working on a movie titled Bukowski, produced and directed by Hollywood star James Franco.  Allen was nominated as Choice Summer TV Star: Male, for the 2011 Teen Choice Awards. Allen did not win, but he was nominated again in 2013 and won.', 'California, USA', 1, '/osTSMTonidy8vxn3oNs8rSOu3Ir.jpg'),
        (1193606, 'Christian Madsen', '1990-01-01', 'Christian Madsen was born in 1990 in Los Angeles to actors Michael Madsenand Jeannine Bisignano. He began acting at the age of ten, when he appeared in a small role in one of his father''s films, and spent time on the set of a number of other films, including Free Willy and The Getaway. His grandmother, filmmaker Elaine Madsen, encouraged him to pursue a career in acting after watching his performances in high school theater. His parents divorced when he was a child and he subsequently "bounced around a lot" between his parents'' homes in Malibu, the San Fernando Valley, Santa Fe, and Montana. He eventually moved in with his grandmother when he was 17, and she took him to the Actors Studio and introduced him to the head of its Hollywood branch, Martin Landau.  Madsen''s early film career consisted mainly of small roles with his father and independent films. He took on other jobs while continuing to audition for acting roles. He had been auditioning without any successes for over two years and was about to be evicted from his Los Angeles apartment when he won a role in Divergent, a film adaptation of Veronica Roth''s young adult novel of the same name.  After filming Divergent, Madsen was cast in the lead role of the upcoming independent film Prism, in which he plays a young man who is reunited with his amnesiac father after 15 years. In 2014, he also appeared in Palo Alto, a drama film directed by Gia Coppola, and he has been cast in Jack Squared.', 'Los Angeles - California - USA', 1, '/cXtUHc8sZdmh0jmueue82PIMsHh.jpg'),
