        (1194744, 'Ricardo Medina Jr.', '1977-07-06', 'Medina is best known for his role as Cole Evans, the Red Wild Force Ranger, on Power Rangers Wild Force as well as his appearance on the VH1 reality television series Kept, in which he and eleven other men vied for the opportunity to become supermodel Jerry Hall''s kept man. Medina formed something of an alliance with fellow contestant Slavco, as they continually expressed their opinion that they were the two most attractive men on the show. Hall eliminated Medina after a dance competition at which he performed a striptease to Hall''s displeasure.  He is now a part of The Hollywood Men, a group of male strippers, in California. In 2011, he returned to the Power Rangers franchise in Power Rangers Samurai as Deker.  He was an unannounced special guest for the Power Morphicon in August 2012.', 'Los Angeles - California - USA', 1, '/e8nS3AuZ7uSpoLlzmmSipBvPt0R.jpg'),
