        (1194965, 'Kevin Kolack', '1969-10-23', 'Kevin grew up outside of Atlanta, GA in a town with no traffic light, but both his parents hail from the NYC area. After getting a BS in Chemistry and Buddhism from The University of Virginia, Kevin moved to Bloomington, IN to earn a Ph.D. in Chemistry as well as certification as a master firefighter and EMT. While in Indiana, Kevin began his acting in earnest, traveling to Chicago weekly and NYC several times per year for classes and seminars. Kevin moved to NYC in 1998 to act full time. Kevin has been everything from a movie theater manager to a camp counselor and rifle instructor to a NYC taxi driver and helicopter pilot in real life, and just as wide a variety on screen. He has been seen in more than three dozen films ant TV shows, and has appeared in stand-up comedy clubs around NYC, in addition to touring the country putting on a one-man, multiple-puppet show. Possessing an unusually broad facility with character voice work, you may also hear one of his many voices in a variety of television and radio commercials and cartoons.  - IMDb Mini Biography', 'Austin - Texas - USA', 1, '/1DYMl6klAmUB5Vqjo4ldYeGjc1K.jpg'),
        (1194966, 'David W. Thompson', NULL, 'David William Thompson was born to parents George and Leesa in Westchester, New York. David discovered his talents for acting in middle school when he was recommended to audition for a play. A few school productions and original local theater pieces later, David began to audition for student films in New York. After a few years of studying stand-up comedy, improv, basic acting, the Meisner method, and a summer studying at Circle In the Square in New York, David landed his first significant role inLes Winners (2011). Aside from acting, David also enjoys wrestling, drumming, skateboarding, and stand-up comedy.  - IMDb Mini Biography', 'Westchester - Illinois - USA', 1, '/wa7666sN8oARQcvN1c7jQXm6oJd.jpg'),
        (1194967, 'Brent Werzner', NULL, '', NULL, 1, '/hVfzu4B92l6BxLwh10L1Hr29Nz8.jpg'),
        (1194968, 'Stacy Rock', NULL, 'Stacy is a singer/songwriter and actress often compared to Parker Posey, Tom Waits, Feist, Regina Spektor, Aimee Mann, Stevie Nicks and even Queen. Simply put, she has a sound and style of her own. A few of her theatrical acting credits include shows at Barrington Stage Company, North Shore Music Theater, The Voice of America Theater with Bill Pullman and Boston Playwrights Theater. She studied acting at Boston University and the Royal Academy.  - IMDb Mini Biography', NULL, 1, '/1pyL8uUhO6JSTcAsztV8OiXJCkZ.jpg'),
        (1194969, 'Sidné Anderson', '1968-09-28', 'Sidné Anderson was born on September 28, 1968 in Boston, Massachusetts. She is an actress and producer, known for Blue Ruin (2013), La famille Savage (2007) and Big Fan (2009). She has been married to Donald Ward since October 1, 2004.', 'Boston - Massachusetts - USA', 1, '/lwZSpKVXYpk9b7Huv2uyR7icFPi.jpg'),
