        (1195521, 'Solofa Fatu Jr.', '1965-10-11', 'Solofa Fatu Jr. is a Samoan American professional wrestler, best known under the ring name Rikishi (which means sumo wrestler in Japanese) with World Wrestling Entertainment (WWE), where he was a one timeIntercontinental Champion, two time World Tag Team Champion, and one time WWE Tag Team Champion. Rikishi is a member of the famous Anoaʻi family. He is the twin brother of Sam Fatu (The Tonga Kid/Tama), and both brothers have twins. Sam is the father of twins Marley and Myracle, and Rikishi is the father of twins Jonathan and Joshua Samuel, who currently wrestle in WWE as Jimmy Uso and Jey Uso.

Rikishi is the nephew of Sika Anoaʻi and Afa Anoaʻi, known as the Wild Samoans, and his cousins in wrestling are Rodney Anoaʻi (Yokozuna), Samula Anoaʻi (Headshrinker Samu), Matt Anoaʻi (Rosey), Joe Anoaʻi (Roman Reigns), Reno Anoaʻi (Black Pearl), Afa Anoaʻi Jr. (Manu), Lloyd Anoaʻi (L.A. Smooth) and Dwayne Johnson (The Rock).

Rikishi and his wife Talisua Fuavai-Fatu have five children. Jonathan and Joshua Samuel (born August 22, 1985), Jeremiah Peniata (born August 30, 1986) and daughter Thavana Monalisa Fatu [53] and Joseph (born 1993). He is the older brother of the late Eddie Fatu (Umaga/Jamal), who died on December 4, 2009 from heart attack.

Solofa has a scar on his abdomen from a drive by shooting in 1987. He says he died for 3 minutes in the emergency room Rikishi is a playable DLC character in the Attitude Era-themed video game WWE ''13. He also appeared in WWF SmackDown! 2: Know Your Role, WWF SmackDown! Just Bring It, WWE SmackDown! Shut Your Mouth, WWE SmackDown! Here Comes the Pain, WWE 2K16, WWE 2K17, WWE 2K18, and WWE 2K19. Outside of the main series, he is featured in WWF No Mercy, WWF Raw, WWE Raw 2, WWE Wrestlemania X8 and WWE Wrestlemania XIX.

Fatu appeared in the Italian comedy film Natale a Miami. He also guest starred on the Nickelodeon show Victorious, as a sumo wrestler in the episode "Brain Squeezers."

Fatu appeared in the Netflix original film Sandy Wexler.

Fatu under his "Rikishi" ring name is the Samoan judge in the "Wall Of The World" on the CBS show The World''s Best.', 'San Francisco, California, USA', 1, '/yfSr9k6aJE5PNB2eZxsPJOUelYF.jpg'),
