        (1199108, 'Kevon Stover', NULL, 'Kevon Stover is an American based executive producer and actor. He is mixed with European, a little Native American Indian and a touch of Latin descent.

Kevon Stover is known for his role as Zane in the sci-fi/action thriller Beta Test (2016). He also was in Last Vegas (2013), Time Warrior ( 2012), Sanctioned to Die (2011) and Entourage.

In addition, Kevon has always been very active in many investments in the U.S. and abroad and has also been moving behind the camera as an executive producer as well of performing other positions of productions behind the scenes. He has also has owned and managed real estate and investment properties for many years.

Kevon also has many years of experience as a touring (and studio) singer, drummer and guitarist. He started off as a drummer and studied many genres and styles, touring and recording, predominantly in rock acts that were very high energy. Kevon then moved out front playing guitar and fronting as a lead singer with his brother Brian Stover. Unfortunately, with changing music styles and legal entanglements, it was not to be. 

