        (1200120, 'Gregory Shane Helms', '1974-07-12', 'Gregory Shane Helms is an American professional wrestler. He is best known for his time with World Wrestling Entertainment (WWE) where he wrestled as The Hurricane and Gregory Helms and also known for his time with World Championship Wrestling (WCW) where he wrestled as "Sugar" Shane Helms.  Helms first began wrestling in 1991 at the age of 16, and wrestled in numerous independent promotions, including the Organization of Modern Extreme Grappling Arts, winning numerous light heavyweight and tag team championships. In 1999, he signed with WCW, and gained fame as "Sugar" Shane Helms, a member of 3 Count. During his time there he won both the WCW Hardcore Championship and the WCW Cruiserweight Championship. When WCW was bought by the World Wrestling Federation (WWF) (now WWE), Helms'' contract was kept by WWF. Helms renamed himself "The Hurricane" and won the WWE Cruiserweight Championship. He later picked up a sidekick, Rosey, and they won the World Tag Team Championship together.  He dropped the superhero gimmick in 2005, and began wrestling under his real name. He once again won the Cruiserweight Championship in early 2006, and held it for over a year, becoming the longest reigning Cruiserweight Champion and the longest reigning champion of any kind in SmackDown history. After being out of action for over a year after neck fusion surgery Helms returned to SmackDown in September 2008, referring to himself as Hurricane Helms, before moving to the ECWbrand where he reverted to his Gregory Helms name, and became the backstage interviewer. In mid-2009, he brought back The Hurricane character, and appeared as both Gregory Helms and The Hurricane on ECW. After ECW was cancelled Helms was released by WWE on February 26, 2010, and returned to the independent circuit.', 'Smithfield, North Carolina, USA', 1, NULL),
        (1200171, 'Alan Berger', NULL, '', NULL, 1, NULL),
        (1200313, 'Mathew Lorenceau', NULL, '', NULL, 1, NULL),
        (1200324, 'Peter Gruner, Jr.', '1974-05-11', 'Peter Alan Gruner, Jr. is an American professional wrestler and wrestling producer, better known by his ring name Billy Kidman. He is currently signed to WWE, where works as a producer. As a wrestler, Kidman is best known for his work with World Championship Wrestling (WCW) and World Wrestling Federation / Entertainment (WWF/E) throughout the late 1990s and early 2000s.  While in WCW, Kidman gained fame as a key member of several stables. In addition to being a member of Raven''s Flock, he also was a member of the Filthy Animals and later The New Blood. As a member of these stables, Kidman participated in memorable feuds with top WCW names, including Hulk Hogan, Jeff Jarrett, and Rey Mysterio, Jr.. Kidman also found championship success while in WCW, where he became a three time Cruiserweight Champion, a two time World Tag Team Champion (once with Mysterio, Jr. and once with Konnan) and a one time (and the final) Cruiserweight Tag Team Champion with Mysterio, Jr.  Upon WCW''s purchase by the World Wrestling Federation, Kidman became a member of the WCW/ECW Alliance. During his time in the WWF (later renamed to World Wrestling Entertainment), Kidman once again found success upon winning the Cruiserweight Championship an additional four times while the title was under the WCW banner and later the WWF/E banner, in addition to winning WWE''s Tag Team Championship once with Paul London.', NULL, 1, '/ioQZfYvj8NQhVpRX9VUMVE1RfaM.jpg'),
