        (1200631, 'Théophile Sowié', NULL, 'Moussa Théophile Sowie a suivi une formation notamment à l''Institut des études théâtrales Paris III Sorbonne Nouvelle et à l''Ecole d''art dramatique Jacques Lecoq à Paris. Il a joué au théâtre dans Chute et Jeanne au bûcher mise en scène Claude Régy Le chariot de terre cuite mise en scène Patrick Le Mauff, Tabataba et Combat de nègre et de chiens mise en scène M. Touré, Dans la solitude des champs de coton mis en scène Anita Picchiarini, 9 mm mis en scène Stéphanie Loïk, La voix du griot mise en scène Sotigui Kouyaté, L''île des esclaves mise en scène D. Lardenois?. Au cinéma il a joué Le postier dans "Les visiteurs" (Jean-Marie Poiré, France, 1993) et "Les Couloirs du temps : Les visiteurs II" (Jean-Marie Poiré, France, 1997) avec Christian Clavier et Jean Reno. Ou encore Maurice MPOLO dans "Lumumba" (Raoul Peck, Haïti, 2000), "La note bleue" d''Andrzej Zulawski, "L''Afrance" de Alain Gomis, "Magnolia" de I. Smidt, "Moolaadé" de Ousmane Sembene? A la télévision il a travaillé sous la direction de Yves Renier, P. Jamain, P. Roy, P. Lefebvre?', NULL, 1, '/ptW29FMm8WZ2yt3E8BKkVLR8RDd.jpg'),
