        (1202569, 'Orlando Colón', '1982-03-24', 'Orlando Colón is a Puerto Rican professional wrestler. He began working in Hybrid Pro Wrestling, an independent circuit in Schoolcraft, Michigan. In 2006, Colón debuted in the World Wrestling Council, a promotion owned by his uncle, Carlos Colón. His cousins are Primo and former WWE wrestler, Carlito. While working with WWC, he had a brief participation in Pro Wrestling Zero1. In January 2010, Colón left the WWC after signing a development contract with WWE where he appears as Epico, where he was one-half of the WWE Tag Team Champions with his real-life cousin Primo. He also works for World Wrestling Council to train in his spare time.', 'San Juan, Puerto Rico', 1, NULL),
