        (1203710, 'Katarina Leigh Waters', '1980-11-10', 'Katarina Leigh Waters is a German-born professional wrestler and valet. She is best known for her time in World Wrestling Entertainment and Total Nonstop Action Wrestling. During her time in WWE, she performed on its Raw brand under the ring name Katie Lea and performed under the ring name Winter, while working in TNA . Prior to signing with WWE, she spent many years on the independent circuit, particularly in the Frontier Wrestling Alliance, where she used the ring name Nikita.  After signing with WWE, she competed in their former developmental territory Ohio Valley Wrestling, where she became a two time Women''s Champion before being called up to the main roster. After being released from WWE in April 2010, Waters joined TNA in August 2010 adopting the new ring name Winter. During her first year in the promotion she managed to win both of the promotion''s women''s championships, teaming with Angelina Love to win the TNA Knockouts Tag Team Championship in December 2010 and winning the TNA Women''s Knockout Championship in August 2011.', 'Lüneburg, Germany', 1, '/iZdoGXLQMqMYG7bZPiFn9nBf5Iy.jpg'),
