        (1208034, 'Bobby Somers', '1932-10-09', 'Bobby''s father Jack T. "shorty" Somers worked for Thomas Ince Studios after serving in the armed forces as a Corporal in the US Army, He worked in props &amp; wardrobe and eventually became Thomas Ince driver. Bobby''s mother Alice was a Mack Sennett Bathing Beauty. They had two sons Jack and Bobby, His mother and father enrolled Bobby in Meglin Kiddies dance studio when he was very young that got him small parts in some M.G.M. musicals like "The Gang''s All Here" where he dance the polka next to Alice Faye, He also played small parts in the Little Rascals series. Jack B Somers his older brother of 10 years had his sights on a military career where he enlisted In the U.S. Marine Corps at the age of 19 and was Killed in Action on November 24, 1942 with the 8th marines during the Guadalcanal Campaign, After which time he was awarded The Silver Star and The Purple Heart, Bobby continued his ambitions toward acting and dancing in the entertainment industry where he managed to work in hundreds of TV and Movie films as a stuntman, assistant director, double, actor and extra, working in TV shows such as Bonanza, Gunsmoke, Rawhide, Get Smart and Movies such as Blackboard Jungle, Hondo, Duel at Diablo and Bandolero!. Bobby was a combination of W.C.Fields &amp; Humphrey Bogart, Bobby has two children David &amp; Joyce that he loved very much, He died of cancer At the young age of 50, His family and friends will miss him dearly.

Bio by: David and Joyce Somers', 'Los Angeles, California, USA', 1, '/dsiv1YDEJv6T30zQQL1I9LvO9BI.jpg'),
