        (1209419, 'Tim Rigby', NULL, 'After serving for five years in the British Royal Navy as a Mine Clearance Diver, Tim came from England to Hollywood in 1992 to pursue his dream of a career as a stuntman. For the last 25 years, Tim has worked on most of the big budget action movies, and has been fortunate to have played a key role, stunt-wise in many of them. He has crashed, slid, jumped, and turned over cars, (“Mr & Mrs Smith”, “Dukes of Hazzard”, “Man of the House”, Fast & Furious 4), performed high falls and skydives; he has been strapped to an ejection seat during freefall (“Stealth” & Iron Man), BASE jumped from a moving car, (“xXx”), BASE jumped into Downtown L.A. (“Along Came Polly”), BASE jumped live into the 2004 Superbowl at Houston Reliant Stadium (in front of 80,000 people), flown his wingsuit over L.A. and landed in Paramount studios, (“World Stunt Awards”), Spent hours, days, & weeks underwater (“Sphere & “The Hunley” "Man of Steel), been involved in extensive fight & weapons based work, with the finest fight choreographers in the business, (“300”), as well as all of the “nuts & bolts” of stunt work; falls, wire-work, crashes, fire burns, etc.

Doubles: Brian Van Holt, Thomas Hayden Church, Daniel Bernhardt, Brian Thomson, Rupert Everett, Rhys Ifans, Dash Mihok.

Awards & Achievements:

2002 World Stunt Awards Nominee, Best Specialty Stunt: Swordfish

2003 World Stunt Awards Winner, Best Specialty Stunt: xXx

2003 World Stunt Awards Nominee, Best Overall Stunt: xXx

2005 World Stunt Awards Nominee, Best Specialty Stunt: Along Came Polly

2008 Screen Actors Guild Awards Nominee, Outstanding Performance By A Stunt Ensemble: 300

2008 World Stunt Awards Winner, Best Fight: 300

2009 Screen Actors Guild Awards Nominee, Outstanding Performance By A Stunt Ensemble

2010 World Stunt Awards Nominee, Best Fire Stunt: Gamer

2010 World Stunt Awards Nominee, Best Work With A Vehicle: Fast & Furious 4

2001 World Stunt Awards Nominee, Best Water Work: Perfect Storm', NULL, 1, '/zKNcSpDZaMtA0dAAXqsBR9FCuER.jpg'),
