        (1211813, 'Paul Dini', '1957-08-07', 'Paul Dini was born on August 7, 1957 in New York City, New York, USA. He is known for his work on Batman Beyond: Return of the Joker (2000), Superman (1996) and Batman Beyond (1999). He has been married to Misty Lee since October 30, 2005.

