        (1211904, 'David Newell', '1938-11-24', 'David Newell (born November 24, 1938) is an American television actor known primarily for his portrayal of Mr. McFeely, the delivery man on Mister Rogers’ Neighborhood, and works in the public relations department of the Fred Rogers Company (the entity responsible for all rights relating to the program, and other series currently in production from the company).

His character''s most famous catchphrase was "Speedy Delivery!" He toured the country until he retired in 2015, promoting Mister Rogers'' Neighborhood as Mr. McFeely. Newell was born in O''Hara Township, Pennsylvania, near Pittsburgh. A graduate of the University of Pittsburgh,[2] he was the director of public relations for The Fred Rogers Company. Newell now resides in Pittsburgh.  From Wikipedia, the free encyclopedia', 'O''Hara Township, Pennsylvania, USA', 1, '/x5XtFM8Gdjws9Ho7sIH7Da1IQg2.jpg'),
