        (1212194, 'Andrew James Allen', '1987-07-16', 'Andrew James Allen was born in Redmond, Washington to Robert and Susan Allen. Susan is a retired radiology technician and his father Robert is an artist and environmentalist. Andrew James Allen has been acting since 9 years old, first appearing in commercials. Eventually at the age of 13 Andrew James Allen and his mother moved to Los Angeles where Andrew James Allen began working on various film and television projects. Andrew James Allen starred in the 2003 MGM Studios T.V movie Recipe For Disaster, alongside John Larroquette, Lesley Ann Warren, Margo harshman and Devon Werkheiser. Allen has also guest-starred on Ghost Whisperer, CSI: Miami, ER, Bones, Cold Case, Monk, Grey''s Anatomy, Malcolm in the Middle, Reba, Charmed, 7th Heaven, and Make It or Break It among others. Allen was next seen in Peter Jackson''s film adaption of The Lovely Bones, portraying Samuel Heckler.', 'Redmond, Washington, USA', 1, '/aoZAfQYmY39QgUUmfK0RRscR6D.jpg'),
