        (1213560, 'Allison Liddi-Brown', NULL, '​From Wikipedia, the free encyclopedia.

Allison Liddi-Brown is American television director. Brown made her directorial debut on first season of the Nickelodeon series, The Secret World of Alex Mack. She then went on to direct episodes for a number of notable television series namely, The Mystery Files of Shelby Woo, Xena: Warrior Princess, Beverly Hills, 90210, Star Trek: Voyager, Even Stevens, CSI: Crime Scene Investigation, CSI: Miami, CSI: NY, Chuck, Grey''s Anatomy, Friday Night Lights and Gossip Girl among other series. In 2010, Brown won the DGA award for Outstanding Directorial Achievement in a Children''s Program for directing the Disney Channel original film Princess Protection Program starring Selena Gomez and Demi Lovato.', NULL, 1, '/zv2JC6RpBZMr2YHfPWllgbyLWMm.jpg'),
