        (1214127, 'Suli McCullough', '1986-01-01', 'Suli McCullough is an American comic-actor and screenwriter. He is perhaps best known for his portrayal of "Crazy Legs" in the spoof movie Don''t Be a Menace to South Central While Drinking Your Juice in the Hood, and for his recurring role as Dwayne "Mouse" Abercrombie on the WB sitcom The Jamie Foxx Show.

McCullough has also had several dramatic roles depicting real-life individuals. He portrayed Tina Turner''s oldest biological son Craig Turner in the 1993 biopic What''s Love Got to Do with It, as well as civil rights icon Terrence Roberts in the 1993 Disney Channel movie The Ernest Green Story. Additionally, he was a writer on The Tonight Show with Jay Leno and has been the head writer for ESPN''s "ESPY" Awards.

Suli has two children with ex-wife Donyell McCullough. The oldest daughter, Kennedy Rue is an up and coming actress and has been featured in various acting roles and commercials. His son, Nahzi Rue, is a successful child model.', 'Los Angeles, California, USA', 1, '/dSeHFIxFkLLxYyMQTFhJksj7y0K.jpg'),
