        (1214816, 'Amy Davidson', '1979-09-15', 'From Wikipedia, the free encyclopedia.

Height 5'' (1,52 m)

Amy Davidson (born September 15, 1979) is an American actress. She is best known for playing Kerry Hennessy in the ABC sitcom 8 Simple Rules.

Early life and education

Born in Phoenix, Arizona, Davidson was raised by educators. Her father was a principal at El Mirage Elementary School, and her mother was an English teacher at Desert Foothills Junior High School. Her parents enrolled her in dance classes as a young child. She became a member of "Dance Motion". Davidson took ballet, pointe, hip hop and modern dancing. While Amy attended Shadow Mountain High School, she began appearing in advertisements. Her acting coach Jean Fowler encouraged her to move to Hollywood.

Career

After appearing in the TV movie The Truth About Jane and an episode of the drama series Judging Amy, she was cast in the Mary-Kate and Ashley Olsen series So Little Time. She guest-starred on the sitcom Malcolm In The Middle and in the Hallmark Channel film Annie''s Point opposite Betty White and Richard Thomas. Other roles include the film Goyband, in which she stars as a young Orthodox Jewish girl who falls for an ex-boyband pop star (Adam Pascal) who performs at her family''s hotel in the Catskills. Goyband''s cast includes Natasha Lyonne, Tovah Feldshuh, Dean Edwards, Tibor Feldman, and Cris Judd.

Personal life

Davidson married actor Kacy Lockwood on May 1, 2010. The website sitcomsonline.com started an online campaign to get Davidson to guest star or recur on the ABC comedy Suburgatory, and Davidson has loved the idea and would love to appear on the new sitcom. She is also developing a comedy pilot.', 'Phoenix - Arizona - USA', 1, '/7JOFF63kJh3auGoLdyqPeHElvUG.jpg'),
