Collins was born in San Antonio,Bexar County, Texas. She is one of four sisters, all of whom are involved in the arts. For much of her childhood, she and her family resided in rural Los Angeles, Texas. Collins attended Tom C. Clark High School in San Antonio,graduating in 2001. She attended Juilliard, graduatingin 2005.

