        (1215805, 'Peter Cambor', '1978-09-28', 'Peter was born in Houston, TX. He attended college at Wesleyan  University in Connecticut where he received a B.A. in English. Peter  then moved to New York to pursue a career in acting. After two years in  New York, he was accepted by The American Repertory Theatre''s Institute  for Advanced Theatre Training at Harvard University and the Moscow Art  Theatre, where he received an M.F.A in Acting. Shortly after receiving  his M.F.A., Peter was cast in the Mark Taper Forum''s production of The  Cherry Orchard starring Annette Bening and Alfred Molina in 2006. During  the production, a producer asked him to come and audition for the pilot  of ABC''s Notes from the Underbelly, in which he was cast starring  opposite Jennifer Westfeldt. The series was picked up that summer, and  ran on ABC for two seasons. Peter was next cast in CBS''s drama NCIS:Los  Angeles as Operations Psychologist Nate Getz. He still appears as Nate  as a recurring cast member. Peter recently starred in the TBS comedy  Wedding Band which aired in the fall of 2012. He just wrapped up  shooting the NBC pilot Assistance starring Krysten Ritter, Alfred  Molina, Zach Cregger, and Vinette Robinson.', NULL, 1, '/7Hh6P0hqu51WyNtOomG9JNDB34W.jpg'),
