        (1216195, 'Paul Raci', NULL, 'Actor Paul Raci was most commonly known for his roles in television dramas. 

Raci''s acting career began with roles in action films like "Dragon: the Bruce Lee Story" (1993) and "The Glimmer Man" (1996). 

He worked in television in his early acting career as well, including parts on "L.A. Law" (NBC, 1986-1994) and "The Marshal" (ABC, 1994-96). In the nineties and the early 2000s, Raci worked on predominantly television shows such as "The Visitor" (1997-98), "CSI: Crime Scene Investigation" (CBS, 2000-2015) and "The Handler" (CBS, 2003-04). 

More recently, he tackled roles on "Las Vegas" (2003-08), "Lucky Louie" (HBO, 2005-07) and "Rizzoli & Isles" (TNT, 2009-16). Raci most recently acted on "Switched at Birth" (Freeform, 2010-).

He was nominated for a 1985 Joseph Jefferson Award for Actor in a Principal Role in a Play for "Children of a Lesser God" at the Immediate Theatre Company in Chicago, Illinois.', NULL, 1, '/7ky9dBmNAMwkQuM4pMZkprtSN1Z.jpg'),
