        (1216226, 'Christopher Morgan Klucsarits', '1970-01-04', 'Christopher Klucsarits was an American professional wrestler. He was best known for his work in World Championship Wrestling and the World Wrestling Federation under the ring names Chris Kanyon (or simply Kanyon) and Mortis. As a youth, Kanyon played roller hockey, basketball, and baseball at school. He attended Archbishop Molloy High School, located in Queens NY, graduating in 1988. In 1992 he graduated from the University at Buffalo with a bachelor''s degree in physical therapy. During his time there, he was a member of the Mad Turtles, the University of Buffalo Rugby Football Club. Kanyon worked full-time as a physical therapist for three years before becoming a wrestler. Kanyon debuted in World Championship Wrestling (WCW) as a jobber. After several months he was placed with Mark Starr in a tag team called "Men at Work". Their gimmick was that they were two construction workers turned wrestlers who wore jeans to the ring, and that Kanyon would cause the team to suffer losses by taking measurements with his tape measure at inopportune times. Kanyon was replaced with Mike Winner before the team disbanded altogether.

Kanyon appeared on the CNN special Death Grip: Inside Pro Wrestling, in November 2007 following the aftermath of the Chris Benoit double-murder and suicide. On the program, Kanyon stated that on September 14, 2003 he had taken 50 sleeping pills in a suicide attempt.

In the early hours of October 16, 2004, he was arrested in Ybor City, Tampa, Florida for "disorderly conduct and resisting arrest without violence" after attempting to break up a fight. He was released that same day after fellow wrestler Altar Boy Luke provided a US$750 cash bond. Kanyon publicly stated he did nothing wrong, and the case was thrown out of court.

Kanyon, along with Raven and Michael Sanders, attempted to sue WWE for "cheating them out of health care and other benefits" but a federal judge in Stamford, Connecticut dismissed the case.

In 2004, after Kanyon''s release from WWE, he began a gimmick in which he was an openly gay wrestler. This included a publicity stunt wherein he stated that WWE released him from his contract because of his sexuality. Kanyon later told reporters and radio personalities that this was just a publicity stunt.[6] He later retracted these statements and acknowledged that he was in fact gay. Before his death Kanyon was working on a book, Wrestling Reality, with Ryan Clark. The book was released November 1, 2011, and it details Kanyon''s struggles as a closeted gay man.

Death

Kanyon had been suffering from bipolar disorder, and he threatened suicide in the weeks prior to his death. On April 2, 2010, his brother Ken Klucsarits found him dead in his Sunnyside, Queens, New York apartment with an empty bottle of antidepressants. He left behind a note of apology for his family. His death was acknowledged by WWE', 'Queens, New York City, New York, USA', 1, '/3EYe7kkPeTouMcmrPFA0FCgdnhI.jpg'),
        (1216310, 'Debra Gale Marshall', '1960-03-02', 'formerly McMichael and Williams) is an American actress, and retired professional wrestling valet. Well known by her ring name Debra, she is notable for her appearances with World Championship Wrestling (WCW) as Queen Debra between 1995 and 1998and the World Wrestling Federation (WWF) as Debra between 1998 and 2002. She began her career in professional wrestling in 1995, accompanying her husband Steve "Mongo" McMichael to the ring in World Championship Wrestling (WCW).

She joined the WWF in 1998, where she managed the tag team of Jeff Jarrett and Owen Hart, until the evening of Hart''s in-ring death in May 1999. She won the WWF Women''s Championship from Sable in an Evening Gown match in 1999. She later appeared on-screen with her second husband Stone Cold Steve Austin until 2002, when the duo left the company. During her tenure with the WWF she was known for her distinctive Southern drawl and large enhanced breasts. Marshall has also attended the prestigious Lee Strasberg Theatre & Film Institute in New York. She graduated from the University of Alabama with honors (Cum Laude) and as of 2013 was pursuing her master''s degree in Criminal Justice at the University of Alabama Marshall''s marriage to National Football League alumnus and professional wrestler Steve McMichael lasted thirteen years. McMichael''s mother, whom Marshall met on an airplane, set up their first meeting as a blind date. They divorced on October 12, 1998.Debra met Steve Williams, known on-screen as Stone Cold Steve Austin, in 1998; they moved in together in 2000.On September 13 of that year, they married at The Little White Wedding Chapel in Las Vegas, and she changed her name to Debra Williams. On June 15, 2002, police responded to a call to the couple''s residence in San Antonio, Texas, and found Debra with bruises and a bloody nose.On August 14, the authorities arrested Austin and charged him with misdemeanor assault. He pleaded no contest on November 25 and received a year''s probation, a $1,000 fine, and an order to carry out eighty hours of community service.[36] Austin filed for divorce from Marshall on July 22, 2002, and the divorce was finalized on February 5, 2003 Marshall later auctioned her wedding ring off on eBay for $27,100 and donated a portion of the proceeds to "Safe Place", an organization which assists the victims of domestic abuse.

In June and July 2007, Marshall made several appearances to discuss the Chris Benoit double murder and suicide. She described steroids and drugs as the cause of Austin hitting her in June 2002 and suggested links between such substances and the death of Benoit and his family She also alleged that Austin beat her three times', 'Tuscaloosa, Alabama, USA', 1, '/1ghHezGq4RNQ4wKCpX6x6SgFuqd.jpg'),
