        (1216410, 'Jack Montgomery', '1992-02-17', 'Jack Montgomery (born 17 February 1992 in Alvechurch, Worcestershire) is a British actor, who has appeared in television, stage productions and motion pictures. He is managed by Gavin Barker Associates and studies at St Augustine''s High School, Redditch.  He portrayed Jeremy Potts in Chitty Chitty Bang Bang at the London Palladium and he was also part of the original cast of Mary Poppins in which he played Michael Banks. He returned to the London Palladium to play Kurt von Trapp in the 2006 London revival of The Sound of Music.  He appeared as young Simon in Tristan &amp; Isolde and he''s set to appear in Jonathan Toomey and The Deaths of Ian.  Television roles include appearances in Blue Peter, Primeval, BBC''s "Celebrate Oliver!" presented by Shane Ritchie (broadcast on 26 December 2005) and a guest role on the soap Doctors.', 'Alvechurch, Worcestershire, England', 1, '/jQ1PFR7SV3rBguM9O01HyvMDfv9.jpg'),
