        (1216423, 'Stella Tanner', '1926-01-01', 'From Wikipedia

Stella Tanner (1 January 1925 – 26 March 2012) was an English radio and television actress.

Tanner was born on 1 January 1925 and studied at the Royal Academy of Dramatic Art (RADA). She left her focus on dramatic acting to form the Tanner Sisters with her sister, Frances Tanner. Together the Tanner Sisters made hundreds of appearances on British radio and television during the 1950s, even performing alongside Buddy Holly in March 1958. The Tanner Sisters often performed with the Hedley Ward Trio, appearing with them first on the Educating Archie radio show from 1950 to 1952.

Tanner pursued a career in television comedy after she and Frances ended the Tanner Sisters act after ten years. Tanner made her television acting debut in 1960 on Sykes and A..., opposite Eric Sykes. She was cast in guest roles in numerous sitcoms, including an episode of The Rag Trade in 1963, Fawlty Towers in 1979, and It Ain''t Half Hot Mum in 1981. From 1971 to 1972, she portrayed Adam Faith''s girlfriend''s mother in the ITV series, Budgie. Tanner was also cast as Luisa di Marco on the EastEnders throughout 1998, as well as a role on Coronation Street.', 'London , England , UK', 1, '/m4HLEXljWpEUYRDRC08NmcfDhp4.jpg'),
