        (1217601, 'Seana Kofoed', '1970-08-13', 'From Wikipedia, the free encyclopedia

Seana Kofoed is an American television and stage actress, born on August 13, 1970 in Wilmette, Illinois.Kofoed was raised in the Chicago area and attended New Trier High School, Northwestern University and the Royal National Theatre in London. She began her stage career in Chicago appearing in productions at the Goodman Theatre, the Court Theatre and the Victory Gardens Theater before moving to New York City.

In New York, Kofoed was best known for productions on and off Broadway. Her Broadway credits include Proof with Jennifer Jason Leigh and Night Must Fall with Matthew Broderick. Off Broadway credits include several productions at Manhattan Theatre Club, the Atlantic Theatre Company, and Manhattan Class Company, in addition to experiences in Glimmer, Glimmer, and Shine with the late John Spencer and An Experiment with an Air Pump, for which she received a Drama Desk Nomination for Best Supporting Actress.

Kofoed soon made the transition to on-camera acting, making an appearance on Law &amp; Order: Special Victims Unit and lending her voice to a small role in the movie Shark Tale. In 2006, she was cast in the hit dramedy Men in Trees, playing the lead character Marin''s (Anne Heche) editor and best friend, Jane.', 'Wilmette - Illinois - USA', 1, '/ykJ8EWsUIcQFvEGtSU9jhPPoH9e.jpg'),
