        (1218648, 'Chris Harrison', '1971-07-26', 'TV career took off in 1999, when he became lead anchor for Los Angeles-based horse-racing network TVG, then host of HGTV''s Designers'' Challenge. Moved into the US national spotlight in 2002, when he was named host of ABC''s new reality show, The Bachelor. Best known for his role as host of The Bachelor, and its spin-offs: The Bachelorette, Bachelor Pad, Bachelor in Paradise. He has also served as the host of the syndicated version of Who Wants to Be a Millionaire? since 2015.', 'Dallas, Texas, USA', 1, '/m05xUuywNTQRDCZ98gcg027pfqu.jpg'),
        (1218658, 'Tanya Streeter', '1973-01-10', 'Streeter was born to Jim and Sandra Dailey in the Cayman Islands. She has two sisters and a brother. She was educated in England at the independent girls'' school Roedean and at Brighton University. She met and married her husband Paul Streeter in England. They moved to the Cayman Islands in 1995. They have a daughter, Tilly Annina Andrus Streeter (b. 19 August 2008) and a son, Charlie Streeter (born 2015). After giving birth Tanya Streeter officially retired from freediving. She currently resides in Austin.

Streeter took up freediving at age 25 and almost immediately began to break records. She made her first important breakthrough in 1998 when she bettered Deborah Andollo''s Women''s No Limits diving record by 10 feet, achieving a total depth of 370 feet (113 m). She was inducted into the Women Diver''s Hall of Fame in March 2000. In 2002, she broke the men''s No Limit (NLT) world diving record by diving to a depth of 525 feet (160 m) near the Turks and Caicos Islands, a record which was surpassed later that year by French diver Loïc Leferme (162 m).

On 19 July 2003 she broke the men''s Variable Weight (VWT) world record by diving to a depth of 400 feet (122 m) and held it over a year until the record was broken by Carlos Coste (135 m) in Puerto la Cruz, Venezuela on 27 October 2004, but as a women''s record it lasted almost seven years, until Natalia Molchanova reached 125 m in June 2010 in Kalamata, Greece.

Streeter was featured in an Animal Planet documentary, Freediver (aired March 2006), and presented Dive Galapagos (aired March 2007). She presented a documentary shown on BBC Two called Shark Therapy in which she attempted to overcome her fear of sharks. She is a public speaker, presenting "The Deepest Dive Ever" at TEDx in Austin, Texas in 2012, and also at the Divers Alert Network UHMS DAN 2006 Breath-hold Proceedings. She appeared on a set of five commemorative postage stamps distributed by the Turks and Caicos Islands in 2003.', 'Grand Cayman, Cayman Islands', 1, '/968zKw0GP4AToQ1NaE8AjGtlUZt.jpg'),
