        (1219500, 'Kirsten Nelson', '1970-10-03', 'Kirsten Nelson (born October 3, 1970) is an American actress and director. Born in Oklahoma, though raised in Chicago, Nelson attended Northwestern University and became a founding member of Chicago''s Roadworks Theatre Ensemble before moving to Los Angeles. She starred in the USA Network dramedy Psych, where her character, Chief Karen Vick, is promoted to Chief of Police in Santa Barbara in Season 2. Nelson’s other roles include roles on Buffy the Vampire Slayer, The O''Keefes (as Ellie O’Keefe), Baby''s Day Out, The Fugitive, Frasier, Ally McBeal, The West Wing, Just Shoot Me! and Boy Meets World. Nelson is a Lutheran.', 'Enid, Oklahoma, USA', 2, '/gXri51tQZ9uHiLhTMUg2gDY9iiq.jpg'),
