        (1219530, 'Christopher Maher', NULL, 'Christopher Maher began his career in New York, studying under Sandy Meisner, at the Neighborhood Playhouse. He started on stage and as a regular on the soap opera, Another World. Since moving to Los Angeles in 1981, he has appeared in over 100 episodics and 20 feature films. He continues to work in L.A. and New York (and on location). As of late, he makes his full-time home in Taos, New Mexico. He is a Canadian citizen and spends part of the year in Toronto, Vancouver &amp; Los Angeles. Chris is an expert skier as well as a James Beard recognized Chef.', NULL, 1, '/fppebSYl6xIDwFpPbjpSX2Zi94R.jpg'),
