        (1220662, 'Lulu', '1948-11-03', 'Lulu Kennedy-Cairns, (born Marie McDonald McLaughlin Lawrie, 3 November 1948), best known by her stage name Lulu, is a Scottish singer, actress, and television personality who has been successful in the entertainment business from the 1960s. She is internationally identified, especially by North American audiences, with the song "To Sir with Love" from the film of the same name and with the title song to the James Bond film The Man with the Golden Gun. In European countries, she is also widely known for her Eurovision Song Contest winning entry "Boom Bang-a-Bang" and in the UK for her first hit "Shout", which was performed at the closing ceremony of the 2014 Commonwealth Games in Glasgow.

From Wikipedia', 'Lennoxtown, Stirlingshire, Scotland', 1, '/33aR2PSA2T4z2doFRXpXz6yYNoz.jpg'),
