        (1221007, 'Su Elliott', '1950-12-18', 'From Wikipedia, the free encyclopedia  Su Elliott (born 18 December 1950) is a British actress.  She was born in Newcastle upon Tyne, Northumberland, England. Her film roles include Alice in The Zany Adventures of Robin Hood (1984), a nurse in The Girl in a Swing (1988), Marthe in Giorgino (1994), Mrs Brabin in Purely Belter (2000), a pub customer in The Hitchhiker''s Guide to the Galaxy (2005), a Ministry of Magic witch in Harry Potter and the Goblet of Fire (2005), and Hannah in Jane Eyre (2011). Elliott has appeared in numerous British television productions, including The Secret Diary of Adrian Mole, Travelling Man, Hi-de-Hi!, The Bill, This Life, Auf Wiedersehen, Pet, Black Books, Coronation Street, King Leek and EastEnders.  She also appeared in Central Independent Television''s Halloween special The Worst Witch as Agatha''s assistant, Delilah.  It is said on the DVD commentary for The Hitchhiker''s Guide to the Galaxy that Garth Jennings, the director, only found out that Elliott had played Trillian in a stage adaptation of the same production after filming had finished.', 'Newcastle-upon-Tyne, England, UK', 1, '/6IlvNaDF0JRF9hhIVTOEyLDjS36.jpg'),
        (1221020, 'David Orth', '1965-03-13', 'From Wikipedia, the free encyclopedia.

 David Orth (born March 13, 1965) is a Canadian actor.  Orth was born and raised in Kitchener, Ontario. His most notable role was as Edward ''Ned'' Malone in the TV series The Lost World, which was shot in Australia. He played this part from 1999 until 2002. During the shooting of The Lost World, he purchased a home in Australia and soon after met his wife there. Orth voiced Blizzard in Iron Man: Armored Adventures. He has also starred in Beyond Reality, The Ray Bradbury Theatre and in the episode "Scarecrow" on the CW''s horror/drama series Supernatural.  He has hinted that although he enjoys his acting career, he would like to become a director in the future, "I''d like to work toward both producing and directing. Directing really interests me as it does many actors".', 'Kitchener - Ontario - Canada', 1, '/qvw7djGPev8EaIvpTWLMtZWDYpE.jpg'),
