        (1222822, 'Amy Spanger', '1971-08-24', 'From Wikipedia, the free encyclopedia

Amy Spanger is an Americanactress, singer and dancer.

Born in Newbury, Massachusetts, Spanger made her Broadway debut in 1995 in the musical Sunset Boulevard, following a half-year run in the pre-Broadway national tour of Jekyll &amp; Hyde. She originated the role of Lois Lane (Bianca) in the Broadway revival of Kiss Me, Kate. In Chicago she played Roxie Hart, and in Urinetown as Hope Cladwell. In 2006 she originated the role of Holly in The Wedding Singer.

Spanger also appeared in the national touring companies of Rent and Chicago. She originated the role of Susan in the off-Broadway production of the Jonathan Larson musical tick, tick... BOOM!. Other stage credits include: Lunch, and Feeling Electric, which later became Next to Normal, in which she co-starred with actor Anthony Rapp.

She originated the role of Sherrie in the Broadway musical Rock of Ages,  but took an extended leave from the production in early June 2009 for  vocal rest before permanently departing the production on June 29 for  "personal reasons."

She more recently originated the role of Jovie in the stage musical adaption of Will Ferrell''s Christmas comedy, Elf, that ran on Broadway for nine weeks at the Al Hirschfeld Theater and closed on January 2, 2011.', 'Newbury - Massachusetts - USA', 1, '/7BNBzTUNALglTYsTannMB5F2u1q.jpg'),
