        (1223005, 'Brandon Henschel', '1981-01-24', 'Brandon Henschel has worked in the Entertainment industry for 15 years and is a Choreographer trained in Classical Ballet, Hip Hop, Jazz, Contemporary, Broadway and more. He has helped train celebrities for their dance roles including Toby McGuire (Spider Man 3), Brad Pitt and Angelina Jolie (Mr. and Mrs. Smith). Brandon has Choreographed Major industrial projects for brand name retailers Nike and Reebok, and has been a featured Choreographer in many Dance Television shows and Films. As one of the most versatile choreographers in the industry, there isn''t a project or style of dance Brandon hasn''t seen or done.', 'Lakeside, California, USA', 1, '/rViCJxv22hqrGEuN0sVs5Ao6cXT.jpg'),
