        (1223406, 'Leanna Pareja', NULL, 'The self loving popularity obsessed Alice Buchanan is played by the  wonderfully talented Leanna Pareja.  With Colombian roots, Leanna Pareja is native to Southern  California. She worked as a model before breaking into acting,  starting with small roles in The Jerk Theory (2009) and The  Kane Files: Life of Trial (2010). She came to public attention  for her role on TNT''s all new Dallas (2012). In the episode  "Hedging Your Bets." Leanna guest starred as the "Real Marta" acting  alongside the late Larry Hagman. Leanna has focused on giving  back to the impoverished and less fortunate, traveling to places like  Ethiopia, Egypt, Central and South America. Some of the  charities Leanna has contributed to are Engage Now Africa, Charity  Water,  Operation Smile, and World Vision.', NULL, 1, '/tIUUEL1ackXQxhRZgrIsZ7B0S2O.jpg'),
