        (1223435, 'Toby Hargrave', '1974-09-26', 'Described as “a happy Hagrid” (for his more than passing resemblance to the Harry Potter chum) comedian Toby Hargrave shares the character’s imposing physical presence as well as his colossal warmth. Audiences are drawn in (if never completely put at ease) by Hargrave’s humble charm and unwaveringly honest comedy.   A gifted storyteller with an absurd ability to pinpoint the unseen hilarity of life, Hargrave has captivated audiences for over 20 years. Credits include appearances at the Just for LaughsComedy Festival in Montreal, Atomic Comedy Festival in Washington State, Whistler &amp; Edmonton Comedy Festivals, Vancouver International Comedy Festival, where he was award title of “Funniest Comedian in Vancouver”.  Starting in his home town of Edmonton Alberta, Toby has performed at The Comedy Store, Improv, Laugh Shop, Yuk Yuks, Hermosa Comedy Magic Club, Jon Lovitz Comedy Club and continues to enthrall audiences across North American with his incredible ability to connect with diverse crowds and relate his unique comedic perspective.', 'Edmonton - Alberta - Canada', 2, '/wW2kOlVGtrrDEZiNMd3poz7CKAD.jpg'),
