        (1223718, 'Rizwan Manji', '1974-10-17', 'From Wikipedia, the free encyclopedia.

Rizwan Manji (born October 17, 1974, height 5'' 7" (1,70 m)) is a Indo-Canadian actor. He is most most famous for his role as Rajiv in the now cancelled NBC Universal TV series Outsourced. Manji was born in Toronto, Canada where his Indian parents had immigrated to from Tanzania. His family is Ismaili Muslim, and he states that his religion is very important to him in life.  He was raised in Calgary, Alberta, and went to Crescent Heights High School. He later moved to the US where he attended the American Musical and Dramatic Academy.  Manji played small parts in various films and television shows with recurring roles in Privileged, Better Off Ted and 24. In 2010, he auditioned for the role of Gupta on the NBC comedy Outsourced. Although he lost the part to Parvesh Cheena, the producers decided to cast him as the scheming assistant manager Rajiv. Manji resides in Studio City, California, with his wife and two children.', 'Toronto - Ontario - Canada', 2, '/yB9w540vNe4pwa3ptvO1haDUKWy.jpg'),
