        (1223883, 'Maurissa Tancharoen', '1975-11-28', 'From Wikipedia, the free encyclopedia.

Maurissa Tancharoen Whedon (born November 28, 1975 in Los Angeles, California) is an American actress, singer, dancer, television producer/writer and lyricist

Career

She co-wrote Dr. Horrible''s Sing-Along Blog and appeared onscreen as Groupie #1, as well as on the DVD audio track "Commentary! The Musical", in which she sings about the scarcity of non-stereotyped roles in television and film for actors of Asian origin.She was a staff writer and story editor for the program Dollhouse and the short-lived sitcom Oliver Beene. Tancharoen also played a brief acting role in Dollhouse as the active Kilo (like the other Los Angeles actives named from the NATO phonetic alphabet), and co-wrote and performed lyrics for "Remains" with Jed Whedon for the Dollhouse episode "Epitaph One".She provided Zelda''s singing voice in the season 2 episode "The Musical" of The Legend of Neil, a spoof based on the video game The Legend of Zelda, and performed backing vocals and danced in the video for the The Guild parody song "(Do You Wanna Date My) Avatar" released August 17, 2009.She was a writer and producer on the Starz series Spartacus: Gods of the Arena and is credited as co-writer of the first two episodes together with Jed Whedon. She also worked on Spartacus: Vengeance.

Tancharoen was also a writer and story editor for Drop Dead Diva.

Tancharoen''s first paid script came in 2001 when she sold Revolution Studios an untitled pitch in which two Asian American FBI agents investigate a gang in South Central Los Angeles by working undercover as Korean grocery store clerks.

Her production credits include working as assistant to producer Mark Tinker on NYPD Blue and to William M. Finkelstein on Brooklyn South, as well as being co-executive producer of the series DanceLife.

Tancharoen worked with Jed Whedon and Joss Whedon on The Avengers, and co-wrote the Marvel TV Pilot for ABC titled Agents of S.H.I.E.L.D. with Jed Whedon and Joss Whedon, and continues to work as an executive producer and showrunner.

Personal life

Tancharoen is Asian-American and has said that her surname is of Thai origin. She attended Occidental College, where she wrote two plays that won the Argonaut & Moore literary award. Her father, Tommy Tancharoen, is a transportation coordinator for Hollywood movies. Her brother Kevin Tancharoen is a director, whose feature film debut is 2009''s Fame. On April 19, 2009, she married fellow writer Jed Whedon, brother of Joss Whedon.In her younger years, Tancharoen was a member of the girl band Pretty in Pink. Before ''making it big'', the band broke up and shortly after Tancharoen was diagnosed with lupus that required chemotherapy.', 'Los Angeles - California - USA', 1, '/1Lv38CXO2Q4d8Dq0HVmwBaCZhcJ.jpg'),
        (1223886, 'Elizabeth Henstridge', '1987-09-11', 'From Wikipedia, the free encyclopedia.

Elizabeth Frances Henstridge (born September 11, 1987, height 5'' 4" (1,63 m)) is an English actress.

Henstridge was born in Sheffield, England and graduated University of Birmingham and studied at East 15 Acting School, and later moved to Los Angeles. She was cast as lead in 2012 The CW TV pilot Shelter, and co-starred in feature films The Thompsons, Gangs of Tooting Broadway, and Reach Me.

On British television, she appeared in soap opera Hollyoaks as Emily Alexander in 2011. In November, 2012, Henstridge was cast as Agent Jemma Simmons, a series regular character in the ABC pilot Agents of S.H.I.E.L.D. The series was officially ordered on May 10, 2013, and premiered on ABC television (US) September 24, 2013.', 'Sheffield, England, UK', 2, '/rH2c5GZJSElWLZ0xNLbSLejcejr.jpg'),
        (1223891, 'Julia Ling', '1983-02-14', 'A native of Southern California, Julia Ling first expressed her creative  side at age 3 when she drew pictures of her parents drinking tea. By  age 6, her artwork had been featured in local magazines, festivals and  newspapers, including the Pasadena Star News, which gave her a  front-page spread. Also at age 6, Ling wrote and narrated a creative  story that won her the "Best Storyteller Award" by the Chinese World  Newspaper. By age 9, Ling was performing award-winning solo dances  throughout California, and her umbrella dances had aired on national  television.

In high school, Ling was student body president and  president of German Club, Amnesty International, Literature Society and  Junior Statesmen Debate Team. She competed in dance, varsity tennis and  swimming. In 1997, Congressman David Dreier recognized Ling for her  community service at the local hospital. At age 16, she was selected as a  state finalist in the Miss America Pageant and after nine years of  playing the piano, graduated from the Royal Board of Music. She  graduated high school second in her class with a 4.0 GPA and perfect SAT  scores.

Pursuing a career in medicine, Ling majored in  biomedical chemical engineering at the University of California, Los  Angeles. She was Treasurer of Chemical Engineering Society, Vice  President of the Engineering Society of UCLA and honorary member of the  Society of Women Engineers. She left it all to pursue her love of  performing.

In 2003, Julia Ling made her network television debut  on Buffy the Vampire Slayer, playing opposite Sarah Michelle Gellar.  Over the next two years, she starred in over 20 independent short films  and returned to prime time television in roles on House (FOX) and ER  (NBC) in 2006. She guest starred in the recurring role of Kim Tao on the  critically acclaimed Studio 60 On the Sunset Strip (NBC). Her next  major guest starring role was on the television drama ER, playing the  recurring character of Mae Lee Park, a surgical intern. She also guest  starred in The O.C., and Grey''s Anatomy.

Most notably known for  her work on prime time television, Ling starred as the popular Anna Wu  on NBC''s CHUCK. After voicing and filming the live action character  "Izumi" for the video game, Command and Conquer (EA), Ling toured the  world for autograph signing and charity fundraising.

In the 2007  Jackie Chan Disciples martial arts competition, Ling was selected as one  of the top four finalists to compete in the International Top 100. Her  performance also won her "Best Acting Award". In 2011, Ling joined the  cast of FOX sitcom, I Hate My Teenage Daughter and voiced a sketch for  Conan O''Brien.

Most recently, she worked on a movie performing  opposite Academy Award winner Adrien Brody. The movie will premiere in  theaters June, 2012.', 'Southern California - California - USA', 2, '/aXBiJb2mQhjpxIF2zEFcsBttx43.jpg'),
        (1223903, 'Dominic Janes', '1994-02-11', 'Born Dominic Roque Janes Centorbi in Tucson, Arizona, Janes has had recurring roles in ER, as Alex Taggart, the son of Linda Cardellini''s character R.N. Samantha Taggart, and in Dexter, as the younger version of the title character. He also appeared in Crossing Jordan. He starred in the Cartoon Network original film Re-Animated and its spin-off series Out of Jimmy''s Head. He also portrayed Billy Madsen in the 2007 movie Wild Hogs. He voiced Squidboy in television series Wolverine and the X-Men.

Janes has performed improvisation comedy at the L.A. Connection in Sherman Oaks, California. His mother is an attorney and his father is a poet, and he has a brother Ian. His uncle is bassist Joe Preston.', 'Tucson, Arizona, USA', 1, '/cVeSbrXD5IFtB0bV8RxrlBbzoV7.jpg'),
