        (1224931, 'Dick Vitale', '1939-06-09', 'Richard John "Dick" Vitale (born June 9, 1939), also known as "Dickie V", is an American basketball sportscaster. A former head coach in the college and professional ranks, he is well known as a college basketball broadcaster for ESPN. He is known for catchphrases such as "baby" and "diaper dandy" (outstanding freshman player), as well as enthusiastic and colorful remarks he makes during games, and has authored nine books and appeared in several movies.', 'Passaic, New Jersey, U.S.', 1, '/aTQHrtar1WrxzSIqL6F3H7CZBdl.jpg'),
