        (1224999, 'Gregg Turkington', '1967-11-25', 'Gregg Turkington is an Australian-born American entertainer and actor, known for his character Neil Hamburger. He is also known for his contributions as "Resident Expert" on the parodic film review web series On Cinema and for being co-writer and co-star of the Adult Swim series Decker. Turkington had a small part in the 2015 film Ant-Man by Marvel Studios, and starred in the drama Entertainment the same year.', 'Darwin, Northern Territory, Australia', 1, '/1NjhOtLud39grRV5EXWtVEEPn73.jpg'),
        (1225040, 'Maurice Colbourne', '1939-09-24', 'Maurice Colbourne (24 September 1939 – 4 August 1989) was a British stage and television actor who specialised in playing villains and hard men until 1985, when he took the key role of Tom Howard in the BBC Television serial, Howards'' Way. Colbourne was born Roger Middleton but took his stage name after reading about the death of actor Maurice Colbourne who shared the same birthday as he did. Colbourne''s biggest success in the 1970s was as the lead in the crime drama series Gangsters. In the 80s he starred in Johnny Jarvis and the acclaimed adaptation of John Wyndham''s classic sci-fi novel, The Day of the Triffids. Staying with sci-fi, he had a recurring guest role in Doctor Who as the mercenary Lytton, playing opposite the fifth and sixth doctors (Peter Davison and Colin Baker) in adventures featuring the timelords deadliest foes; the Daleks and the Cybermen.  But it was the leading role in Howards'' Way that he will perhaps best be remembered for. He played Tom Howard until 1989, when he died suddenly aged 49 from a heart attack. The show ended a year later.', 'Sheffield - England - U.K.', 1, '/5CksKlxnpan2retGamMHGImuHUN.jpg'),
