        (1225208, 'Denise Bryer', '1928-01-05', 'Denise Bryer (born 5 January 1928) is an English voice actress.

Best remembered in her UK homeland for her work on the Gerry Anderson series, Terrahawks, where she voiced both the main villain Zelda and the heroic Capt. Mary Falconer, Bryer became well known in the United States when she voiced Billina in Disney''s 1985 film Return to Oz, as well as The Junk Lady in the 1986 movie Labyrinth, and many other films. In addition to her work voice acting in film and television she also worked extensively on UK radio and children''s recordings. She was the first wife of Nicholas Parsons.

Bryer first came to public attention when she voiced Twizzle in Gerry Anderson''s The Adventures of Twizzle and would go on to voice in Anderson''s later series Four Feather Falls as Ma Jones and Little Jake. She also voiced Kiki The Frog in Hector''s House and Noddy on the eponymous television show. She dubbed the voice of Commander Makara in the Japanese puppet series Star Fleet around the same time as Terrahawks. In Big Finish''s Doctor Who audio dramas The Reaping and The Gathering, she provided the voice of Dominique Van Gyseghem.

From Wikipedia, the free encyclopedia', 'Kensington, London, England, UK', 1, '/oNXh8dOvqxks7X851E2eKoCqWeX.jpg'),
        (1225230, 'Gordon Brown', NULL, '', NULL, 1, NULL),
        (1225254, 'Jade Ewen', '1988-01-24', '', 'Plaistow, London, England, UK', 1, NULL),
        (1225349, 'Deborah S. Craig', '1974-06-01', 'Deborah S. Craig stars as Shelley Ng, a waitress at Bluebell, Alabama ''s local restaurant and bar, the Rammer Jammer , in The CW ''s new series "Hart of Dixie," a fish-out-of-water story about a New York City doctor (Rachel Bilson) adjusting to life in a small Southern town after she inherits a local medical practice.

She is best known for originating the role of Marcy Park on Broadway in the Tony award winning musical, The 25th Annual Putnam County Spelling Bee. Based on her own childhood, Marcy Park became the first Korean American character created on Broadway and earned her critical raves as well as a Drama Desk Award. On television, she was a recurring guest star on JJ Abrams/ABC’s "Six Degrees" opposite Bridget Moynihan and starred in MTV Iggy’s “Crap From Beyond the Seas”. As a writer/actor Miss Craig was featured on Funnyordie.com twice and achieved immortal status (over 100k hits) for her cult web hit “Yoga For Black People”.

She can also be seen in the feature films "Ghost Town" with Ricky Gervais, "Just Wright" with Queen Latifah and the indie comedy “818” premiering in the 2011 Miami International Film Festival. Off Broadway credits include workshops of Tony Kushner’s IHO at the Public Theater(dir. Michael Grief) the core cast of the improv extravaganza Don''t Quit Your Night Job, Sung Rno''s WaVe with Ma-Yi Theater Co/Dir. Will Pomerantz, Pericles with Red Bull Theater Co/Dir. Jesse Berger, Fuenteovejuna with NAATCO (dir. David Herskovitz) and The Karaoke Show directed by Diane Paulus. Regional work includes Adam Gwon’s Ordinary Days at South Coast Rep (dir. Ethan McSweeney) , My Scary Girl at Barrington Stage Co. and the rock musical Falco in Vienna, Austria.

She is an alumni of Ma-Yi Theater Company''s Writers Lab, a certified yoga instructor and an accomplished singer/songwriter most notably penning the title song for the feature film “Purity” and the youtube sensation “I’m a L-L-L-L Lesbian for you”.

Craig graduated from the Ma-Yi Theater Company''s Writers Lab.

http://hartofdixie.wikia.com/wiki/DeborahS.Craig', NULL, 1, '/frzyta7LIaGMrwx79dHMmV7iSmp.jpg'),
