        (1225358, 'Erkan Mustafa', NULL, '', NULL, 1, NULL),
        (1225377, 'Rufus Crawford', '1955-05-21', 'Rufus is a former professional football player, who played for the Seattle Seahawks of the National Football league. He also played seven years for the Hamilton Tigercats of the Canadian Football League where he broke a record that had stood for 28 years. Rufus set a new all time CFL total yardage record of 2,896 for the 1984 Season. He was honored as the 1980''s Hamilton Tigercat player of the decade and the plaque that bears that honor in his name now resides in Hamilton Ontario out side the Tigercats stadium. Rufus was also voted as one the 75 greatest Tigercats player of all times. Upon retirement from the professional football in 1986, he began to pursue another passion of his, acting. After taking a year of acting lessons he decided to take his acting more seriously In 2008 Rufus was inducted into Virginia State University Sports Hall of Fame, the university in which he attended. On May 19th 2014 in his home town of Gastonia North Carolina, he was inducted into The Gastonia County Sports Hall of Fame.  - IMDb Mini Biography By: Rufus Crawford', 'Gastonia - North Carolina - USA', 1, '/voE5f2pV2Ah7VqTmR3TeAewOQj4.jpg'),
        (1225378, 'Louis Di Bianco', NULL, 'Louis Di Bianco is a professional screen and stage actor with international credits and more than thirty years experience. He has starred and costarred in a wide variety of dramatic and comic roles in numerous feature films, MOW’s and episodic TV shows. His professional on camera acting classes are in constant demand. As well, he has written two one-act plays, two full-length plays, and a screenplay. Louis Di Bianco is a member of SAG, Equity, and ACTRA. He holds dual citizenship in the United States and Canada and works freely in both countries.', NULL, 1, '/3trabVKLgCrMWu5L6f0k2v0lzJG.jpg'),
