        (1226245, 'Christian Bowman', '1975-03-11', 'Christian Bowman grew up traveling around the world attending 32 public and private schools throughout North America and Europe.

When he was 17, Bowman was involved in a car accident outside of Chicago after returning from traveling through Europe and Africa. This accident killed four people including his mother, Carolyn Walsh, and girlfriend, Sonia Herzog. Upon recovering from his injuries, he moved back to Hale''iwa, HI with his stepfather, James Walsh. Christian continued to travel throughout North America, Africa and Europe after his recovery.

Christian joined his uncle, skydiver James Darby, in business at Skydive Palm Beach, FL in 1997 until Darby''s death in a skysurfing accident. Christian moved back to Honolulu, Hawaii in 1999 and his son, Bodhi, was born on May 21, 2001.

Christian began his acting career on the television show North Shore in 2004. He later became a character on the television show Lost, appearing as Steve Jenkins, often confused with the character Scott Jackson.

After appearing in a variety of commercials in Japan, he moved to Los Angeles, CA and eventually to Austin, TX where he joined the cast of Prison Break as Agent King in Dallas, TX in 2007, along with several independent films from 2008-2010, The Lying Game in 2012 and Sin City 2: A Dame to Kill For Austin in 2013.

Christian is owner of Last Pull Productions and is pursuing a degree Radio Television Film in Austin, TX. His first feature Overcome is currently in Preproduction.

- IMDb Mini Biography', 'Harrisburg - Pennsylvania - USA', 1, '/koKY6HydRnAQXo2DRW8bNqvOd58.jpg'),
