        (1226531, 'Jon Reep', '1972-03-26', 'Actor/Comedian Jon Reep was born in Hickory, NC. He lived there until he moved to Raleigh, NC in 1992. While attending North Carolina State University he began performing stand-up comedy at Goodnights comedy club. He graduated from NCSU in 1997 with a Bachelor of Arts degree in Theater, Mass Communication, and Public &amp; Personal communication. After graduating Jon was employed at UNC-TV where he became the assistant director of such TV shows as "North Carolina Now" &amp; "Legislative Week in Review", while at night simultaneously honing his skills as a stand-up comedian. In 1998 Jon left UNC-TV to pursue comedy full time. He traveled all over the country performing in comedy clubs and colleges in every state in America. In 2000, Jon was invited to perform at the Montreal Just for Laughs festival, and shortly thereafter moved to Los Angeles, CA to further is career as a stand-up comedian and actor.

As an actor Jon has played the pot smoking farmer "Raymus" from the movie "Harold and Kumar escape from Guantanamo Bay", and the dim witted cop Gerald Bob from the ABC Sitcom "Rodney". He played a goodwill worker in Disney Channels "Good Luck Charlie" and was the HEMI guy in Dodge Truck''s popular ad campaign.

As a comedian he was the Winner of NBC''s "Last Comic Standing" season 5. He''s been on Comedy Central''s "Premium Blend", the half-hour special "Comedy Central Presents: Jon Reep", &amp; his on special "Jon Reep: Metro Jethro". He''s been on TBS''s "Pit Stop Comedy", NBC''s "Late Friday" or CMT''s "Comedy Club" &amp; "Comedy stage."

Jon resides in Los Angeles with his wife and 2 dogs.  IMDb Mini Biography By: Jon Reep', NULL, 1, '/gLyZQeTjGxWrEhQNThFZAwhPSpi.jpg'),
