        (1228062, 'Barbara Cason', '1928-11-15', 'From Wikipedia, the free encyclopedia.  Cason was born in Memphis, Tennessee, the daughter of Helen Louise (Phebus) and Charles Carroll Cason. She began her career appearing intheatre and on local television in Memphis during the 1950s, where she notably co-founded and ran the Front St. Theatre.  She relocated to New York City in 1967, becoming active in theatre there both on and off Broadway through 1973. She most notably starred in the original critically acclaimed production of Noël Coward''s Oh, Coward! in 1972-73. She appeared in such cult films as Cold Turkey and The Honeymoon Killers.  After the early 1970s, Cason''s career became centered in Los Angeles, appearing mostly within television up until her death. She is probably best known for her roles as Cloris Phebus on Carter Country (1977–1979) and Ruth Shandling on It''s Garry Shandling''s Show (1986–1990).  She was married to actor Dennis Patrick from 1970 until her death. She died in Los Angeles, California, aged 61, after a heart attack.', 'Memphis - Tennessee - USA', 1, '/igOTR0XqlES2i27rRZy14rb8N8Q.jpg'),
