        (1230252, 'Peter Howitt', '1957-05-05', 'Peter Howitt is an English actor and film director. He grew up in Eltham, London and Bromley, Kent, Peter used to be a part of the Priory Players in the Priory behind Christ Church, Eltham. He has two children, Luke (born 1990) and Amy (born 2008). He currently resides in Vancouver, Canada.

