        (1230310, 'Shane Connor', '1959-04-03', 'A prolific Australian performer, Shane''s career spans nearly 20 years in film, theatre and television. A Victorian College of the Arts graduate, Shane has earned several industry awards including: the 1984 Penguin Award for Best Actor, 1995 Green Room Award for Outstanding Fringe Performer and a nomination for the 1998 AFI Showtime Award for Best Actor in a Leading Role in a Television Drama. Shane''s previous theatre credits include: The Doll Trilogy, Backbeat, Harp in the South, And the Big Men Fly, Fool For Love, Byzantine Flowers, The Custodians, The Old Man Comes, Rolling Home, Summer of the Seventeenth Doll, Coast Mongrels, Nil, Cat and Buried, The Snake Pit, Gary''s House, The Shifting Heart and Wonderful Ward. Also a recurring presence on the small screen, Shane has appeared in countless Australian television series including: Prisoner, Carson''s Law, Cop Shop, The Keepers, A Country Practice, Emerging, Prime Time, Matthew''s Passion, Harp in the South, Army Wives, Sons & Daughters, Poor Man''s Orange, Flying Doctors, Living With The Law, No Hard Feelings, GP, Phoenix, Police Rescue, Heartlands, Fire, Feds, The Man From Snowy River, Good Guys Bad Guys, Raw FM, Moby Dick, Halifax f.p., Blue Heelers, WIldside and most recently, Stingers.', 'Woodville, South Australia, Australia', 1, '/n19s0ZUL5OBkN9zQQrmFQgEdhsV.jpg'),
