        (1230933, 'Stuart Maconie', '1960-08-13', 'Stuart Maconie is a British radio DJ and television presenter, author, journalist, and critic working in the field of pop music and popular culture. Since 2007, Maconie has partnered fellow DJ Mark Radcliffe for the Radcliffe and Maconie Show, firstly on Radio 2 and then on 6 Music. The pair also appeared (vocals only) as the DJ''s Findlay and Donovan in the 2014 film God Help The Girl from Belle and Sebastian''s Stuart Murdoch.', 'Whiston, Merseyside, England, UK', 1, '/xPjGDVZv5TJdNdn0eUHIlLsPExE.jpg'),
