        (1230989, 'Michael Pennington', '1943-06-07', 'Michael Vivian Fyfe Pennington is a British director and actor who, together with director Michael Bogdanov, founded the English Shakespeare Company. Although primarily a stage actor, he is best known to wider audiences for his role as Moff Jerjerrod, commanding officer of the Death Star in the film Star Wars Episode VI: Return of the Jedi and as Michael Foot in The Iron Lady, opposite Meryl Streep.', 'Cambridge, Cambridgeshire, England, UK', 1, '/jreFHCg8golvAEbcwzKtPoqg6YZ.jpg'),
        (1231005, 'Anneliese van der Pol', '1984-09-23', 'is a Dutch-American actress, singer, and dancer. Following her early career in musical theatre, she was best known for her role as Chelsea Daniels on That''s So Raven, a role she reprises on its sequel Raven''s Home. Van der Pol also has a career as a singer and has recorded several songs for The Walt Disney Company. She made her Broadway debut in 2007, and appeared Off-Broadway in 2009. She has also acted in the 2010 vampire spoof film Vampires Suck directed by Jason Friedberg and Aaron Seltzer.', NULL, 1, '/sTAagNGaln1XbvrfFUIFUkKWPfU.jpg'),
