        (1231106, 'Steve Peacocke', NULL, 'Stephen''s best known for his role as ''Brax'' in the long running Australian serial drama, ''Home &amp; Away''. He''s appeared in various other Australian Film, Television and Theatre productions and most recently worked on Brett Ratner''s, ''Hercules'', along side Dwayne Johnson, John Hurt and Ian McShane. Stephen grew up in Dubbo in Central Western New South Wales, worked as a Jackaroo on a large scale sheep &amp; cattle station west of Bourke and graduated from the University of Newcastle with a degree in Communications. His passion before acting was Rugby Union where he played at First Grade and Representative levels throughout his schooling, university and adult life.', NULL, 1, '/q51Ri8NVI13ces9nNKCHP0EhAKy.jpg'),
