        (1231166, 'Bryan Mosley', '1931-08-25', 'Bryan Mosley was a British actor best known for playing the greengrocer Alf Roberts in the long running soap opera Coronation Street. He played the role from twenty-eight years from 1971 to 1999 when his character died on screen. Ill health had forced Mosley to retire and he passed away just a few weeks after his leaving the Street of a heart attack, aged 67. Away from his most well known role, Mosley appeared in several films including Get Carter, where he was famously killed by Jack Carter (Michael Caine) who beats him up and throws him from the roof of the Trinity Square multi-storey car park in Gateshead, after discovering Brumby''s involvement in his brother''s death. Mosley was also a fencer and a stage and film fight arranger. He fenced with Terence Stamp in the film Far from the Madding Crowd. He was a founder member of the Society of British Fight Directors and he arranged the Get Carter fight with Caine. Mosley was sometimes credited as Buddy Windrush for his stunt work.', 'Leeds, West Yorkshire, UK', 1, '/t0LSyouOgD6qD4Ryu9MfiNsNvN3.jpg'),
