        (1232373, 'Mark Roberts', '1961-01-19', 'Mark Roberts (born January 19, 1961) is an Americanproducer,  screenwriter, playwrighter, actor and comedian, best known for creating the American sitcom Mike & Molly.

Mark has began as a stand-up in Chicago, and was soon spotted by a casting director who helped him land work in commercials. Sitcom work soon followed, including a series regular gig on the Tea Leoni series "The Naked Truth", before Roberts chose to pursue writing, his true passion. His 2000 play "Couples Counseling Killed Katie", starring Roberts and Jessica Tuck, caught the eye of producer Chuck Lorre, who went on to hire him as a writer and producer on "Two and a Half Men". Roberts would then go on to create "Mike and Molly", which won an Emmy for star Melissa McCarthy.', 'Urbana, Illinois, USA', 1, '/hyuO2XVmwDvpinp5iWdvpIyGpK2.jpg'),
