        (1233092, 'Vendela Kirsebom', '1967-01-12', 'Kirsebom has appeared on the magazine covers of Bride''s (US), Flare (Canada), Shape (US), FHM (UK), and Zest (US) and has been featured multiple times in the pages of the Sports Illustrated Swimsuit Issue. She appeared in Batman and Robin in 1997 as Nora Fries and The Parent Trap, alongside Lindsay Lohan, Natasha Richardson, and Dennis Quaid in 1998. She was also featured in the Disney Channel''s Model Behavior with Justin Timberlake and Maggie Lawson. She appeared as herself in 1995 episodes of The Larry Sanders Show and Murphy Brown, as well as the 2005 TV-movie sequel Romy and Michele: In the Beginning. Kirsebom made a cameo as a "space villainess" in a "Pigs in Space" skit on Muppets Tonight. She also lent her voice to a fictionalized version of herself on Johnny Bravo. In 1999, she hosted the Swedish music competition Melodifestivalen 1999. From 2006 to 2008, she hosted the Norwegian version of Top Model, and also hosted the fourth cycle of the Swedish version in 2007.', 'Vällingby, Sweden', 1, '/A3wcfr2iX1H1De44wO3R9EhL3iW.jpg'),
