        (1233278, 'Dreya Weber', '1961-05-08', 'During her teenage years, she competed with the Mexican National Hurdling Team, ranking within the top ten. She returned from Mexico to attend Hunter College in New York City.

She performed aerial silk at the 2002 Winter Olympics in Salt Lake City.

She has worked as an aerialist for entertainers including Madonna and Pink, for whom she choreographed several aerial acts including the performance of Pink at the 2010 Grammy Awards. She toured with Cher during her Living Proof farewell tour and choreographed all of the aerial routines. She is currently represented by McDonald Selznick Associates.

She produced and stars in The Gymnast (film) (2006) which took home 28 festival awards, including Best Feature at Outfest, Newfest and Frameline, and demonstrated her aerialist skills. She also produced and stars in A Marine Story about the US Military policy of Don''t Ask, Don''t Tell.

She describes herself as omnisexual.

Weber choreographed the aerialists for Cher''s farewell tour.', NULL, 1, '/bdyL7N2Wnuf40wIMMf7mF8RMOyr.jpg'),
