        (1234991, 'Keeley Forsyth', '1979-01-01', 'Keeley Forsyth is an English actress and musician. Her first acting role was as Nicky in the BBC children''s television series The Biz in 1995, appearing alongside Paul Nicholls. She subsequently appeared in several television series, including Peak Practice, Where the Heart Is, Casualty, Heartbeat, The Bill, Dalziel and Pascoe, Holby City, The Line of Beauty, Luther, Criminal Justice, Coronation Street, Sons and Lovers. She has also performed for Real Circumstance Theatre Company. In 2001, she appeared in an all-star Family Fortunes: Heartbeat vs Peak Practice edition.', 'Oldham - Lancashire - England - UK', 1, '/5di42jElQkufxLdQZ9DwbbIJT31.jpg'),
        (1234992, 'Susannah Corbett', '1968-08-10', 'Susannah Jane Corbett is an English actress and author, the daughter of Steptoe and Son actor Harry H Corbett and Maureen Blott. Her acting career began in 1991 and she has performed on television, film and radio. She is perhaps best known for her role as Ellie Pascoe in the BBC series Dalziel and Pascoe. As an author, she writes children''s book and has penned a biography of her late father.', 'Marylebone, London, England', 1, '/yCjIW6v3OnOfgqSLgxQsffVgBTT.jpg'),
