        (1235040, 'Roy Acuff', '1903-09-15', 'From Wikipedia

Roy Claxton Acuff (September 15, 1903 – November 23, 1992) was an American country music singer, fiddler, and promoter. Known as the "King of Country Music," Acuff is often credited with moving the genre from its early string band and "hoedown" format to the star singer-based format that helped make it internationally successful. In 1952 Hank Williams told Ralph Gleason, "He''s the biggest singer this music ever knew. You booked him and you didn''t worry about crowds. For drawing power in the South, it was Roy Acuff, then God."

Acuff began his music career in the 1930s, and gained regional fame as the singer and fiddler for his group, the Smoky Mountain Boys. He joined the Grand Ole Opry in 1938, and although his popularity as a musician waned in the late 1940s, he remained one of the Opry''s key figures and promoters for nearly four decades. In 1942, Acuff co-founded the first major Nashville-based country music publishing company—Acuff-Rose Music—which signed acts such as Hank Williams, Roy Orbison, and The Everly Brothers. In 1962, Acuff became the first living inductee into the Country Music Hall of Fame.', 'Maynardville, Tennessee, USA', 1, '/oiMuUwrRT80jSK0f2tYglxzwYSx.jpg'),
        (1235042, 'Fritha Goodey', '1972-10-23', '', 'Kingston-Upon-thames, England, UK', 1, '/fTQQ4b5TXaRnyhW2TwGRC3hJ3s0.jpg'),
        (1235088, 'Kristofor Brown', NULL, '', NULL, 1, NULL),
        (1235128, 'Dan Karaty', '1976-10-01', 'Daniel Quinn Karaty (born October 1, 1976) is an American TV personality, actor, producer, dancer and choreographer. He has performed with and/or created routines for pop superstars such as Jessica Simpson, Britney Spears, Kylie Minogue, and *NSYNC. Karaty is also well known as a judge and choreographer on several versions of the global dance competition program So You Think You Can Dance, including the American, Australian, Canadian versions and as a permanent member of the judge''s panel for the Dutch-Belgian version since its first season. In addition, Karaty starred in "Soof," The Netherlands'' highest grossing film in 2013. He appears as a judge or mentor on X Factor, Everybody Dance Now, My Name Is Michael, Holland''s Got Talent, So You Think You Can Dance: The Next Generation, Belgium''s Got Talent and The Ultimate Dance Battle, the last of which he created and on which he serves as executive producer. Previously, Karaty served in the capacity of a performance stager and choreographer on America''s Got Talent.

From Wikipedia, the free encyclopedia', 'USA', 1, '/4hexubHlwShGsN51Xd08X7VpcRo.jpg'),
