        (1235784, 'Katie Lucas', '1988-04-13', 'Katie Rose Lucas (born April 13, 1988) is the adopted middle child of movie mogul George Lucas. She is the god-daughter of both Steven Spielberg and Francis Ford Coppola. She is the younger sister of Amanda Lucas and the older sister of Jett Lucas.  Lucas had minor roles in all three Star Wars prequels. She portrayed young Anakin''s friend, Amee, in The Phantom Menace; the purple Twi''lek girl Lunae Minx in Attack of the Clones; and Senator Chi Eekway in the final installment of theStar Wars prequels, Revenge of the Sith.  Lucas also served as a writer on the Star Wars: The Clone Wars TV series. She wrote episodes such as "Jedi Crash".', NULL, 1, '/bsnHZ1iGkc3i8RT0r3PkuGLR4u4.jpg'),
