        (1237053, 'Vincent DiMartino', '1972-10-09', 'Vincent "Vinnie" DiMartino is an actor and American motorcycle builder, best known for his work from 2002 to 2007 at Orange County Choppers, the subject of the American TV show American Chopper. In August 2007 DiMartino left Orange County Choppers and founded V-Force Customs, a custom motorcycle shop in Rock Tavern, NY. Several months later, Cody Connelly, a friend and co-worker of DiMartino at Orange County Choppers also left to join him at V-force Customs. In 2010, DiMartino returned to the show; however instead of rejoining his former employer, OCC, he joined Paul Jr. Designs. DiMartino, known as "Vinnie," was born to John and Margaret DiMartino. He is the second child of four. DiMartino and his wife Melissa have three girls and a boy, Vanessa, twins Isabella and Ava, and Vincent.', 'Hudson Valley - New York - USA', 1, '/ei70fwyBhMI8KftQcjWfIarB1U.jpg'),
