        (1237603, 'Isaiah Mustafa', '1974-02-11', 'From Wikipedia, the free encyclopedia.

Isaiah Mustafa (born February 11, 1974 height 6'' 3½" (1,92 m)) is an American actor and former NFLpractice squadwide receiver. Mustafa is widely known as the main character for a series of Old Spice TV commercials, The Man Your Man Could Smell Like.

