        (1237618, 'Leonard Robinson', NULL, 'Leonard is wildly known as a series regular on MTV''s hit comedy show "Nick Cannon Presents: Wild ''N Out" and the critically acclaimed ESPN mini-series "The Bronx is Burning". He has also made numerous appearances in commercials, television, films along the years. On "Wild ''N Out", Leonard is one of the few cast members to appear in every episode during the show''s 4 seasons. His work in "The Bronx is Burning" gained him praise from the critics and even cast members like John Turturro, Oliver Platt and Daniel Sunjata. The NY Post has said "Leonard Robinson as Mickey Rivers,steals more scenes than bases."

Originally from Connecticut, Leonard Robinson has appeared in theaters nationwide including the Williamstown Theatre Festival, New York Fringe Festival, and Studio Theatre in Washington, DC. He performs stand-up and long-form improvisation in theaters and clubs in across the country. He has studied and performed with The Groundlings and Improv Olympic in Los Angeles, and Upright Citizens Brigade Theatre in New York &amp; Los Angeles.

