        (1240440, 'Sara Khan', NULL, 'Sara Khan is an Indian model and actress. She won the Miss Bhopal title in 2007. She has done anchoring for Doordarshan Madhya Pradesh and ETV. She made her television career in Star Plus show Sapna Babul Ka...Bidaai as Sadhna. Khan and Angad were nominated for the Star Parivar most popular couple award in 2008. She was a contestant on Bigg Boss 4 in 2010. Her next film was M3 - Midsummer Midnight Mumbai, the film was released on 16 May. Sara also worked in Pakistani serials.', 'Bhopal, Madhya Pradesh, India', 1, '/i8sevo2Tk7vXjvX8DzKcN0D48PB.jpg'),
        (1240486, 'Abby Elliott', '1987-06-16', 'An American actress and comedian best known for her four seasons as a cast member on Saturday Night Live from 2008–2012. Raised in Wilton, Connecticut, the daughter of Paula Niedert, a talent coordinator, and actor/comedian Chris Elliott. She is the granddaughter of radio comedian Bob Elliott. As a child, she enjoyed acting in school plays at Our Lady of Fatima School in Wilton, and decided that she wanted to pursue acting as a career from an early age.She attended high school at Immaculate High School in Danbury, Connecticut, where she acted in school plays and musicals. After graduating from Immaculate High School in 2005, she attended Marymount Manhattan College in New York City but dropped out during the first semester.', 'New York City, New York, USA', 1, '/v7h08EsTce2pLHkZiaFe1QRuYbU.jpg'),
        (1240487, 'Kate McKinnon', '1984-01-06', 'Kathryn McKinnon Berthold (born January 6, 1984), known professionally as Kate McKinnon, is an American actress, voice actress, and comedian. She is best known for her sketch comedy work as a cast member on Saturday Night Live and The Big Gay Sketch Show. She played Jillian Holtzmann in the reboot of Ghostbusters (2016).

McKinnon is known for her strong character work and celebrity impressions. She is known for her impressions of pop singer Justin Bieber, comedian and television host Ellen DeGeneres, politician Hillary Clinton and German Chancellor Angela Merkel. She has been nominated for four Primetime Emmys, three for Outstanding Supporting Actress in a Comedy Series and one for Outstanding Original Music and Lyrics.', 'Sea Cliff, New York, USA', 2, '/9zB5AND00Zw9LmcBIlHGumrC0cb.jpg'),
