        (1241339, 'Bo Mitchell', '1994-11-03', 'Bo was discovered by a agent in North Carolina at the age of 9 months. The agent approached Bo and his mother during a shopping trip in a mall, saw Bo''s potential, thinking he was 2 years old due to his size and walking at such a young age. His first job at age 11 months was a print ad, Bo continued from there with many more print and commercials, from Landrover to Nikon, before starting to work in TV and Film at about age 5. From there Bo has become one of the Carolina''s most famous. He still lives in Aiken, South Carolina but travels the East coast and out to the West coast often.

Bo appeared in the 2007 ABC series October Road in which he played Doodie, and Little Big Shots where he plays himself - a Simon Cowell show he worked on in LA Summer of 2006. Bo also worked on a show called Fridays on Cartoon Network. Bo''s most recent TV series is HBO''s EastBound and Down where he works with many great Actors like Danny McBride and Will Ferrell.

Bo owns his own business. Bo started his company Hollywoodsinc at age 7 and has a great Entrepreneuer talent. Starting his first business owning the copyright to all of his logos and jingles. The first business was Hollywoods Tropical Sno, over 100 flavors of the finest shaved ice in the south, with over 3 Huts running. He employed about 15 teens every summer. Bo sold this business in 2009 and started his own Skateboard company which is called HIC Skateboards,Bo now owns HIC skate board shop and HIC warehouse indoor skateboard park in his home town of Aiken SC.

Bo finished school and started college at 16 years old.

- IMDb Mini Biography By: Robin Mitchell', 'Aiken - South Carolina - USA.', 1, '/wQwVgW8hxO2JKECkb5F9cjURmLX.jpg'),
        (1241406, 'Brian Nissen', '1927-10-20', 'Continuity, commercial voice overs and Brit TV actor in 50s and 60s.

Brian Nissen (20 October 1927 in London – 8 February 2001 in Salisbury, Wiltshire) was a British actor and television continuity announcer.

Nissen made an early appearance in Laurence Olivier''s film of Shakespeare''s Henry V, and made many TV, film and stage appearances, including The Dam Busters (1955), and the television series The New Adventures of Charlie Chan and Sword of Freedom in 1957. But he is probably best-remembered as an in-vision announcer for Southern Television, where his formal style seemed to sum up the company''s aesthetic. He joined Southern at its inception in 1958 and stayed until its demise in 1981, and was kept on by the successor company TVS despite its general policy of breaking with Southern''s conservatism. He retired from TVS in August 1987. Nissen died on 8 February 2001 in Salisbury, Wiltshire at the age of 73.

(Wikipedia)', 'London, England', 1, '/yane9zXXrpaAEkB5aF0PCys2OS7.jpg'),
