        (1253585, 'Stéphane Bern', '1963-11-14', 'Né le 14 novembre 1963 à Lyon, Stéphane Bern se passionne dès son enfance pour les têtes couronnées.  C’est d’ailleurs dans le rôle de commentateur des mondanités princières que le grand public le découvre à la télévision. Un temps militant à la Nouvelle action royaliste, il parvient au cours de sa carrière à diversifier ses activités médiatiques et à changer d’image, notamment grâce à l’émission Le Fou du roi qu’il anime pendant onze ans sur France Inter.  Désormais aux commandes de A la bonne heure sur RTL, il présente également l’émission Secrets d’histoire sur France 2, et continue de commenter à l’occasion les mariages princiers.  Il est nommé officier dans l''ordre des Arts et des Lettres en janvier 2010, et chevalier de l''ordre de Grimaldi en novembre 2011.', 'Lyon, France', 1, '/njvNjX55sZ20zHLXSMnQSfwYRRg.jpg'),
