        (1254635, 'Parker Young', '1988-08-16', 'Parker Charles William Young was born in Tucson, Arizona, to Karl and Zarina Young. He is the oldest of three children, and as a youth he enjoyed playing sports, rock climbing, paintballing, and exploring the Sonoran desert. In high school, football became Parker''s main focus. As a sophomore he started on the Varsity team, and by senior year he was captain. Parker first took the stage as a junior in high school as part of a one act play; that is if you don''t count the mandatory theater class in middle school, or the time that he rapped Dr. Dre''s "Forgot About Dre" in the 5th grade talent show. The one act play that he was a part of took first place out of three student written plays at the school''s "one act play competition." The victory was small and seemingly insignificant, but it was enough to inspire Parker to "give this acting thing a shot." With the encouragement of his drama teacher, Parker decided to take acting more seriously, and thus his senior year became a whirlwind of preparing for college while juggling theater and football. Upon graduation Parker packed his bags and headed to Los Angeles for college. But when he got to LA he decided to drop out of school before he even started and dove head first into the entertainment industry; in other words headshots, acting class, and background work. Parker''s break came when he booked the role of "Ryan Shay" on ABC''s hit show Suburgatory, the hyperactive jock neighbor to Jeremy Sisto, and son of Ana Gasteyer and Chris Parnell. Following Suburgatory, Parker became a lead in the critically acclaimed Fox comedy, Enlisted, as the youngest of 3 brothers (Geoff Stultz and Chris Lowell) who are all soldiers in the US Army. In the film world, Parker starred in the Flower Films produced "Animal" and the upcoming indie "Fourth Man Out." Parker resides in Los Angeles and enjoys staying active in a variety of different ways including rock climbing, Krav Maga, yoga, and camping. When he''s not breaking a sweat you will most likely find him at the beach, on his motorcycle, or reading at Barnes &amp; Noble. That is if he''s not off backpacking somewhere with no cell service.', 'Tucson - Arizona - USA', 1, '/kLPlIBiFVbFppgVac96EkvgkYMz.jpg'),
