        (1256258, 'Toks Olagundoye', '1975-09-16', 'From Wikipedia, the free encyclopedia.

Olatokunbo Susan Olasobunmi Abeke "Toks" Olagundoye (born September 16, 1975, height 5'' 8½" (1,74 m)) is a Nigerian television and film actress, writer and producer. She is known for her role as Jackie Joyner-Kersee in the ABC TV sitcom The Neighbors. Her name is pronounced "Tokes Awlahgoondawyay".

Early life

Olatokunbo Susan Olasobunmi Abeke Olagundoye was born in Lagos, Nigeria, to a Norwegian mother and a Nigerian father. As a youth, she was educated in Nigeria, Switzerland, and England. She received a Bachelor of Fine Arts in theatre from Smith College.

Career

She made her screen debut in 2002 on an episode of the television series The Education of Max Bickford. Her film debut in Brown Sugar was the same year. She appeared opposite Ruby Dee in a 2001 off-Broadway production Saint Lucy''s Eyes and in 2005, cofounded theater company Three Chicks Theatre, which produced Andrea Lepcio''s One Nation Under in 2008.

Olagundoye has guest-starred on Ugly Betty, Law &amp; Order, CSI: NY, Switched at Birth, NCIS: Naval Criminal Investigative Service and Prime Suspect. Her film credits include A Beautiful Soul, Come Back to Me, Absolute Trust and The Salon.

In 2012, Olagundoye was cast as series regular in the ABC comedy series The Neighbors.', 'Lagos - Nigeria', 1, '/6EsIXhoiouiNI4hQLmvQ2z3uHPm.jpg'),
