        (1256508, 'Lodovica Comello', '1990-04-13', 'Lodovica Comello, nata a San Daniele del Friuli, ha 25 anni. La passione per la musica e il canto ce l''ha fin da piccolissima quando frequenta corsi di danza, canto, chitarra classica ed elettrica. A 19 anni viene scelta per essere una delle coriste e per far parte del corpo di ballo nei musical “Il mondo di Patty - Il musical più bello”.

L''anno dopo partecipa ai casting per una nuova serie, “Violetta”, prodotta da Disney Channel e Pol-ka Producciones: dopo essere stata selezionata, frequenta a Buenos Aires un corso intensivo di spagnolo per recitare nel ruolo di Francesca. La serie e il personaggio interpretato da Lodovica ottengono un grande successo e la Comello recita in 3 edizioni di “Violetta”.

Per l''Italia, canta la canzone "Ti credo", versione italiana della spagnola "Te creo". Tra l''agosto del 2013 e il marzo successivo inizia la prima tournée intitolata Violetta - Il concerto che tocca le principali città dell''America Latina, la Spagna, Francia e l''Italia. Lo stesso anno riceve una candidatura ai Kids'' Choice Awards Argentina come Attrice televisiva preferita.

Alla fine del 2013 esce il primo album "Universo" cui seguono una serie di concerti da solista e, nel 2015, il secondo album “Mariposa”: entrambi gli album ottengono un boom di vendite in Sudamerica.

Pochi mesi dopo diventa la coach dell''emozione Gioia per il Web Talent "Emozioni Cercasi" legato al film Pixar “Inside Out”, uscito nel settembre 2015. Nello stesso anno Lodovica viene scelta da Sky come nuova conduttrice della seconda edizione di “Italia''s Got Talent”.', NULL, 1, '/hPRLgx952FYwDLkazgQCnDdWlJX.jpg'),
