        (1262093, 'Woodrow Wilson', '1856-12-28', 'Thomas Woodrow Wilson naît le 28 décembre 1856 à Staunton, en Virginie. Son père est pasteur de l''église presbytérienne et le jeune Woodrow reçoit une éducation fortement imprégnée de ces croyances ; il est aussi marqué par ses souvenirs de la Guerre de Sécession et les désastres qu’elle a entraînés. À 19 ans, il entre à l''université de Princeton puis commence des études de droit. Il s''installe en tant qu''avocat mais au bout d''un an il reprend ses études et se tourne vers l''histoire et les sciences politiques. Il présente sa thèse de doctorat à 30 ans ; une analyse en faveur d''un plus grand pouvoir de l''exécutif au sein du gouvernement central qui devint un classique des études en sciences politiques. Influencé par des théoriciens britanniques comme Edmond Burke, Wilson est un libéral nostalgique de la pureté démocratique des premières années de la République. Il se destine à une carrière de professeur d''histoire mais rêve de s''engager en politique. En 1902, il devient président de l''université de Princeton et se lance dans une vaste réforme du système d''enseignement.  Le Parti démocrate le contacte en 1910 et le présente en tant que candidat au poste de gouverneur de l''État du New-Jersey. Il est élu et, en à peine un an, se lance dans une réforme des lois électorales, désignation des candidats par des élections primaires directes, afin d’empêcher les machinations politiques. Il se fait rapidement remarquer par les chefs du parti au niveau national et réussit à se faire désigner candidat du Parti démocrate en 1912. Son colistier est un gouverneur de l''Indiana dont la notoriété reste désormais liée à cette remarque : « la seule chose dont ce pays a besoin, c''est d''un bon cigare à 5 cents ».  Sa campagne électorale est basée sur l''élimination des conglomérats industriels, la création d''un impôt fédéral sur le revenu et des élections sénatoriales au suffrage universel. Il s''oppose ainsi àTheodore Roosevelt qui est partisan d''un pouvoir présidentiel fort, garant des libertés, alors qu''il défend la concurrence comme facteur d''équilibre.  L’élection présidentielle de 1912 est une vraie triangulaire entre le candidat du Parti démocrate, le président sortant et candidat du Parti républicain et enfin Theodore Roosevelt qui fonde son propre Parti progressiste quand il ne peut obtenir la nomination du Parti républicain. Woodrow Wilson est élu grâce à la division au sein du Parti républicain ; le total des votes de Taft et de Roosevelt est en effet supérieur à celui obtenu par Wilson1.', 'Staunton', 1, '/mwqso4nME0NFPb0Vhvq8BNffjk9.jpg'),
