        (1262854, 'Michael Jones', '1987-07-24', 'Michael Vincent Jones (born July 24, 1987) is an American actor, voice actor, podcast host, and internet personality who is known for his work with Rooster Teeth''s gameplay division Achievement Hunter. He also co-hosts a three-time winner of the Podcast Awards, Internet Box.

Jones has worked extensively with Rooster Teeth, having also starred in the second and third seasons of Immersion, the comedy murder mystery series Ten Little Roosters, and voices the character Sun Wukong in Rooster Teeth''s RWBY, and Max in Camp Camp. He starred in Rooster Teeth''s science fiction action comedy film Lazer Team, released in 2016.

His work outside of Rooster Teeth includes voicing Sting Eucliffe in Fairy Tail, Dogra in One Piece, Rapture in Ninja Slayer From Animation, and Gen in World Break: Aria of Curse for a Holy Swordsman.', 'Woodbridge Township, New Jersey', 2, '/bbNWXQbnIicwBUV5Gtse0kMmlWX.jpg'),
