        (1264154, 'Majid Berhila', '1979-04-18', 'Il a écumé les cafés théâtres Parisiens, de la Providence au Splendid, aussi bien en one-man-show qu’en duo.  Lauréat de plusieurs festivals d’humour, il fait notamment la première partie de Michel Boujenah.  Côté télé, on le retrouve souvent sur Comédie ! où il joue l''un des rôles principaux “Yazid” dans “United Colors of  Jean-Luc” avec Vincent Desagnat, une série écrite par Fabrice Eboué ; et aussi sur Canal + avec Groland.  Egalement auteur, il a écrit plusieurs textes de détournements d’images pour “Ça vaut le détour”  un programme court diffusé à 19h45 sur France 2 et sur France 4 dans “Pliés en 4” une émission  de Cyril Hanouna', NULL, 1, '/bA85wmAP9h670hTSSiGu8z03S9A.jpg'),
