        (1264365, 'João Camargo', '1960-03-25', 'Estreou no teatro com a peça “Amadeus”, de Flávio Rangel, em 1983. Flávio Rangel o convidou para ser seu assistente de direção um ano depois da estreia. Seu primeiro papel na TV foi na novela “Vale Tudo”, da TV Globo, em 1988. Atuou em outros 17 programas e novelas na TV Globo e na TV Manchete ente 1989 e 2013. Dirigiu 11 novelas nas TVS Globo, Bandeirantes e Record entre 1994 e 2012. Foi demitido da TV Record em 2013 e causou polêmica no meio artístico ao fazer duras críticas àquela emissora.', 'Belo Horizonte, Minas Gerais, Brazil', 1, '/tCFp4ehrrvRr8fxZyplGbmL1Uhe.jpg'),
