        (1264429, 'Michael Laauli Hayner', '1964-08-01', 'Michael Laauli "Mike" Hayner is an American professional wrestler best known as Prince Iaukea in World Championship Wrestling. He earned a black belt in Judo right after high school and is well trained in amateur and submission wrestling. He has trained with former USMC champions Greg Gibson and Craig Pittman, submission wrestlers Gordon Nelson, Ron Hill, and Karl Gotch.', NULL, 1, NULL),
        (1264488, 'Mascarita Dorada', '1982-02-19', 'Mascarita Dorada (Spanish for Little Golden Mask) is the ring name of a Mexican Luchador enmascarado, or masked professional wrestler, who worked in the Mini-Estrella division, comparable to the U.S. Midget professional wrestling division, currently signed with WWE under the name of El Torito (Spanish for The Little Bull). From 2000 until 2007 he worked under the name Mascarita Sagrada in Asistencia Asesoría y Administración (AAA), taking over after the original Mascarita Sagrada left AAA. In 2007 he moved from AAA to join Consejo Mundial de Lucha Libre (CMLL) he changed name to Mascarita Dorada. After leaving CMLL in 2011, he began wrestling for El Hijo del Santo under the ring name Mascarita Plateada, while also returning to AAA under the Mascarita Dorada ring name. He is a former two time Mexican National Mini-Estrella Champion and co-holder of the AAA Mascot Tag Team Championship along with Máscara Sagrada. Mascarita Doradas''s real name is not a matter of public record, as is often the case with masked wrestlers in Mexico where their private lives are kept a secret from the wrestling fans.', 'Guadalajara, Jalisco, Mexico.', 1, '/kfS8WJJ2md0UKKAzUyVBGjevPxX.jpg'),
