        (1264682, 'Hikari', NULL, 'Originally from Osaka Japan, HIKARI, also known as Mitsuyo Miyazaki is an award-winning writer, director and producer. Her debut short film Tsuyako (Drama, 2011) visited over 100 film festivals worldwide receiving 50 awards including DGA Student Award for the Best Female Filmmaker and the film was qualified for the Oscar in 2012 and 2013. In 2013, she was one of the 5 directors to create a short film for the first annual Lexus Short Films, produced by The Weinstein Company. Her live action/animated short film A Better Tomorrow (Fantasy Adventure, 2013) premiered at Festival de Cannes, special screening hosted by TWC and Lexus International. Her latest dance short film Where We Begin (Drama, 2015) premiered at Tribeca Film Festival and received 8 awards at festivals nationwide. Most recently she had participated at Sundance Institute/NHK Screenwriting Workshop in Tokyo as well as Film Independent’s Screenwriting Lab with her feature script Cantering. HIKARI holds an MFA in Film and TV production from USC School of Cinematic Arts and currently represented by Paradigm Talent Agency. She believes in the power of visual communication, and that it changes society and the minds of the people.', 'Osaka, Japan.', 1, NULL),
        (1264686, 'Alex Kruz', '1978-11-30', 'Alex Kruz is an American actor known for roles in television, theater and film. He was born in New Jersey, his father is a Native American Indian of the Kañari (Quichua) Nation, and Alex is a recognized warrior of the Mescalero Apache Shadow Wolf Clan. Alex is multi-ethnic and multi-lingual, playing multiple ethnicities seamlessly across media in several languages having worked in film/tv in France, Italy, Brazil, Sweden, Israel, Germany, and Japan.  He is best known for his role in the film “Red Cloud: Deliverance” as Jake Red Cloud and “Tom in America”. He has received Best Actor awards from the Mexico International Film Festival, Bare Bones International Film Festival, DC Independent Film Festival, Amiens International Film Festival, and nominated for best performance by the Maverick Movie Awards.  Outside of his acting credits, Alex has worked on behalf of several charities and causes which benefit children and aid those affected by human trafficking. In addition to the charities he helps run, he has produced documentary features and shorts which help make the world aware of issues touching children without voices against war, female circumcision, and other issues from which the West is usually removed from such as “Godka Cirka” (Sundance Premiere), “Madina’s Dream” (SXSW Premiere), and “Fight Church” acquired by LionsGate Films and available on Netflix.', 'Jersey City, New Jersey, USA', 1, '/bizITDhkxnbLIibuW0kryCWucji.jpg'),
