        (1266604, 'Romi Rain', '1988-01-12', 'Fine and feisty Romi Rain is the badass geek-girl of your dreams. From Tarantino to Comic-cons you can find this smoking hottie involved in all the nerdiest and coolest of pop culture swag. One of her favourite shoots so far has her decked out like the love-child of Mad Max and Tank Girl, in a barely there pair of shorts and enough fire power to take down a swat team. Check out her sexy growing collection of tattoos, from the naughty little paw prints you want to follow up her leg, to the eastern inspired fine art across her back.', 'Boston, Massachusetts, USA', 3, '/wpaAqvXBkwxmkF6NjnXOdGWioJG.jpg'),
