        (1269612, 'Gregory Ryan Alosio', '1966-07-15', 'Gregory Alosio is an award winning American director & producer.  He is known for his documentary short film Death & Life which won several awards.  Accolade Global Film Competition awards in May 2016:  Award of Recognition.  Long Beach Indie Film Festival: Best Documentary Short Film.  Canada Shorts Canadian and International Short Film Festival: Award of Commendation.  Hollywood International Independent Documentary Award: Award of Recognition.  Impact Docs Award: Award of Merit.  Reel Madness Film Festival: People’s Choice Award.

