        (1275990, 'Fellipe Barbosa', NULL, 'Fellipe Gamarano Barbosa (Rio de Janeiro, 1980) is a Brazilian filmmaker. He completed his MA in filmmaking at Columbia University, New York. His short films, including the award-winning Salt Kiss (2007), already shown at the Sundance Film Festival, Clermont-Ferrand and the New York Film Festival. In 2007, Fellipe was named one of the 25 New Faces of Film Independent Filmmaker Magazine. Her documentary Laura, winner of the Cinereach Award, won Best Documentary at the Hamptons Film Festival 2011 and played Hot Docs, Visions du Réel and Bafici, among others. He participated in the screenwriter''s Sundance Lab and director with his film House Big, his debut in fiction that debuted at the Hivos Tiger Awards Competition at the 2014 International Film Festival Rotterdam and screened at many other international festivals. The film has won 12 awards including the world and the audience in Toulouse, the Audience Award at the Rio Festival and the Critics FIPRESCI French Critics Award at the São Paulo Film Festival.', 'Rio de Janeiro, Rio de Janeiro, Brazil', 1, '/iIqyH16R0J1yPCKGtKomefvst1o.jpg'),
