        (1277435, 'Matt Lang', '1986-10-24', 'Matt Lang is an American director, writer, and singer. He is a co-founder and member of Team StarKid. He is the younger brother of fellow StarKid, Nick Lang. He attended the University of Michigan and has written and directed all of StarKid''s productions to date. He had a small cameo in Little White Lie and sang the original recording of the song "Liam''s Got a Phone Call"', NULL, 1, NULL),
