        (1277458, 'Jaime Lyn Beatty', NULL, 'Jaime Lyn Beatty was born and raised in New York City. At 12 years old  she became the first child member to be accepted at the famed Thirteenth  Street Repertory Company. She is a proud graduate of the Drama  Department at the world renowned LaGuardia High School for Performing  Arts (a.k.a the ''FAME'' school) and has studied improv at Second City  Chicago and with LA''s The Groundlings founder Gary Austin. In 2006 she  was honored at the 51st Annual Drama Desk Awards with a scholarship  award for Excellence in Acting and Production presented by actor Richard  Griffths. Jaime Lyn has her BFA in Acting from The University of  Michigan.', 'New York, New York City, USA', 1, '/vxjd0gXrehJEIeMtHZlQzfsyS0D.jpg'),
