        (1279973, 'Rita Volk', '1990-09-03', 'Born in Tashkent, Uzbekistan, Rita Volk moved to San Francisco with her family when she was 6 years old. Approached by a modeling scout, Volk was given the opportunity to audition for commercials and instantly fell in love with acting.

