        (1285499, 'Angela Kerecz', NULL, 'Angela Kerecz is an American born actress and writer. Originally from the small town of Waynesboro, MS, Angela was always very involved in the arts through years of dance, piano, and clarinet training. In high school, she enjoyed participating in the drama club and was director of the school''s play during her senior year. Angela went on to attend the University of Southern Mississippi where she received a Bachelor''s Degree in Polymer Science and a minor in Chemistry. She then moved to Jackson, TN and worked as a paint chemist, pharmaceutical sales representative, and later became a licensed realtor. In 2009, she met Bobby Kerecz, who was the lead singer for Chippendales at the time. A relationship soon turned into a marriage to Bobby on 10-10-10 on the beach in Hawaii. Bobby, a true entertainer at heart, reawakened the performer side of Angela, and they began pursuing an acting career together. Angela''s first gig was as a featured extra on the TV show, "Nashville", which films in Tennessee. Being on a big set was a stimulus for Angela to know this was what she wanted to pursue. She used her analytical skills to study the business and develop her acting. Angela began to get noticed, and was offered a featured spot in a scene with Arnold Schwarzenegger for the film, "Sabotage", and was featured in the opening scene of "Scary Movie 5". She was also given a recurring feature as a waitress for 23 episodes of "Nashville." On the set of "Last Vegas", she was given some personal advice by Morgan Freeman, one of her favorite actors and a fellow Mississippian, who told her, "Every job is your last one until you get the next one." Inspired to keep following her dreams and work hard, she soon began acting in several independent films, where she landed strong supporting and lead roles in films such as "Shark Exorcist", "Hope", "The Cellular Effect" and many more which would help her move to the next level in her acting. Recently, Angela was in LA working where she had a supporting role in the film "One More Round", which stars Kevin Sorbo, among others. Angela is a diverse actress who has been cast in roles ranging from lawyer, counselor, seductress, mom, to the lead as a female superhero in a web series. Angela also does occasional modeling and commercial work. Together with her husband, Bobby, they wrote and produced "Souls Collide" - a short which they filmed in 2013. "Souls Collide" also gave Angela the opportunity to put her director''s hat back on, which she truly enjoyed. This project then became the launch pad to the screenplay they have just written, "S.O.U.L.", a bio-pic of how they met and struggles they have faced - a story of Searching, Obsessions, Understanding, and Love - a story of redemption. "S.O.U.L." is in pre-production, and Angela and Bobby will star as themselves in this very personal project.  - IMDb Mini Biography By: 7 Souls Productions', NULL, 1, NULL),
        (1285527, 'Taylor Hill', NULL, '', NULL, 1, '/bmWzU77jgaH5D8piW0TwqHYolPb.jpg'),
        (1285537, 'Gracyn Shinyei', NULL, 'Gracyn was home-schooled by her parents and followed her older brother Valin Shinyeidown the acting and performing path. She started in toy commercials at age 3 and then progressed into film and TV work. In 2012, Gracyn was cast in the feature film Final Girl to play the younger version of the Abigail Breslin character only to learn that they shared the exact same birth-date off screen.  - IMDb Mini Biography By: J. Shinyei', 'Maple Ridge, British Columbia, Canada', 1, '/bAAQyMp6CP4TUBrSbt33DquSupp.jpg'),
