        (1287573, 'David Saucedo', NULL, 'David Saucedo was born in EL Paso, Texas from immigrant parents and came to acting late in life. The first time he stepped on a stage was for a performance in his sixth grade talent show where he was part of group that lip-synced to Elvis'' G.I. Blues. One of his early roles was with Mexican television royalty, Angelica Vale in the lead role of, "No Me Hallo." The show was originally intended as a web series but after its success online, Univision decided to also air the series on its network. David appeared in two episodes playing the role of Peppino. Later, after a long audition process he was cast in the role of Cesar Arista (in the Christopher Landon directed) Paranormal Activity; The Marked Ones. This was the second time he had worked with director, writer and producer Oren Peli. Previously, David shot the (as of yet unreleased) Oren Peli directed project "Area 51." Since then, he has played opposite Salma Hayek in "How to Make Love to an Englishman and was the gritty drug enforcer, Rosco in "6 Ways to Sundown" staring Bai Ling, Tom Sizemore and Dominique Swain. More recently, David spent a month in Seattle, WA, filming alongside Bill Oberst Jr. and Jason Vail in "Valley of the Sasquatch" as Sergio Guerrero. One of his favorite genres to act in is horror. He has also worked on "Circle" and "Savageland." With over three million hits on YouTube, in the music video by The Cataracs, "All You," David plays a coyote that smuggles the band into Mexico. Also a music video, On Theory of a Deadman''s , "Hurricane" staring Andy Dick, David play a police officer. The song has garnered over a million hits. He is a former funeral counselor and believes that those years spent in the funeral industry help him understand the characters he plays. He has owned a coffee house/art gallery, been a former owner of a small indie record label, was a punk rock musician, is a photographer and an ordained minister. As one of the many odd jobs he has held, he helped clear out the famous old Swabs Pharmacy in Hollywood.', 'El Paso, Texas, USA', 1, '/p27HRJvG6pPEsKQNVc4ksiUJ7Kr.jpg'),
