        (1289968, 'Cara Delevingne', '1992-08-12', 'Cara Jocelyn Delevingne (/ˈkɑːrə ˌdɛləˈviːn/ kah-rə del-ə-veen; born 12 August 1992) is an English fashion model and actress. She signed with Storm Model Management after leaving school in 2009. Delevingne won the "Model of the Year" award at the British Fashion Awards in 2012 and 2014 and has appeared in shows for houses including Burberry, Mulberry, Dolce & Gabbana, and Jason Wu. She started her acting career with a minor role in the 2012 film adaptation of Anna Karenina. Her first major roles were as Margo Roth Spiegelman in the romantic mystery film Paper Towns (2015), Kath Talent in London Fields, and the Enchantress in the comic book film Suicide Squad (2016).', 'London, England', 5, '/bVxbR0MgF6yXJmIw1w9QjvicfcO.jpg'),
