        (1290640, 'Ivan Koumaev', '1987-10-16', 'Ivan Koumaev is an American dancer. Koumaev was born in Khabarovsk, Russia and moved to Mill Creek, Washington when he was seven years old. He started dancing at age 11, after watching the film Breakin''. In his younger years, Ivan was a part of "Cruz Control" in Seattle, Washington. He then moved to the Los Angeles area and graduated from Aliso Niguel High School, where he was a member of the selective dance-related club, "Dance Appreciation." In his last year of high school, Ivan taught at local dance studio- South Coast Freestyle. In Los Angeles, Ivan is active in "Breed Team Boogiezone." He has also appeared with Miley Cyrus in two Disney Channel music videos. Ivan also appeared on the second season of "So You Think You Can Dance." He made it to the top six, being eliminated in week eight. He has returned in season 8 as an "All-Star." He is currently on tour with Justin Timberlake.', 'Khabarovsk - USSR', 1, NULL),
