        (1291703, 'Josefina Scaglione', '1987-09-05', 'Josefina was raised in Rosario, Santa Fe, and became interested in performing as a child. While in high school, she received a scholarship to attend a summer arts program at Point Park University in Pittsburgh, Pennsylvania. Upon graduating from high school, Scaglione moved to Buenos Aires and began working as a musical theatre actress. In Buenos Aires, she performed in Cinderella, and as Amber Von Tussle in Hairspray.

In 2008, director Arthur Laurents, unable to find an actress in the United States appropriate for the part of Maria in a Broadway revival of West Side Story, discovered Scaglione after friends in Buenos Aires directed him to a YouTube clip of her performing Ástor Piazzolla''s composition Libertango.Laurents flew Scaglione to New York City to audition, where she immediately received the role, despite the fact that she was unknown in the United States.[1] After performing as Maria at the National Theatre in Washington, DC, Scaglione made her Broadway debut in West Side Story at the Palace Theatre on March 19, 2009. As Maria, Scaglione won the Outer Critics Circle Award for Outstanding Actress in a Musical and a Theatre World Award, and was nominated for the Tony Award for Best Leading Actress in a Musical, becoming the first actress portraying Maria to receive a Lead Actress nomination (Carol Lawrence and Josie de Guzman each received nominations in the Featured Actress category for their portrayals of Maria in the original 1957 production and 1980 revival). She was recently on the USA network''s "Fairly Legal" as singer Claudia Alves in the episode named "Force Majeure".', 'Trelew, Chubut, Argentina', 1, '/phR1ymALKg5stXR2E9vv24wPxCl.jpg'),
        (1291780, 'Janell Islas', NULL, 'Janell Islas is a native of Texas born in Port Lavaca, TX. She was  raised by her grandparents. Her grandfather the personal assistant to a  bank owner, and her grandmother a homemaker. She went to school there  till she started High school. At that point she went to private school  for a while, then transferred to Channelview Tx where her mother and  father lived and had their own business in Houston, and attended  Channelview High School. Janell ended up back in Port Lavaca at Calhoun  High School where she finished high school there. Through out  elementary, middle/ Jr. high, and high school she was in many clubs like  student government, theater arts club, Christian club, marine biology  club, historical club, and so on. She also played many activities such  as band (french horn), choir, art, theater arts &amp; drama, volleyball,  basketball, tennis, track&amp; field, softball, and Channelview drill  team. Once finished with school she started college at the age of 17.  She received a theater arts scholarship to attend San Jacinto College in  Houston. She then graduated with an Associates of arts in Biology. She  then went onto the University of Houston to complete her education. She  finished with a Bachelors of Science in Biology from the University.  When she met her husband he was in the US navy so she has moved around  and lived in many cities like Seattle, Sacramento, and so on. once she  got to California she thought to herself since she was there why not  give acting a try. She had theatrical experiences and classes of 6 years  and going. She started out with student Feature Films to get the feel  for it, and now has started to get into bigger productions such as Fast  and Furious series and HBO series, along with independent movies like  Scout. Janell Islas is a hard worker and dedicated actress that is  building her credentials quickly and becoming a person that will soon be  well known. She is an individual that has her own style and personality  that will make other people distinguish her from the rest.', NULL, 1, '/bUXQHwf4jfjFaJN8CENdjGqXIWx.jpg'),
