        (1293392, 'Miles Luna', '1990-04-24', 'Miles Antony Luna is a Rooster Teeth staff member, director and filmmaker known for writing and directing Red vs. Blue and RWBY. He is the winner of two International Academy of Web Television Awards for Best Animated Series for Red vs. Blue Season 10 and RWBY Volume 1. Miles is one of the writers and assistant directors of RWBY, as well as the voice actor for Jaune Arc. He also voices Felix in the popular web series, Red vs. Blue. He is the Head Writer of Animation at Rooster Teeth working on writing, editing, voice acting and graphic designing. He and Kerry Shawcross also own and stream on the Twitch channel Streamyweenies.', 'Plano, Texas, USA', 1, '/c2fk2aHyFxhugJxhWTj8m2FFQYC.jpg'),
        (1293394, 'Arryn Zech', '1990-10-04', 'Arryn Zech is an American actress best known for her role as Blake Belladonna from RWBY. She also voices the character Dr. Emily Grey in the longest running web-based series, Red vs. Blue, created by the Austin-based production company, Rooster Teeth.

Arryn was born in Rota, Spain, but was raised in the city of New Braunfels, Texas. She attended the North East School of Arts high-school in San Antonio, Texas, where she majored in Musical Theatre.

She graduated from The University of Texas at Austin with a Bachelors of Journalism in Copy Editing and Design, but found her passions still lie with acting and singing. She worked at the university''s student run television station, TSTV, where she worked as an actress, writer, and host for multiple shows including Videogame Hour Live and Still Life.

With over 10 years of training in theatre, various acting methods, and classical voice, Arryn is now based in LA pursing her career in film and television.', 'Rota, Spain', 1, '/6k68J5wBTDcgaApPZ180rpHm0I1.jpg'),
