        (1293586, 'Gia Skova', NULL, 'Gia Skova is an actress and model, now living in the United States. She has been a cover girl for fashion magazines around the world such as "Vogue" and "InStyle", adorned the runway for designers such as Stella McCartney and Marc Jacobs, been featured in print and commercial advertisements for internationally recognized brands such as L''Oreal and Red Bull, and been cast in television series, films and theatrical productions.

Born in the small village of Saratov, just outside Kazakhstan, Russia, Gia was discovered as an actress at age 12 and for the next three years, starred in Russian television series. At 15, Gia won the modeling contest "The Beauty of the Volga", which launched her professional modeling career. She was a teen supermodel in Moscow by age 16, winning many awards such as Ms. Saratov, Ms. FHM, Ms. Fashion Style and Ms. Great Volga. The Italian modeling agency Modus signed her and Gia worked in several large projects in Italy, France, Spain, and a number of Asian countries. Still in her teens, Gia also starred in several plays in Moscow, winning acting awards such as Best Theatrical Actress of Saratov, and 2009''s Best Actress of Moscow Theater.

In 2012 Gia moved to the United States to continue her career as both a model and an actress. Quickly recognized as an up-and-coming star, Gia landed seven film roles her first year and was noted in a celebrity magazine as the most recognized Russian actress in Hollywood.

(2014) Gia Skova has starred in a Sci-Fi TV pilot due for a 2014 release, and has several movie roles pending including two starring roles', 'Saratov, Russia', 1, '/aKO9CADPvSZ7h1BpR4LCNuSNi5D.jpg'),
        (1293588, 'Laura Jacobs', '1987-07-01', 'Laura Jacobs is an actress and classical opera singer originally from Canada. Born in the heart of the prairies, in her teen years she moved to Vancouver, British Columbia where her passion for acting started. She began her training young and was in a prestigious high school theatre company performing as the lead in 2 productions per year.

She attended McGill University with a degree in classical theatre studies and psychology. She was an internationally represented fashion model and worked all over the world, primarily she had much success in Asia. She has had a great start in the business and has a notable performances in "Daydream Nation". Laura has a comedic side, and also loves working with the "Funny or Die" team.

She continues to train with top teachers and is constantly fine tuning her craft. Audiences will see a different side of Laura when her lead roles in notable comedies appear on the big screen in the near future.', NULL, 1, '/5p2ZAZHTEd9CmN89DKczSSBsbi2.jpg'),
