        (1296522, 'Claire Scanlon', NULL, 'Claire Scanlon directs single cam comedies for both network and cable. She started her career editing documentaries for PBS and the Discovery Channel. After supervising post and producing Last Comic Standing, she joined The Office in its fifth season. After directing The Office, Claire transitioned over to directing full time in 2013.', 'Chicago, Illinois, USA', 1, '/6B5tD7ivj7JoYUM5DCtxM4ZRoe9.jpg'),
