        (1296637, 'Micah Van Hove', '1988-09-09', 'Micah Van Hove is a director, producer and DP who has been exploring the possibilities in micro-budget cinema since 2009. His first feature film MENTHOL (from the producer of BOYZ N THE HOOD) premiered at the 2014 Santa Barbara International Film Festival. Micah''s second directorial effort SHADOW OF A GUN won the Narrative Feature Audience Award at the 2018 Knoxville Film Festival. Recently, Micah''s short film DEL ARCO VACÍO was selected as the #1 finalist for Black Factory Cinema''s program with Werner Herzog in Peru and went on to screen with the Werner Herzog foundation in Munich.

Micah''s music video work for artists like Neil Hamburger, Weyes Blood, Alex G and Ariel Pink has premiered on Pitchfork, Rolling Stone, Vice, NPR and more. As a regular writer for No Film School since 2013, Micah has reached millions of readers in his effort to stimulate discourse around films that reflect a commitment to personal and courageous work.', 'Leggett, California, USA', 1, '/8ETkSInAsO7PSpZFcxtuR7P3ZSb.jpg'),
