        (1299380, 'Nima Nourizadeh', '1977-11-12', 'Nima Nourizadeh is an Iranian-British commercial and film director and editor. His debut film is Project X, released in March 2012. Prior to making Project X, he directed music videos for Dizzee Rascal, Pink Grease, Franz Ferdinand, Bat for Lashes, Santigold, Hot Chip, Yelle and Lily Allen. He also directed advertisements for Adidas. Nourizadeh is the son of political activist Alireza Nourizadeh and his siblings are electronic music producers Omid 16B and Navid. His next film is an action comedy titled American Ultra starring Jesse Eisenberg, Kristen Stewart, Connie Britton, John Leguizamo, and Topher Grace.', NULL, 1, '/cNoareWo8ogSSYfWSLmOQmtLbz8.jpg'),
