        (1300637, 'Aqueela Zoll', NULL, 'With training in theatre arts, improvisation, &amp; creative writing, Aqueela holds a degree in Human Development from the University of Long Beach, California.

Having studied with Inner Circle Theatre, The Improv Space, Sarah Underwood, Craig Anton, and many others she has found success in her entertainment career as an actress, model, &amp; host. Her driven inspiration for film &amp; vibrant work ethic has landed Aqueela working with Liev Schreiber (X-Men Origins: Wolverine 2009), Jamie Marshall (Warrior 2011, Twilight 2008), James Byrkit (Coherence 2013, Rango 2011, Pirates of the Caribbean 2003), and Emily Baldoni (Ghosts of Girlfriends Past) among many others.

Film &amp; television are where Aqueela''s hunger peaks, yet as a young woman fascinated with all creative sides to the business she has also found success modeling with brands such as Adidas, ASCIS, Harley Davidson, Rockstar, &amp; JVC. Her natural presence on camera has complimented hosting for major companies such as ACER, Honda, &amp; Rumchata. Believing training never ceases, she is constantly redefining her strengths &amp; craft. She is well rounded in beginning level French, acoustic guitar, quantum physics &amp; the Krav Maga martial arts. She''s well versed in psychology, anatomy, &amp; physiology. As an actress, she views an intelligent mind as the creative mind''s best companion, &amp; vice versa. Aqueela''s journey as an actress has been an inspiring adventure so far. Having recently returned from filming in the UK, you''ll see Aqueela as a lead role in Fox Home Entertainment''s Wrong Turn 6.  - IMDb Mini Biography', NULL, 1, '/g13I5mLCbO7taWSbVMmYFAZE2eG.jpg'),
        (1300638, 'Anthony Ilott', NULL, 'Anthony is a professional actor from the south west of England. He started singing when he formed a band playing funk music at the age of 15. After success with the band he moved onto training in Musical Theatre at the prestigious Guildford School of Acting, furthering his talents in the performing arts. He has played roles in the theatre such as "Adam" (Children of Eden - Stephen Schwartz) at the Ivy Arts Centre and "Fred/Ghost of Present" (A Christmas Carol - Alan Menken) at the Tabard Theatre in Chiswick. Anthony has recently returned from Bulgaria shooting the horror film "Wrong Turn 6" (20th Century Fox), which is highly anticipated by its cult following. In the future Anthony hopes to continue his success in acting in feature films and furthering himself as an actor and model.  - IMDb Mini Biography', NULL, 1, '/nLRmBTRzMiHO0LwNsduleOIawMZ.jpg'),
