        (1300641, 'Joe Gaminara', NULL, 'Joe Gaminara is an English actor, who started his career in films in 2014. He began with a short paper CNN Reporter Tom Ruggles in feature film Crystal Skulls. Then he won the role of Bryan in Wrong Turn 6: Last Resort by 20th Century Fox Home Entertainment directed by Valeri Milev and the sixth installment in the Wrong Turn film series. The film was released on DVD on October 21, 2014. Later that year, Joe, won the starring role in the short film Pearl, Eloe received the role of Dr. Oliver Knightley.  - IMDb Mini Biography', NULL, 1, '/1mzJUYdZfrfNfMdHrQq0lwm0j6z.jpg'),
