        (1301270, 'Randy Arrington', NULL, 'Randy Arrington is a retired Naval Aviator who flew Attack Jets off of four different aircraft carriers during his distinguished Navy career. He is also a retired Department of Homeland Security Interceptor Pilot who flew numerous missions fighting against international drug cartels attempting to smuggle narcotics into the United States. Randy has a PhD in Political Science and is on the faculty at UCLA as an Adjunct Professor. He has taught both graduate and undergraduate courses at UCLA UCSD, USD, LSU, Tulane and UNO. His Naval Aviation, action novel Kerosene Cowboys was recently turned into a major motion picture of the same name. Randy is President of Teen Angel Productions in Hollywood and has served as Executive Producer of the film Kerosene Cowboys. He is serving as Lead Producer of the major motion picture Blood on the Border. He is in the production phase on the "Kerosene Cowboy" country music video. Randy is a SAG actor, WGA screenwriter, and a PGA Producer. Randy has five beautiful children.', NULL, 1, '/h8z5g4bjlcZqSr5M0kTORmZhGOe.jpg'),
