        (1303037, 'Taron Egerton', '1989-11-10', 'Taron Egerton is a Welsh film and television actor best known for his role as "Eggsy" Unwin in Kingman: The Secret Service and its sequel Kingsman: The Golden Circle. He studied acting at  the Royal Academy of Dramatic Art (RADA) in London.

Although born in England, Egerton''s family moved to Wales when he was a small child, firstly to Llanfairpwllgwyngyll, Anglesey and later to Aberystwyth, Cerdigion.', 'Birkenhead, Merseyside, England, UK', 5, '/uCaPhyKAQIfEzAWWCYIrO2004CB.jpg'),
        (1303061, 'Prometheus Aleifer', '1982-01-01', 'Prometheus Aleifer was born in 1982 in Athens, Greece. His birth name is Spyros Promitheas Aliferopoulos. He studied theater at the University of Athens and the Art Theater Drama School. Right after school he joined the National Theater in Athens and worked on numerous productions of classical and contemporary plays under the direction of famous European directors . He did his first feature film "Burning heads" (original title "Milk") in 2011. With his performance as a schizophrenic young Russian immigrant gained critical acclaim, was nominated for the male lead by the Greek Film Academy and won the same prize in Alexandria Mediterranean Film Festival 2012. During the same year he starred in the successful performance of Aristophanes'' "The Clouds" in Epidaurus festival 2012. Since September 2012 is based in London, UK.  - IMDb Mini Biography By: P.McA', 'Athens - Greece', 1, '/xmLUXgopPCXapDcDvDwwfOX4jja.jpg'),
        (1303062, 'Nikos Mavrakis', '1989-03-24', 'Nikos Mavrakis was born in Syros, Greece on March 24th, 1989 to George Mavrakis and Evangelia Preka-Mavraki. Nikos has two older sisters, Anna and Julia. Since Nikos was a child, it was obvious that he is multi-talented. His first contact with acting was at the age of 9, as an active member of the acting group of his primary school. One of the most hilarious moments of his life happened when he was a student at the 5th class of the primary school. While he was performing in a theater play, he forgot his script and he created his own new dialogues! This situation socked and confused the other students- actors, though he made the audience laughing out loudly watching him acting so naturally out of the script. By this fact, everyone understood that he has a really bright future on acting. Few years later, he participated in a Pan-Hellenic music competition as the primary singer of the chorus of Syros and he awarded with the first prize. He graduated as the best student of his year from the University of Larissa, Greece from the Department of Medical Laboratories. The duration of these studies is 4 years, but due to the fact that he was an excellent student, he graduated in 3 years with the highest mark. We should also notice that he was the youngest student who has been graduated the Department of Medical Laboratories. Moreover, he took a scholarship to study in the Department of Medicine. Even if this is the dream for many students, Nikos had different personal ambitions. So, he studied in a Drama School named "The Theater Of Changes", hiding from his family that he dropped out the Medicine School. Only few months after his first steps as a student in the drama school, he took part in his first TV serial, named "The generation of 592 EUR". Shortly after completing this participation in the serial, he continued to take part in various TV series and films. His last work in Greece was in the daily serial "Stolen Dreams" on Mega Channel, as Lefterakis. During this running project, he received an offer from the Turkish production company ADAM film to take part in the TV serial "Two sides and One Ismail" on ATV Channel in Turkey. This was a really big opportunity for him to achieve his ambitions, but on the other hand was such a big challenge. He had the opportunity to discover the Turkish culture and the different ways of working at this well-promising film industry. Without doubt, it was a challenging move, with many risks, to act in a language that he couldn''t speak or read. Although, he took the decision to accept this offer and he relocated to Ayvalik in Turkey, as here was the basic place of the shootings. By the end of that serial he took part in a short film named "Lack". Noticing that he was the only actor in this movie, he awarded with two prizes in two famous film festivals in Turkey. Then, he took part in an American film named "Two faces of January" with Viggo Mortensen , Kirsten Dunst and Oscar Isaac. With multiple projects currently filming or in the production phases, Nikos continues to move forward in his career and look ahead for new opportunities.  - IMDb Mini Biography By: Nikos Mavrakis', 'Ermoupoli, Syros, Greece', 1, '/av7Rzm5ZLOzSpRLHxK3Td9AtKrC.jpg'),
