        (1316507, 'Klara Landrat', NULL, 'Klara Landrat is a Polish-American actress known for such movies as: Zoolander (2001), Going Under(2004), The Soul Collector (2011), Fateful Findings (2014) and Chronologia Human (2017). She was raised in Tripoli, Libya and New York City. As a true cosmopolitan Klara divided her life between New York, LA, Paris, Belgrade, Tunis, Tel Aviv and Hong Kong. Her status for more than ten years remains the same: happily married. Klara came from a dance and theater background, being involved with productions of David Levine, Julia Miles'' and training with legendary dance choreographer Willie Ninja (William Leake) in New York City upon graduating Cum Laude from CUNY Hunter College. She debuted with her big dubbing role as the main voice of the British miniseries " Sand Fairy" in 1988. Her acting credits include: "Zoolander", Dir. Ben Stiller, "Going Under" by E. Werthman, "The Soul Collector", Dir. Ben Talar, "Fateful Findings" Dir. Neil Breen and a most recently Brigitte Bardot''s supported film project; "Chronologia Human" Dir. Erik Blanc. Simultaneously, she has pursued her other passion and artistic endeavor; photography. Her photographic work has been exhibited nationally and internationally, including the "Tallit Project" by Gallery Nine Five, NY. She shot multiple covers and editorial spreads for such magazines as Irk Magazine (Paris/New York), Kodd Magazine (Paris) , Lady Gunn Magazine (LA/NYC/Stockholm), Le Fil D''or Magazine (Paris/Amsterdam) , Modo Magazine(London), Imirage Magazine (Canada), Intellegance Magazine) USA/Canada) and more. Since 2012 Klara is also a brand ambassador and co-designer for the fashion accessories brand The Rubbzz Original with commerce in USA, Israel, Germany, South Africa, Hong Kong, China and most EU countries. Klara is a big supporter and propagator of women''s rights and as such is engaged in actions protecting women''s rights in the world. Caring for wildlife, Klara is also a part of Whale and Dolphin Conservation Society.', 'Poland', 1, '/90gXBxroNTDBHIqcJiD2bqoMXMU.jpg'),
