        (1318797, 'Alana Cavanaugh', '2007-01-30', 'Alana has always craved the spotlight. She began her acting career at age 5. In a short time, she has worked on Dolphin Tale 2 and on Halt and Catch Fire for AMC. Alana''s passion is fueled by her curiosity about "how it''s made" and playing someone different for each project.

