        (1318842, 'Jinkee Pacquiao', '1979-12-01', 'Maria Geraldine "Jinkee" Jamora Pacquiao (née Maria Geraldine Capeña Jamora, born January 12, 1979) is the wife of professional Filipino boxer and congressman Manny Pacquiao and a politician currently serving as the vice governor of Sarangani, a province of the southern island of Mindanao in the Philippines.

Jinkee Jamora was born at St. Elizabeth Hospital in General Santos on January 12, 1979 into the conservative family of Nestor Jamora and Rosalina (née Capeña). Her twin sister is Janet. She was a student of Notre Dame and also went to AMA Computer University. She was working as a beauty consultant when she met Manny Pacquiao, whom she married in 2000. They have five children. On April 27, 2014, she gave birth to a boy named Israel Pacquiao.

In 2012 Pacquiao decided to run for vice governor of Sarangani province in Mindanao, after her husband was reluctant to choose between two friends who both wanted his support for the position. She was elected in the May 2013 election as the candidate of the United Nationalist Alliance.', 'General Santos, Philippines', 1, '/x6EmadwgsoDCgmc9wjruwngrm4N.jpg'),
