        (1321622, 'Samantha Coughlan', NULL, 'Born and raised in Vancouver, British Columbia, Samantha is a graduate of the acclaimed Circle In The Square Theatre School in New York City.  She moved to London in 2003 forming the theatre company, Suspect Package with fellow Canadian actor Trevor White ( Downton Abbey/ Episodes), where their productions received critical success.  Evening Standard review for "Problem Child": '' It is impossible to maintain a detached reaction to the Suspect Package company''s provocative production, largely due to the impressive Samantha Coughlan''s sympathetically psychotic performance''.', 'Seattle - Washington - USA', 1, '/I1SIvWqYALhFmm2fMDQjTlnI1Y.jpg'),
        (1321628, 'Morfydd Clark', NULL, 'Morfydd Clark is a Welsh stage and screen actress.

She was born in Sweden, where he father was working at the time, and  spent the first two years of her life there. The family then returned to Wales and she was brought up in Cardiff . She educated in a Welsh medium school and, at the age of 13, played Mrs Dai Bread Two in the school''s production of Dylan Thomas'' "Under Milk Wood", her first experience in acting. Her first professional performance was in 2013 in "Blodeuwedd" with Theatr Genedlaethol Cymru.

