        (1326321, 'Saraya-Jade Bevis', '1992-08-17', 'Saraya-Jade Bevis (born 17 August 1992) is an English professional wrestler. She is currently signed to WWE, where she performs under the ring name Paige.

Bevis made her debut in 2005 in the World Association Of Wrestling, a promotion that her family runs, as Britani Knight. She went on to hold several championships on independent circuits within Europe. In 2011, she signed a contract with WWE and started wrestling within its developmental systems. Paige eventually debuted on WWE''s main roster in April 2014.

Bevis was the inaugural NXT Women''s Champion of the company''s developmental branch NXT and also a two-time WWE Divas Champion, at one point holding both titles concurrently from 7 April 2014 – 24 April 2014.', 'Norwich, England, UK', 1, '/wrviNojBOPYI5qc5lQzNhvuPphs.jpg'),
