        (1327011, 'Shane Graham', '1990-12-21', 'Shane Graham was born in Bryan, Texas on December 21st, 1990. Growing up in a small farm town, Shane trained, rode, and competed on horses. When not acting, or riding horses, he was taking various martial arts courses. Once graduating high school, Shane wanted to take his acting abilities further through intensive training and study. He studied at the Austin School of Film and later moved out to New York City to study. He Graduated The New York Film Academy in Acting for Film. He has and continues to study Stanislavski Method, Meisner Technique, and Strasberg Technique to expand his craft and hone is acting. Shane Graham resides in Los Angeles, California.  - IMDb Mini Biography', 'Bryan, Texas, USA', 1, '/ocaacHmany0QrPO2rYyZGLYBYmU.jpg'),
