        (1331023, 'Emilia Jones', '2002-02-23', 'Emilia Jones (born 23 February 2002) is an English child actress, best known for portraying the young Queen of Years, Merry Gejelh, in the 2013 Doctor Who episode "The Rings of Akhaten"and playing the part of Lottie McLeod in the BBC feature-length film What We Did on Our Holiday. She has also worked in theatre including playing Young Fiona in the original cast of Shrek the Musical at the Theatre Royal, Drury Lane and Flora in a stage adaptation of Henry James''s The Turn of the Screw.

Jones'' acting career began in 2010, aged 8 years old, when she appeared as Jasmine in the film One Day.[1] She also portrayed Alice in the Channel 4 drama Utopia, and later that year played the young Queen of Years Merry Gejelh in the British television series Doctor Who episode "The Rings of Akhaten" (2013). In film, Jones has had small roles in One Day (2011) and Pirates of the Caribbean: On Stranger Tides (2011).

