        (1333461, 'Kheiron', '1982-11-21', 'Fils de Hibat Tabib, un juriste iranien, auteur de livres de  sociologie et expert européen sur les questions de violence et de  médiation, Kheiron et sa famille fuient le pays en janvier 1984 pour  arriver en France et s''installer à Pierrefitte-sur-Seine1.

Kheiron travaille durant quatre ans en tant qu''éducateur sur un projet sur les Enfants décrocheurs, pour aider des jeunes à renouer avec l''école, tout en se destinant à une vie artistique2,3,4.

En 2006, il entre au Jamel Comedy Club et écrit des chroniques pour l’émission T’empêches tout le monde de dormir en 2007. L''année suivante, Kheiron joue son premier spectacle intitulé Du Coq à Light où il conjugue différents talents scéniques, dont du rap5. Il se dit inspiré des humoristes américains Jerry Seinfeld et Chris Rock2.

En 2011, il joue sur la scène parisienne du théâtre Montmartre Galabru dans Le Bordel Club, laboratoire de la blague avec notamment Kyan Khojandi.

Kheiron interprète également un personnage secondaire éponyme dans la mini-série Bref, diffusée dans l''émission Le Grand Journal de Canal+ entre août 2011 et juillet 2012 2,4,3.

Depuis 2012, en plus de son travail d''aide-éducateur la journée, il se produit sur scène dans Libre éducation, son stand-up d''improvisations, d''abord au théâtre de Dix heures, puis au Campus Comedy Tour, à L''Européen2,3,6,7 et à l''Alhambra depuis janvier 20141.

Le 27 mars 2013, Kheiron lance son premier album de rap sur le site My Major Company, en 180 jours, il doit réunir la somme de 90 000 euros. L''album sort début 2014 et s''intitule Entre vos mains1.', 'Tehran, Iran', 1, '/v8RYQmiPLjIzT30UDg2A4jYgnzd.jpg'),
