        (1334324, 'Brian Distance', NULL, 'Brian Distance is an American film and television actor known for his portrayals as the "tough-yet-honest" law enforcement officer. He has appeared in numerous film, television and off-Broadway productions. Brian Distance is known for his recurring role on NCIS: New Orleans (CBS) as New Orleans Police Department Sergeant Gordon, and co-star appearances on Billions (Showtime), Bull (CBS), Blindspot (NBC), Daredevil (Netflix), The Mysteries of Laura (NBC), House of Cards (Netflix), 30 Rock (NBC), and a host of other movies and television shows.

Brian Distance was born in Baltimore, Maryland. At a very young age, he cultivated his love for theatre and the performing arts by appearing in several grade school and high school plays.

After witnessing first-hand the September 11th terrorist attacks in the Financial District in New York City, Brian left his job as an investment bank finance attorney to return to his true passion, acting. To further hone his acting chops, Brian graduated from the prestigious William Esper Studio (NYC) Two-Year Professional Actor Training Program. Since then, Brian has appeared in countless feature films, network and cable television programs, and off-Broadway productions.', NULL, 1, '/pVpMTLjhEAGMj6mh5Y4YXel4AiI.jpg'),
