        (1337522, 'Charles Bernard', '1919-03-30', 'Born in Portland Oregon, Charles Bernard began his career in  entertainment at an early age. In California he pursued his calling in  theater at the age of 19. He later would move to Chicago to work in  radio. In 1940, while working as an entertainer at a dude ranch, he met  Eleanor Rose Fehr and they were married two years later.

Charles  Bernard served as a US Navy radioman from 1943 to 1945 he would serve  again in the Korean war. After being honorably discharged he would pick  up his work again in radio working locally at radio stations in his home  of Portland, Oregon. But Charles''s true passion was acting and he went  to work in locally produced Hollywood films and commercials. An  intelligent and kind man, Charles Bernard passed January 21, 2012. He  was a devout husband, compassionate father, and a highly praised actor.', 'Portland, Oregon, USA', 1, '/3NaSVvtCuiemOGI1bHWGSDX0Tjd.jpg'),
