        (1339706, 'Jemma Bolt', NULL, 'Born in Poole on the south coast of the UK, Jemma was a performer from the early age of 3 performing in big stage productions at The Lighthouse (formerly Poole Arts Centre) Jemma carried on performing throughout the school years and often landed the lead roles in the various stage productions which were as diverse as Abigail Williams in Arthur Miller''s ''The Crucible'' to Mr. Toad in ''Wind in the Willows'' which led to her gaining a BTEC ND in Performing Arts and her place at Webber Douglas Academy of Dramatic Arts. Since then Jemma has gone on to have supporting roles in film (''How to Loose Friends and Alienate People'' and ''Last Chance Harvey'') and TV (''Bodies'' BBC and ''Above Suspicion'' ITV). 2011 sees Jemma in her first major role in horror feature film ''The Hike'' and taking the lead in short film ''Drama Queen'' which she also co-produced.

(Credits: jemmabolt.com)', 'Poole, England, UK', 1, '/1eYZVtvGKrqqy1b7AEWRzGV2ffl.jpg'),
        (1339821, 'William Tannen', '1942-08-31', 'Born and raised in New York City, William "Bill" Tannen graduated from Boston University and pursued a career in advertising. He created the famous "Girl Watchers" campaign for Diet Pepsi in 1967, which won four Clio Awards, and then created his own company, Sunday Productions, to produce TV commercials. Tannen moved to Los Angeles in 1972 and continued to direct commercials all over the world, garnering five more Clios in the process. Tannen directed his first feature film, "Flashpoint," in 1984, and went on to direct numerous films, TV series and music videos, the latter including the Commodore''s "Night Shift" in 1985, which won  a Grammy Award for Best R&B Video. Tannen has also taught director''s workshops at the EICAR International Film School in Paris, France.', 'New York City, New York, USA', 1, NULL),
