        (1344345, 'Vivian Fleming-Alvarez', NULL, 'Vivian Fleming-Alvarez was born Vivian Celeste Fleming in Tampa Florida. Her interest in the arts was first discovered when she spontaneously decided at age 15 to try-out for her high school cheerleading squad. After she failed to make the squad, Vivian was approached by the school''s baseball coach who said, "Sorry you didn''t make the squad, but I heard your dance routine was awesome...you should try-out for the dance squad". So she did...and she made the squad! Sparking her love of dance and performing. After graduating from high school, Vivian continued performing through dance as an NFL Football Cheerleader for the Tampa Bay Buccaneers for 4 years. Both experiences were precursors to her acting career. Vivian has held her own in many industries and has earned the admiration and respect of her family, friends and peers alike. There is no limit for Vivian, who is very focused, determined and has a sense of humor to balance. Be sure to stay tuned! Vivian studies (ongoing) at Performer''s Studio Workshop (PSW) in Tampa Florida.', 'Tampa, Florida', 1, NULL),
