        (1352662, 'Charlotte Kirk', NULL, 'Charlotte Sophie Kirk was born in Kent, England. Her passion for acting began at the age of 11 when she fell in love with the stage. She has since performed in Greek dramas and plays such as "Agamemnon," "Arturo Ui," "A Christmas Carol," "Oliver Twist," and "Hairspray." Having attended the prestigious Italia Conti School of Acting in London, her skills were further refined at The Miskin Theatre and Jigsaw Performing Arts. While studying theatre arts, she appeared in commercials for Nintendo Wii and UK Orange Telecom.

Charlotte also became sought after and was photographed for magazines internationally, in particular by renowned Vogue photographer Patrick Demarchelier.

In early 2015, Charlotte Kirk landed a starring role in "Vice" opposite Bruce Willis and Thomas Jane, a sci-fi futuristic thriller. Charlotte has completed seven feature films, including "Black Dog Red Dog" with James Franco, "Fractured" with Vinnie Jones, "Seduced and Abandoned," directed by James Toback, and "Tekken: Kazuya''s Revenge," where she plays a female assassin.

She will also be starring as Nicole Brown Simpson in the upcoming feature film "An American Mystery".

"Gone With The Wind" is her all-time favorite film, as she admires strong heroines. Charlotte presently resides in Los Angeles and is managed by Endorse Management Group and Headline Talent Agency.', 'Kent, England', 2, '/lP6PEXL1hCt5RZL7RYT47D2g5DN.jpg'),
