        (1355923, 'Jeremiah Kissel', NULL, 'Jeremiah Kissel is a thirty-five year veteran of New England''s professional stages, having performed major roles for Boston''s largest theaters, including The Huntington, American Repertory Theater,The Lyric Stage, Commonwealth Shakespeare Company, etc. He is the recipient of several IRNE and Elliot Norton awards, (most recently the 2014 Norton Best Actor for "Imagining Madoff"), and in 2003 was given Boston''s highest theater honor, The Elliot Norton Award for Sustained Excellence. Recent stage appearances include "Three Farces and a Funeral" opposite Alan Alda, "Hamlet" with Jeffery Donovan, "Two Gentlemen of Florence" with Edward Herrmann, and "The Cherry Orchard" with Kate Burton. He has been a SAG member for thirty years, and earliest TV appearances date back to ABC''s "Spencer For Hire". More recently he has appeared in "Black Mass", "The Fighter", "The Great Debaters" and "The Town". He can be seen also opposite Dana Delaney in the pilot episode of "Body of Proof" on ABC. Kissel also has an extensive VO resume, serving many commercial and industrial clients throughout New England, and has voiced several episodes of Boston produced installments of "Nova" and "Frontline".', NULL, 1, '/8gYpS5FIllwi6hGB3opL0kREPgW.jpg'),
