        (1355993, 'Daniel Sobieray', NULL, 'Daniel Sobieray is a California native, born in Newport Beach, California. Daniel is now based in Los Angeles. Daniel grew up in Colorado and was very active in sports from an early age. After accepting a scholarship to Michigan for Ice Hockey, Daniel graduated with a B.A in Finance and Economics. Then Daniel was asked by a top talent agency to model for many well known designers in Europe and was a regular on the runway from 2006-2009. In 2010 Daniel was asked to be in the popular day time soap All My Children. Now you can see him in many t.v shows and feature films.', 'Newport Beach - California - USA', 1, '/rYM24l2s67PAbKH8oViSaVv1zFn.jpg'),
