        (1356758, 'Thomasin McKenzie', '2000-07-01', 'Thomasin "Tom" McKenzie (born July 2000) is a New Zealand actress. Most well known for playing Pixie Hannah in Shortland Street, she has also starred in The Hobbit: The Battle of the Five Armies as Astrid, in Lucy Lewis Can''t Lose as Lucy Lewis, and in the webseries Bright Summer Night as Petra Quince, having the leading role in the film Leave No Trace (2018) and Jojo Rabbit (2019).

Description above from the Wikipedia article Thomasin McKenzie, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 'Wellington, New Zealand', 2, '/cjh0YIKEDNpQkmaZtSg6K7EQNas.jpg'),
        (1356807, 'Nicola Pannelli', '1966-05-26', 'Nato a Como il 26 maggio 1966. Diplomato presso la Scuola di Recitazione del Teatro Stabile di Genova nel 1991.  Tre anni di canto lirico presso il Conservatorio Niccolò Paganini di Genova.  In teatro ha lavorato principalmente con Valerio Binasco, Cristina Pezzoli e Marco Sciaccaluga. Ha lavorato e lavora con il Teatro Stabile di Genova a partire da Anna Laura Messeri e poi con Benno Besson, Massimo Mesciulam, Marco Sciaccaluga, Guido De Monticelli, Vittorio Gassman, Ferdinando Bruni ed Elio De Capitani; per il Centro Teatrale Bresciano con Massimo Castri; per il Teatro Stabile del Veneto con J.Lassalle e con Giuseppe Emiliani; con il Teatro Stabile di Bolzano con Fausto Paravidino. Ha lavorato anche con Giampiero Rappa, Gloriababbi Teatro e Veronica Cruciani. Fa parte della  "Popular Shakespeare Kompany" (PSK), la Compagnia fondata da Valerio Binasco nel 2012. Ha lavorato anche per il cinema (1999 Fandango "Il partigiano Jonnhy" regia Guido Chiesa; 2004 Fox and Gould “Keawe” regia di Valerio Binasco) e la televisione (2000 Love and War in the apennines regia di J.K Harrison). Ha fondato a Genova nel luglio 2001 la Compagnia 

Narramondo Teatro, che è stato ed è il luogo di ricerca sulla tragedia contemporanea, sulla memoria e sulla resistenza. Da Novembre 2013 con Narramondo Teatro è  Direttore Artistico dell''Altrove Teatro della Maddalena di Genova.', 'Como (Italy)', 1, '/9NJBAusEcNvzP8niJPIukEKWBs2.jpg'),
