        (1357035, 'Betsy Landin', NULL, 'Film actress Betsy Landín has had a knack for entertaining audiences since she was the youngest member of the church choir back in Puerto Rico at 3 years old. At the age of 9 her family moved to Orlando, Florida where she grew up singing and acting in church. Her talent, poise, and beauty won her the title "Miss Puerto Rico of Orlando" in 2002. Always passionate about the arts, she went on to get a degree in music from Rollins College. After college Betsy delved into the world of professional acting, exploring a variety of characters from sweet imaginative roles at Walt Disney World and Universal Studios to butt-kicking leading ladies in independent films like "Puppet Apocalypse." After being cast in the feature film "Dolphin Tale" (starring Morgan Freeman, Harry Connick, Jr. and Ashley Judd) Betsy knew it was time to make a break for L.A. Betsy dreams of a lifelong career of playing strong women and being cast in films that inspire audiences. Keep an eye out for this Latina beauty with burgeoning talent.  - IMDb Mini Biography', 'Puerto Rico - USA', 1, '/AcAU5pKy5Rc9RvEn6EBDqPQDlZL.jpg'),
