        (1358272, 'Sally Phipps', '1911-05-25', 'From Wikipedia

Born Nellie Bernice Bogdon in Oakland, California, Phipps

was a 1927 WAMPAS Baby Star who was discovered by Frank Borzage in Los Angeles,

California. She had just completed high school when she began making films. Her

first role in motion pictures was in Bertha, the Sewing Machine Girl (1926).

Soon she completed appearances in both Girls (1927) and Love Makes ''Em Wild

(1927). In Gentlemen Prefer Scotch (1927) Phipps played a charmer in a Fox Film

comedy.

Phipps was the lead for Fox''s production of None but the

Brave and The News Parade (both 1928). Her co-star for the former film was

Charles Morton and the latter was Nick Stuart

Her last screen credit was in the 1929 film Detectives Wanted.', 'San Francisco, California, USA', 1, '/sKDYr22cw9Sw0xerBSe02CKhTNj.jpg'),
