        (1358566, 'Keira Daniels', NULL, '', NULL, 1, NULL),
        (1358567, 'Richard Allan Jones', NULL, 'Richard Allan Jones is an actor, director, musician, singer, and writer. His love of performing emerged early when at the age of three he sang in his church basement imitating Frank Sinatra. Middle and High School included talent shows, school plays/musicals, band, choir, and sports. He added a partner and toured Ohio imitating The Smothers Brothers after graduation. Performing continued at Ohio State, while lettering in swimming and tennis, and working full-time at radio stations WCOL and WBLY. He proudly served in the U.S. Army as a 1st Lt. during Vietnam era, working as AD on training films and the TV program "The Big Picture" at the Astoria Film Studio in NYC. After discharge, he directed television at COAX Cable TV in Columbus, Ohio. He returned to OSU earning a second BA, this time in theater/film, acting in a dozen plays, local TV shows like "The Judge," and performing in area clubs with his brother Bill, as the fabulous "Jones Brothers." He also wrote/directed his first film, and acted in a national documentary "Do More than Dream," as well as writing/performing the title song. An MA from Ohio State in Journalism led to a twenty-plus-year career in public relations/marketing, more community theater, as well as publishing his first novel, "Drafted" under the pen name Rich Allan. Moving with his family to LA in 2008, he has since appeared in three dozen films and TV shows, did character voice-overs for video games &amp; movies, finished a second novel, and continues his love of music, writing songs, and performing with his 60s rock band, Revolution Road. Like most actors, he is still searching for his first big break.', NULL, 1, '/hUKXl0SNOctSaED8sh74ZU45XWB.jpg'),
