        (1358988, 'Kennedi Clements', '2007-01-21', 'Kennedi Clements was born in White Rock, British Columbia in January of 2007. She is the oldest of three children. She began acting at the age of 3 and booked a lead role in the TV movie, "A Family Thanksgiving" shortly after as her first role. It was obvious, even at such a young age, that this was a passion for her. When she is not busy acting she is very involved with her figure skating and dancing as well.  - IMDb Mini Biography', 'White Rock, British Columbia, Canada', 1, '/7n7cbOwMeJA6YinlhW9TaoE67YQ.jpg'),
        (1358989, 'Maria J. Cruz', NULL, 'Maria J. Cruz is a born and raised Vancouver, BC actor. She booked her first professional theatre gig while attending her final year of the University of British Columbia''s Theatre program. As "Tina", in ''Tony ''n'' Tina''s Wedding'', Vancouver''s longest running stage play, she was married hundreds of times to over a half a dozen different "Tony''s" and has gone onto play the independent stages of Vancouver and Toronto, including the iconic Second City. She lives best in acerbic comedic roles and the Classics - having had several favourable reviews in Restoration plays.

Taking some time off shortly after the new millennium to obtain her Masters degree in Museum studies, she returned to her first love of acting over 6 years ago and plans to "stay on the bus". She has had not one, but two recurring roles as a nanny - on 1999''s NBC remake ''Cold Feet'' and on the upcoming ''Girlfriend''s Guide to Divorce'', Bravo TV''s first even scripted series.

This year Maria had the opportunity to perform her one-woman stage play (in her native Portuguese and English) in the middle of the Atlantic at the ''Azores International Fringe Festival''. She is looking forward to taking on the role of creator, producer and actor in SMAK!Productions independent Feature Film, ''The Parties''.

- IMDb Mini Biography', 'Vancouver, British Columbia, Canada', 1, '/nMRboVpddM5HdrlWTQD4NAvpoQe.jpg'),
