        (1362742, 'J.P. Valenti', '1983-04-21', 'Born to a working-class Italian-American family; JP learned at an early age the importance of hard work, dedication and perseverance. His parents Paula and Jeffery Valenti constantly instilled in him the idea that he could become anything he set his mind to. From the time he was a young child he has always gravitated toward creative arts. Whether it was writing, doing comedic impressions or creating his own talk show. In addition to this, JP has always been very active in athletics. Participating in sports like Baseball, Football, Track & Field, Soccer and Basketball. He attended the University of Connecticut where he double majored in Communication Sciences and Sociology.', 'Hartford, Connecticut, U.S.A', 1, '/v7HZOav3N1FMZTfU2jFaU9dRIyp.jpg'),
        (1362791, 'Molly Glynn', '1968-06-14', 'From Wikipedia, the free encyclopedia.

Molly Glynn (June 14, 1968 – September 6, 2014) was an American actress: She was a well-known Chicago stage actress, and also played several roles in film and television, including a recurring role on Chicago Fire.Glynn, the youngest of four children, grew up as part of a prominent family in Hartford, Connecticut. She graduated from Tufts University, and spoke several languages.

She was married to Joe Foust at the time of her death. Glynn died from injuries from a falling tree in September 2014. She and Foust were bicycling on the North Branch Trail in Erickson Woods on September 5 when a sudden storm swept through; wind gusts were over 70 miles per hour (110 km/h) nearby. The tree fell on them just as they were about to take shelter. Foust was not significantly injured, but Glynn died of her injuries on September 6 at a hospital in Evanston, Illinois. By September 8, a GiveForward.com memorial fund had collected $135,000. At the time of her death, both her sons, from a previous marriage, were teenagers.', 'West Hartford - Connecticut - USA', 1, '/9xy6Ofe0OUGM9THc4x0pUyIZTJd.jpg'),
