 5, Baca began modeling for romance novel covers. As of August 2012, he has graced the covers of over 100 romance and sci-fi novels. Jason is known best for his candid interviews with numerous author blogs expressing his concern for smooth skin and maintaining good health.  In 2011, he appeared in Men''s Fitness Australia, Exercise &amp; Health Magazine, Men''s Workout, Optimyz Fitness and Scene Bay Area doing various interviews on how to stay fit and younger looking.', 'San Jose - California - USA', 1, '/uHoqZxmyVYocSDCk1tX5EkSr6Da.jpg'),
