        (1366693, 'Berna Roberts', NULL, 'Berna Roberts is a classically trained actress originally from East  Chicago, Indiana. She began work in the theater at age 12. She continued  working regularly until she took a break to pursue a degree in  Psychology. Berna returned and made the move to New York to study  theater, but, instead, booked her first film. Immediately following  filming, she landed the lead in a pilot called The Dossier, which was  set to film in Las Vegas. She packed a bag and moved to Las Vegas a week  later. This move ultimately brought her to California where she  officially began her pursuit in film and television. Berna sought out  the best in education towards her craft and in technique studying  Meisner and Stanislavsky. She has never stopped studying, as she feels  you never stop learning as an artist. She is a company member of The New  American Theater Company at The Odyssey Theater in Los Angeles.', NULL, 1, '/oneVWO45lc8NnSE7PIHhi30gekT.jpg'),
