        (1367205, 'Mike Weerts', '1982-03-24', 'Mike Weerts (Overloon, 24 maart 1982) is een Nederlands acteur.  Weerts wilde van jongs af aan acteur of komiek worden. Met zijn imitatie vanUrbanus vermaakte hij als kind thuis zijn familie. Na het behalen van zijnmavodiploma ging hij van 1998 tot 2001 naar de Sociaal Pedagogisch Werk (SPW) Gilde Opleidingen in Venray. Hij bezocht daarna de Drama Academie in Eindhoven.  Weerts was in verschillende theatervoorstellingen te zien, waaronder Route Soleil van Yvonne van Beukering uit 2005 en Koningsmoord van Piet Arfeuille. Hij was te zien in enkele tv-reclamespotjes, waaronder die van McDonald''s en Douwe Egberts.  Sinds 2004 is hij op televisie te zien in daadwerkelijke programma''s. Hij speelde in de soap Onderweg naar Morgen en had een gastrol in de politieserie Van Speijk. Van 18 maart 2007 tot en met 30 januari 2010 was hij wekelijks te zien in de serie Voetbalvrouwen, als Danny.  In juni 2008 speelde hij in de videoclip ''Impossible'' van zangeres Joyze en in juli 2009 in de videoclip ''Slaap ik bij jou'' vanRobert Leroy.  Weerts trouwde op 6 juli 2012 in Overloon met zijn vriendin Willemijn van Daal. Ze hebben samen een zoon.', 'Overloon - Noord-Brabant - Netherlands', 1, '/1IT8t1IVlEjI8xM6K8DfPNprKz8.jpg'),
