        (1367224, 'Michael Todd Behrens', NULL, '', NULL, 1, NULL),
        (1367225, 'Brenden Whitney', '1988-05-30', 'Brenden Whitney was born in Salt Lake City, Utah where he spent the majority of his childhood playing sports.  In his Junior Year of High School, Brenden was invited to take a theater class to fill up an extra slot in his class schedule and he very quickly fell in love with the art of improv comedy.  Brenden has trained at the Professional Actors Conservatory, Upright Citizens Brigade in Los Angeles, with Glenn Morshower and multiple teachers of various methods. He continues to study the philosophies of Sanford Meisner, Constantin Stanislavski, Ivana Chubbuck and Eric Morris.  Brenden recently had a series regular role in the new web based series Crash Pad. He won his first award for Best Leading Actor as Louis in the short film Immaculate Misperceptions. He played the supporting role of Ash in Blood Fare, which was nominated for Best Picture at the Salty Horror Film Festival.  Brenden has had the opportunity to play 2 iconic stage roles; Romeo in "Romeo and Juliet" and Lt. Daniel Kaffe in "A Few Good Men".', 'Salt Lake City - Utah - USA', 1, '/thBPCPg8PkTbdwPEXoqideHn8PI.jpg'),
