        (1367619, 'Erik Valdez', '1979-08-26', 'The son of a 2nd generation cotton farmer turned salesman, and an  artistic, free spirited mother, Erik Valdez was born in Lubbock, TX.  Since childhood, all he ever really wanted to do was race cars and  entertain people; he learned to drive on his grandparent''s farm at age 6  and was cast in his first play at age 7. Although Erik spent the  majority of his years growing up in El Paso, TX, he still considers  himself a country boy at heart and credits his grandparent''s and  parent''s humble upbringings to his genuine appreciation of life and  opportunities.

Having done a lot of theater throughout the years,  Erik decided to pursue a career in TV and Film and moved to Los Angeles  in the summer of 2004. In his spare time, Erik enjoys working on and  driving cars, traveling, volunteering with charities and organizations  such a The Young Storytellers Foundation, and spending time with friends  and family.', NULL, 1, '/jBlAQ9mJ7MG5LH6UD4lYq3cb9iB.jpg'),
        (1367620, 'Jamie Gray Hyder', NULL, 'A native of Washington D.C., Jamie Gray Hyder is a young actress best  known for her breakout role as the werewolf Danielle, on HBO''s True  Blood. Pursuing her passion to perform, she has been involved with the  theatre and professional stage from a very young age. Jamie received her  B.A. in Theatre and Film Studies from the University of Georgia, Athens  and is a classically trained singer. Since completing her degree, Jamie  has made her name as a reputable actress both on stage and on screen.  She has made numerous appearances as the principal in music videos for  artists including John Mayer, N.E.R.D., Sean Kingston, and The Killers.  Additionally, Jamie has appeared in commercials for Toyota, Pantene,  PacSun, McDonalds, and many others. In her spare time, she''s an  accomplished home cook and food lover, and music enthusiast.', NULL, 1, '/iBHasY7fnCGSS3144mblgkG8mfO.jpg'),
