        (1368800, 'Spencer Drever', '2003-08-30', 'Spencer''s acting career started in the first grade when, at the suggestion of his teacher, he started to go out for auditions. A natural performer with a great memory and work ethic, he quickly booked commercials spots for Target, Applebee''s, Armstrong Cheese and others. But when Spencer picked up a small role in the second chapter of the Wimpy Kid franchise, everything changed. Spencer knew he wanted to do more... and more he did, working with onscreen talent such as Drea De Matteo, Valerie Harper, Martin Freeman and more. For many young performers, this type of commitment comes at the expense of other things: school, sports, even a childhood. For Spencer''s parents, however, creating the next child star has never been a goal. Maintaining a healthy balance for Spencer has meant that sometimes the hockey game takes priority over the audition. Personal commitments, he has learned, are just as important as professional ones. As a result, Spencer has continued to book larger and larger roles while continuing to enjoy ice hockey, skateboarding and sometimes, even school.', 'Vancouver, Canada', 1, '/zEOTzwQaSrQQR1mT6My8HYrLX58.jpg'),
