        (1371397, 'R. Marcos Taylor', NULL, 'At five years old, all Marcus wanted to become was Superman. When he realized that couldn''t happen, he decided taking Karate lessons was the next best thing. Marcus went on to earn a black belt in Karate, but along the way he began developing a love for various martial art forms. In addition to Karate, Marcus began intensive training in: Taekwondo, Muay Thai, Capoeira, and Hapkido, and has more than twenty years of training in these forms. Marcus holds the rank of Kru in Muay Thai. Marcus also trains in several other martial art forms including: Kung Fu, Boxing, Judo, Ninjitsu, Gracie Jui Jitsu, etc. He has fought in tournaments and won titles including: the NJ StateTaekwondo Champion 1994, YB Choi Taekwondo Invitational Champion 1995, and the Muay Thai Warriors Cup Super-Heavy Weight Champion 2010. He has also worked as a certified personal trainer, gym owner, professional fighter, bodyguard, and has taught martial arts and self-defense locally and internationally for the last twenty-four years. Marcus also works as an actor and stuntman, where his strongest areas are fight scenes, stunt doubling, choreography, and stunt falls. Although being Superman was unrealistic, he''s found that being a student of martial arts was far more rewarding. Marcus has over 30 years of experience in martial arts and is hoping for many more years of learning and teaching the art form he came - IMDb Mini Biography By: Nicole Taylor', NULL, 1, '/4wZu4sBgV1NT9Z2ygj1qFnkJLAd.jpg'),
        (1371398, 'O''Shea Jackson Jr.', '1991-02-24', 'O''Shea Jackson, Jr. (born February 24, 1991), also known as OMG, is an American rapper and actor. Jackson is the son of rapper and actor Ice Cube, and he portrayed his father in the 2015 biopic Straight Outta Compton.

Jackson was born in Compton, California, to O''Shea Jackson, better known as Ice Cube, and Kimberly Woodruff. He has two brothers, Darryl and Sharif, and a sister Kareema. His brother Darryl is also a rapper under the name Doughboy, which is the nickname of the character his father portrayed, Darin "Doughboy" Baker, in his first film Boyz n the Hood.

In June 2014, it was announced that Jackson had been cast to portray his father in Straight Outta Compton, a biographical film about N.W.A. The film was released on August 14, 2015. Jackson is noted for his physical resemblance to his father, which Ice Cube described as "spot on." "He was born to play the part," he told Jimmy Kimmel in October 2014.

Description above from the Wikipedia article O''Shea Jackson Jr., licensed under CC-BY-SA, full list of contributors on Wikipedia.', 'Compton, California, USA', 3, '/zov23iUpL3QFHqzjdtzrBGOQYaF.jpg'),
