        (1373304, 'Harrison Holzer', NULL, 'A native New Yorker, Harrison Holzer made his film debut playing the incomparable Sam Rockwell''s son in "Better Living Through Chemistry." He has two great loves: his Knicks and comedy. He was an improvisational tour de force receiving stellar reviews in the Sony movie "Sex Tape." He expertly sharpened swords with the masterful Jason Segel. Harrison has very fond memories of that set. The top being when Ms. Diaz, fed him off her fork some of her delicious kale salad. He also was a series regular in the ABC pilot "Nerd Herd." He spends much time in LA, but a bit of his heart is always in his beloved NYC.', 'New York - USA', 1, '/cpUEQGjfmqg5xQtaDpPz6LabTp0.jpg'),
